	(5, 0, 0, 0, 'GIỚI THIỆU SƠ LƯỢC', 'gioi-thieu-so-luoc', '', '<p>C&ocirc;ng ty&nbsp;<span><strong>TNHH TM &ndash; DV Vận tải To&agrave;n Li&ecirc;m</strong></span>&nbsp;ch&uacute;ng t&ocirc;i từ khi mới th&agrave;nh lập cho đến nay lu&ocirc;n lu&ocirc;n thực hiện phương ch&acirc;m Lấy sự h&agrave;i l&ograve;ng của kh&aacute;ch h&agrave;ng l&agrave;m mục ti&ecirc;u ph&aacute;t triển. Ch&uacute;ng t&ocirc;i hiểu rằng kh&aacute;ch h&agrave;ng vừa l&agrave; đối tượng phục vụ của m&igrave;nh v&agrave; cũng l&agrave; mục ti&ecirc;u sống c&ograve;n của doanh nghiệp.Ch&iacute;nh v&igrave; vậy m&agrave; trong mọi hoạt động của ch&uacute;ng t&ocirc;i kh&aacute;ch h&agrave;ng lu&ocirc;n lu&ocirc;n ở vị tr&iacute; trung t&acirc;m.</p>\r\n<p>C&aacute;c lĩnh vực hoạt động ch&iacute;nh :<br />+&nbsp;<strong><em>N&acirc;ng - Cẩu - Vận chuyển c&aacute;c loại h&agrave;ng h&oacute;a</em></strong></p>\r\n<p><strong><em><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://nangcautoanliem.com/upload/vanchuyen/3.jpg\\" alt=\\"\\" width=\\"700\\" height=\\"600\\" /></em></strong></p>\r\n<p><span style=\\"line-height: 1.5;\\">+&nbsp;</span><strong style=\\"line-height: 1.5;\\"><em>R&uacute;t ruột container bằng xe n&acirc;ng v&agrave; xe cẩu</em></strong></p>\r\n<p><strong style=\\"line-height: 1.5;\\"><em><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://nangcautoanliem.com/upload/container/2.jpg\\" alt=\\"\\" width=\\"614\\" height=\\"421\\" /></em></strong></p>\r\n<p>+<em>&nbsp;<strong>L&agrave;m thủ c&ocirc;ng đưa thiết bị trong vị tr&iacute; hẹp</strong></em></p>\r\n<p><em><strong><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://nangcautoanliem.com/upload/congtrinh/3.jpg\\" alt=\\"\\" width=\\"700\\" height=\\"600\\" /></strong></em></p>\r\n<p>+&nbsp;<strong><em>Vận chuyển N&acirc;ng - Cẩu v&agrave; l&agrave;m thủ c&ocirc;ng với những thiết bị si&ecirc;u trường, si&ecirc;u trọng v&agrave;o vị tr&iacute; lắp đặt.</em></strong></p>\r\n<p><strong><em>&nbsp;<img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://nangcautoanliem.com/upload/upload/IMG_0047.JPG\\" alt=\\"\\" width=\\"700\\" height=\\"525\\" /></em></strong></p>\r\n<p><span style=\\"line-height: 1.5;\\">Với phương ch&acirc;m hoạt động: Nhanh &ndash; gọn &ndash; rẻ,&nbsp;</span><span style=\\"line-height: 1.5;\\"><strong>C&ocirc;ng ty TNHH TM &ndash; DV Vận tải To&agrave;n Li&ecirc;m</strong></span><span style=\\"line-height: 1.5;\\">&nbsp;đ&aacute;p ứng mọi nhu cầu vận chuyển của Qu&yacute; kh&aacute;ch h&agrave;ng trong cuộc sống hiện đại. Với tinh thần tr&aacute;ch nhiệm cao, ch&uacute;ng t&ocirc;i đảm bảo h&agrave;ng h&oacute;a của Qu&yacute; kh&aacute;ch được đ&oacute;ng g&oacute;i, bảo vệ v&agrave; vận chuyển an to&agrave;n. Nếu xảy ra mọi hư tổn hoặc thất tho&aacute;t về t&agrave;i sản trong qu&aacute; tr&igrave;nh vận chuyển ch&uacute;ng t&ocirc;i sẽ bồi thường thiệt hại thỏa đ&aacute;ng.</span></p>\r\n<p><span style=\\"line-height: 1.5;\\">Ngo&agrave;i ra, ch&uacute;ng t&ocirc;i c&oacute; đội ngũ l&aacute;i xe d&agrave;y dạn kinh nghiệm, năng động, tận t&acirc;m, phục vụ 24/24,&nbsp;</span><span style=\\"line-height: 1.5;\\"><strong>To&agrave;n Li&ecirc;m</strong></span><span style=\\"line-height: 1.5;\\">&nbsp;đ&atilde; v&agrave; đang được nhiều tổ chức, c&aacute; nh&acirc;n biết đến v&agrave; đặt l&ograve;ng tin v&agrave;o chất lượng dịch vụ. Ch&uacute;ng t&ocirc;i lu&ocirc;n phấn đấu với mục ti&ecirc;u Lấy sự h&agrave;i l&ograve;ng của kh&aacute;ch h&agrave;ng l&agrave;m mục ti&ecirc;u ph&aacute;t triển, t&igrave;m mọi phương &aacute;n để phục vụ kh&aacute;ch h&agrave;ng ng&agrave;y một tốt hơn.</span></p>\r\n<p><span style=\\"line-height: 1.5;\\">Đến với&nbsp;</span><span style=\\"line-height: 1.5;\\"><strong>To&agrave;n Li&ecirc;m</strong></span><span style=\\"line-height: 1.5;\\">, h&agrave;ng h&oacute;a của Qu&yacute; kh&aacute;ch sẽ được đ&oacute;n nhận v&agrave; vận chuyển an to&agrave;n, kịp thời v&agrave; đ&uacute;ng hẹn&hellip;bởi ch&uacute;ng t&ocirc;i lu&ocirc;n l&ecirc;n kế hoạch v&agrave; tư vấn c&aacute;c phương &aacute;n chuyển dọn v&agrave; vận chuyển một c&aacute;ch chặt chẽ v&agrave; tiện lợi nhất.</span></p>\r\n<p>Khi c&oacute; nhu cầu, Qu&yacute; kh&aacute;ch chỉ cần gọi:<span>&nbsp;<strong>0913.641.824 &ndash; 0906.650.666</strong>&nbsp;-&nbsp;<strong>NGUYỄN TRUNG LI&Ecirc;M</strong></span>&nbsp;ch&uacute;ng t&ocirc;i sẽ đ&aacute;p ứng ngay nhu cầu qu&yacute; kh&aacute;ch h&agrave;ng.</p>', 1, 1, 1402141567, 1402718450, 'logo-cong-ty_1402718450.jpg', 'logo-cong-ty_1402718450_300x250.jpg', '', '', '', '', '', '', '', '', '', '', 'INTRODUCTION', '', '', '', '', '', 21);
