	(1, 0, 0, 0, 'Giới thiệu', 'gioi-thieu', '', '<p>nội dung</p>\r\n', '', 1, 1, 1397205975, 1397271774, '', '', '', '', '', '', '', '', '', '', '', 'About Us', '', '<p>nội dung</p>\r\n', '', '', '', 25, 'top'),
	(2, 0, 0, 0, 'Dịch vụ điện lạnh', 'dich-vu-dien-lanh', '', '<p><strong>Điện lạnh Thi&ecirc;n &Acirc;n&nbsp;ngo&agrave;i ph&acirc;n phối c&aacute;c loại m&aacute;y mới 100% ch&iacute;nh h&atilde;ng. Cty Điện lạnh Thi&ecirc;n &Acirc;n&nbsp;c&ograve;n c&oacute;&nbsp;1 số dịch vụ kh&aacute;c:</strong></p>\r\n\r\n<p><strong>- Tư vấn, thi c&ocirc;ng lắp đặt hệ thống lạnh</strong></p>\r\n\r\n<p><strong>- Thanh l&yacute;&nbsp;m&aacute;y cũ gi&aacute; cao&nbsp;(<a href=\\"http://thanhlymaycu.com/\\" target=\\"_blank\\">M&aacute;y lạnh cũ</a>, <a href=\\"http://dienlanhtranvinh.com/About.aspx?IDIntro=4&amp;page=dv#\\">kho lạnh</a>, hệ thống lạnh, Chillers, m&aacute;y n&eacute;n, nh&agrave; xưởng, văn ph&ograve;ng...) hoặc đổi cũ lấy m&aacute;y mới.</strong></p>\r\n\r\n<p><strong>- Giao h&agrave;ng v&agrave; lắp đặt tận nơi trong Th&agrave;nh phố Hồ Ch&iacute; Minh.</strong></p>\r\n\r\n<p>- Tham gia đấu gi&aacute;, nhận <a class=\\"text_news\\" href=\\"http://www.dienlanhtranvinh.com/\\">Đấu thầu điện lạnh</a>,<a class=\\"text_news\\" href=\\"http://www.dienlanhtranvinh.com/\\"> đấu thầu m&aacute;y lạnh</a> cũ v&agrave; mới.<br />\r\n<br />\r\nngo&agrave;i ra c&ograve;n nhận <a class=\\"text_news\\" href=\\"http://www.dienlanhtranvinh.com/\\">thiết kế x&acirc;y dựng</a>&nbsp;c&aacute;c d&agrave;n lạnh, điều h&ograve;a, nh&agrave; h&agrave;ng tiệc cưới, c&aacute;c t&ograve;a nh&agrave;&hellip;C&aacute;c c&ocirc;ng tr&igrave;nh <a class=\\"text_news\\" href=\\"http://www.dienlanhtranvinh.com/\\">x&acirc;y dựng địa ốc</a>, <a class=\\"text_news\\" href=\\"http://www.dienlanhtranvinh.com/\\">x&acirc;y dựng điện</a> c&ocirc;ng nghiệp, <a href=\\"http://dienlanhtranvinh.com/\\">nh&agrave; h&agrave;ng tiệc cưới tp.hcm</a> c&oacute; nhu cầu <a class=\\"text_news\\" href=\\"http://www.dienlanhtranvinh.com/\\">mời thầu điện lạnh</a>, <a class=\\"text_news\\" href=\\"http://www.dienlanhtranvinh.com/\\">mời thầu m&aacute;y lạnh</a></p>\r\n\r\n<p><br />\r\n* Đặc biệt hiện nay Ch&uacute;ng t&ocirc;i đang cung cấp c&aacute;c loại <a href=\\"http://dienlanhtranvinh.com//may-lanh-tiet-kiem-dien-60-af3-42.html\\">m&aacute;y lạnh tiết kiệm điện</a>.</p>\r\n\r\n<p><br />\r\nXin vui l&ograve;ng li&ecirc;n hệ Điện lạnh trần vinh. - Hotline: <span style=\\"color:rgb(0, 0, 0); font-family:arial,helvetica,sans-serif; font-size:14px\\">0984 567 565</span>&nbsp;(Mr. Việt)<br />\r\nXin ch&acirc;n th&agrave;nh cảm ơn!</p>\r\n', '', 2, 1, 1397206069, 1397544422, '', '', 'Dịch vụ điện lạnh', '', '', '', '', '', '', '', '', 'services', '', '', '', '', '', 32, 'top'),
	(3, 0, 0, 0, 'Báo giá', 'bao-gia', '', '<p>Vui l&ograve;ng gọi hoặc gởi email cho Ch&uacute;ng t&ocirc;i để nhận bảng b&aacute;o gi&aacute; mới nhất!</p>\r\n\r\n<p>Hoặc gọi trực tiếp cho Anh Việt&nbsp;0984567565-0937633696</p>\r\n\r\n<p><strong>C&ocirc;ng ty TNHH TM-DV Cơ Điện Lạnh Thi&ecirc;n &Acirc;n&nbsp;</strong>Địa chỉ:36/10B ĐƯỜNG SỐ 5-AN B&Igrave;NH DĨ AN-B&Igrave;NH DƯƠNG - Website: dienlanhthienan.com<br />\r\nĐT: 0984567565-0937633696- Email:<span dir=\\"ltr\\"><a href=\\"mailto:dienlanhthienan@gmail.com\\" target=\\"_blank\\">dienlanhthienan@gmail.com</a></span><br />\r\n<strong>Hotline: </strong>0984567565-0937633696<strong>( A.Việt)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><span style=\\"color:black\\">Qu&yacute; kh&aacute;ch vui l&ograve;ng tham khảo ph&eacute;p t&iacute;nh chọn c&ocirc;ng suất cho m&aacute;y lạnh ( Theo thời tiết Miền nam -Việt&nbsp;</span><span style=\\"color:black; font-size:11pt\\"><span style=\\"font-size:small\\">Nam</span></span><span style=\\"color:black\\">) như sau:</span></div>\r\n\r\n<div><span style=\\"color:black\\">T&iacute;nh thể t&iacute;ch ph&ograve;ng&nbsp;<strong><em>V= D&agrave;i x Rộng x Cao</em></strong></span></div>\r\n\r\n<div><strong><em><span style=\\"color:black\\">C&ocirc;ng suất lạnh cần d&ugrave;ng = V chia cho 35 hoặc 40</span></em></strong>&nbsp;<span style=\\"color:black\\">( Chọn 35 đối với ph&ograve;ng l&agrave;m việc, ph&ograve;ng kh&aacute;ch. Chọn 40 đối với ph&ograve;ng ngủ)</span></div>\r\n\r\n<div><strong><u><span style=\\"color:black\\">V&iacute; dụ:</span></u></strong>&nbsp;<span style=\\"color:black\\">D=5m, R=4m, Cao=2.8m</span></div>\r\n\r\n<div><span style=\\"color:black\\">Thể t&iacute;ch ph&ograve;ng V=DxRxC = 5x4x2.8=56m3</span></div>\r\n\r\n<div><span style=\\"font-size:small\\"><span style=\\"color:black\\">C&ocirc;ng suất lạnh cần d&ugrave;ng: ph&ograve;ng kh&aacute;ch v&agrave; ph&ograve;ng l&agrave;m việc = 56 : 35 =1.6 HP -&gt; ta chọn 1.5HP.</span></span></div>\r\n', '', 3, 1, 1397206081, 1399553287, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 33, 'top'),
	(4, 0, 0, 0, 'Tuyển dụng', 'tuyen-dung', '', '', '', 4, 1, 1397206094, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 24, 'top'),
	(5, 0, 0, 0, 'Mua bán đồ cũ', 'mua-ban-do-cu', '', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Điện lạnh Thi&ecirc;n &Acirc;n chuy&ecirc;n mua b&aacute;n đồ cũ tại nh&agrave;:</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\\"\\" src=\\"/upload/images/1270290087_85576815_3-sua-chua-t-lanh-binh-nong-lanh-Cac-dich-vu-khac-1270290087.jpg\\" style=\\"height:216px; width:220px\\" /></strong></p>\r\n\r\n<p><span style=\\"font-size:small\\"><span style=\\"color:red\\"><strong>C&Ocirc;NG TY TNHH TM-DV CƠ ĐIỆN LẠNH THI&Ecirc;N &Acirc;N</strong></span></span><br />\r\n<span style=\\"font-size:small\\"><strong>Bảo dưỡng - Sửa chữa - Lắp đặt - tại nh&agrave; &amp; Cơ Quan c&oacute; (<span style=\\"color:rgb(255, 0, 0)\\">VAT</span>)</strong></span><br />\r\n<br />\r\n<span style=\\"font-size:small\\"><span style=\\"color:rgb(0, 0, 255)\\"><strong>Trung T&acirc;m điều h&agrave;nh ĐT :</strong></span></span><strong><span style=\\"color:#FF0000\\"><span style=\\"line-height:1.6em\\">0984567565-0937633696</span></span></strong></p>\r\n\r\n<div class=\\"gmail_extra\\">&nbsp;</div>\r\n\r\n<p><u><span style=\\"font-size:small\\"><strong><a href=\\"http://www.dienlanhbachkhoahanoi.net/\\" rel=\\"nofollow\\" target=\\"_blank\\"><span style=\\"color:#006400\\">www.</span></a><span style=\\"color:#006400\\">dienlanhthienan.com</span></strong></span></u><br />\r\n<br />\r\n<span style=\\"font-size:small\\"><span style=\\"color:rgb(0, 0, 255)\\"><span style=\\"color:rgb(0, 0, 0)\\"><strong>Chuy&ecirc;n : ĐIỀU H&Ograve;A - TỦ LẠNH - M&Aacute;Y GIẶT - B&Igrave;NH N&Oacute;NG LẠNH - L&Ograve; VI S&Oacute;NG. </strong></span><br />\r\n<br />\r\n<span style=\\"color:rgb(0, 0, 0)\\"><strong>- BẾP TỪ - M&Aacute;Y H&Uacute;T BỤI, H&Uacute;T ẨM - C&Acirc;Y NƯỚC N&Oacute;NG LẠNH, M&Aacute;Y BƠM NƯỚC. </strong></span><br />\r\n<br />\r\n<span style=\\"color:rgb(0, 100, 0)\\"><strong>CHUY&Ecirc;N SỬA - TIVI - LCD - PLASMA - LED - CRT - DVD - D&Agrave;N &Acirc;M THANH.&nbsp;</strong></span></span></span></p>\r\n', '', 5, 1, 1397206109, 1397544985, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 26, 'top'),
	(6, 0, 0, 0, 'sửa chữa đồ điện tử', 'sua-chua-do-dien-tu', '', '<p><span style=\\"font-size:small\\"><span style=\\"color:red\\"><strong>C&Ocirc;NG TY TNHH TM-DV CƠ ĐIỆN LẠNH THI&Ecirc;N &Acirc;N</strong></span></span><br />\r\n<span style=\\"font-size:small\\"><strong>Bảo dưỡng - Sửa chữa - Lắp đặt - tại nh&agrave; &amp; Cơ Quan c&oacute; (<span style=\\"color:rgb(255, 0, 0)\\">VAT</span>)</strong></span></p>\r\n\r\n<p><strong>CHUY&Ecirc;N SỬA CHỮA TIVI<br />\r\nLCD - PLASMA - LED - CRT -&gt; SỬA TIVI LCD SAMSUNG, LG, TOSHIBA, SONY, SHARP, BENQ, PANASONIC, JVC, HITACHI...</strong><br />\r\n<br />\r\n<strong>Chuy&ecirc;n sửa TI VI - LCD - PLASMA - LED - CRT ( Đ&egrave;n H&igrave;nh) - ĐẦU ĐĨA CD, VCD, DVD - AMPLI - D&Agrave;N &Acirc;M THANH...</strong><br />\r\n<br />\r\n<strong>Sửa chữa tại nh&agrave;, cơ quan bảo h&agrave;nh d&agrave;i hạn.</strong><br />\r\n<br />\r\n<strong>Lưu &yacute;: Qu&yacute; kh&aacute;ch sẽ được b&aacute;o gi&aacute; trước khi sửa. Linh kiện &gt;&gt;&gt; thay thế ch&iacute;nh h&atilde;ng.</strong><br />\r\n<br />\r\n<strong>Với đội ngũ kỹ thuật vi&ecirc;n giỏi đảm nhiệm, ch&uacute;ng t&ocirc;i tin rằng sẽ l&agrave;m h&agrave;i l&ograve;ng qu&yacute; kh&aacute;ch h&agrave;ng.</strong><br />\r\n<br />\r\n<strong>H&atilde;y gọi ngay cho ch&uacute;ng t&ocirc;i khi qu&yacute; kh&aacute;ch cần để được phục vụ tận t&igrave;nh chu đ&aacute;o.</strong><br />\r\n<br />\r\n<strong>C&aacute;c cơ sở trực thuộc C&Ocirc;NG TY TNHH TM-DV CƠ ĐIỆN LẠNH THI&Ecirc;N &Acirc;N</strong><br />\r\n<br />\r\n<strong>ĐC:</strong>36/10B ĐƯỜNG SỐ 5-AN B&Igrave;NH DĨ AN-B&Igrave;NH DƯƠNG</p>\r\n\r\n<p><strong>SĐT:0984567565-0937633696​</strong><br />\r\n&nbsp;</p>\r\n', '', 6, 1, 1397206129, 1397545222, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 58, 'top'),
	(7, 0, 0, 0, 'Phân phối máy lạnh', 'phan-phoi-may-lanh', '- Phân phối các loại máy lạnh chính hãng\r\n- Giá sỉ và lẻ\r\n- Bảo hành tận nơi - Dịch vụ hậu mãi', '', '', 7, 1, 1397271309, 1397271782, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 21, 'bottom'),
	(8, 0, 0, 0, 'Tư vấn & Lắp đặt', 'tu-van-lap-dat', '- Tư vấn, thiết kế & Lắp đặt miễn phí\r\n- Giao hàng tận nơi trong nội thành - Nhận giao hàng ngoại thành\r\n', '', '', 8, 1, 1397272071, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 13, 'bottom'),
