	(1, 'Giới thiệu chung', 'gioi-thieu-chung', '<p>Kapo chuy&ecirc;n sỉ lẻ mặt h&agrave;ng thời trang nam.</p>', '<p><strong><span style=\\"text-decoration: underline;\\">VĂN PH&Ograve;NG GIAO DỊCH</span>: 105A G&Ograve; DẦU, P. T&Acirc;N QU&Yacute;, Q. T&Acirc;N PH&Uacute;, TPHCM, VIỆT NAM</strong></p>\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Email: &nbsp; &nbsp;<a href=\\"https://mail.google.com/mail/?shva=1#inbox\\"> fashionshoppingvietnam@gmail.com</a></strong></p>\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ĐT: &nbsp; &nbsp; (08) 6675 8245_0908 943 165&nbsp;</strong></p>\r\n<p><a title=\\"http://fashionshopping.vn/\\" href=\\"http://fashionshopping.vn/\\">FASHIONSHOPPING.VN</a> l&agrave; website h&agrave;ng đầu về sản xuất v&agrave; ph&acirc;n phối c&aacute;c mặt h&agrave;ng thời trang như quấn &aacute;o thời trang, nịch da b&ograve;, v&iacute; da...v..v</p>\r\n<p><span><a title=\\"http://fashionshopping.vn/\\" href=\\"http://fashionshopping.vn/\\"><span><em><strong>FASHIONSHOPPING.<span>VN</span></strong></em></span></a>&nbsp;<span>l&agrave; doanh nghiệp đi đầu trong lĩnh vực thương mại điện tử Việt Nam với website b&aacute;n sỉ v&agrave; lẻ trực tuyến , hiện đang cung cấp cho kh&aacute;ch h&agrave;ng những trải nghiệm mua h&agrave;ng giảm gi&aacute; với chất lượng tốt nhất, cam kết về uy t&iacute;n, dịch vụ v&agrave; đội ngũ nh&acirc;n vi&ecirc;n chuy&ecirc;n nghiệp, phục vụ &nbsp;tận t&igrave;nh chu đ&aacute;o</span></span></p>\r\n<p><span><strong>Thị trường nội địa</strong>:Hệ thống ph&acirc;n phối thị trường nội địa với hơn 300 đại l&yacute; v&agrave; hơn 100 kh&aacute;ch h&agrave;ng l&agrave; c&aacute;c Cty, nh&agrave; sản xuất ; đồng thời sản phẩm cũng đ&atilde; c&oacute; mặt tại nhiều hệ thống si&ecirc;u thị lớn tr&ecirc;n to&agrave;n quốc như: Metro, Big C, Citimart, Fivimart, Satra...</span></p>\r\n<p><span><strong>Thị trường xuất khẩu</strong>:&nbsp; &Uacute;c. Nhật Bản, H&agrave;n Quốc, &Yacute;, Mỹ&hellip;</span></p>\r\n<div><span><strong>Th&agrave;nh t&iacute;ch</strong>:&nbsp;&nbsp;&nbsp;</span><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chứng nhận ISO 9001:2008 v&agrave; SA 8000 được cấp bởi DNV</span><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Giải thưởng :Thương Hiệu Mạnh&rdquo; năm 2010 được cấp bởi Bộ C&ocirc;ng Thương v&agrave; Thời B&aacute;o Kinh tế Việt nam trao tặng;</span><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Giải thưởng &ldquo;Doanh ngiệp ti&ecirc;u biểu năm 2010&rdquo; được cấp bởi Bộ Thương Mai v&agrave; C&ocirc;ng nghiệp;</span><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Một trong 5 doanh ngiệp ti&ecirc;u biểu của ng&agrave;nh dệt may v&agrave; da gi&agrave;y năm 2009 được cấp bởi Bộ TM v&agrave; CN;</span><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; H&agrave;ng VN Chất lượng cao năm 2009;</span><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nh&agrave; quản l&yacute; giỏi năm 2007 được cấp bởi Tổng li&ecirc;n đo&agrave;n Lao động VN;</span><br /><span>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Giải thưởng &ldquo;Sao v&agrave;ng Đất Việt năm 2006&rdquo; được cấp bởi Hiệp hội Doanh nh&acirc;n trẻ Việt Nam.</span></div>\r\n<address><span><a title=\\"http://fashionshopping.vn/\\" href=\\"http://fashionshopping.vn/\\"><em><strong>FASHIONSHOPPING.<span>VN</span></strong></em></a><span>&nbsp;</span>&nbsp;<span>lu&ocirc;n nỗ lực, phấn đấu để trở th&agrave;nh cầu nối tiếp cận người ti&ecirc;u d&ugrave;ng với phương ch&acirc;m chất lượng l&agrave; danh dự_gi&aacute; cả l&agrave; mục ti&ecirc;u_h&atilde;y truy cập v&agrave;o</span><span><span><strong>&nbsp;<a title=\\"http://fashionshopping.vn/\\" href=\\"http://fashionshopping.vn/\\">FASHIONSHOPPING.<span>VN</span></a></strong>&nbsp;mỗi ng&agrave;y để c&oacute; những ph&uacute;t gi&acirc;y mua sắm thỏa m&aacute;i v&agrave; vui vẻ.</span></span></span></address>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', '', '00310919.jpg', 'thums00310919.jpg', 0, 1, 1225497589, 1339728897);
