	(1, 0, 0, 0, 'Tuyển Cộng tác viên bán hàng CONNECT', 'tuyen-cong-tac-vien-ban-hang-connect', '', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\\"font-size: large; line-height: 1.5;\\" src=\\"http://ketnoimuasam.vn/upload/news/tuyen-dung-1.jpg\\" alt=\\"\\" width=\\"391\\" height=\\"178\\" /></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\"font-size: large;\\"><strong><a href=\\"http://ketnoimuasam.vn\\">Kết nối Mua sắm</a></strong> đang cần tuyển dụng c&aacute;c bạn CTV Kinh doanh</span></p>\r\n<p><span style=\\"font-size: large;\\">&nbsp;</span></p>\r\n<p><span style=\\"font-size: large;\\">C&aacute;c bạn đăng k&yacute; hoặc tư vấn th&ecirc;m li&ecirc;n hệ : <span style=\\"color: #ff0000;\\"><strong>0902 822 801 - Ms Diễm</strong></span></span></p>\r\n<p><span style=\\"line-height: 1.5;\\">&nbsp;</span></p>\r\n<p><span style=\\"font-size: large; color: #000000;\\"><strong>Li&ecirc;n hệ qua Email: <a href=\\"mailto:info@ketnoikinhdoanh.net\\">info@ketnoikinhdoanh.net</a></strong></span></p>\r\n<p><span style=\\"font-size: large; color: #0000ff;\\"><strong>&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\\"http://ketnoimuasam.vn/upload/news/tuyen_dung_5.jpg\\" alt=\\"\\" width=\\"260\\" height=\\"325\\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\"font-size: medium; color: #000000;\\">* M&ocirc;i trường kinh doanh chuy&ecirc;n nghiệp v&agrave; ph&aacute;t triển, ph&ugrave; hợp cho c&aacute;c bạn năng động v&agrave; nhiệt t&igrave;nh.</span></p>\r\n<p><span style=\\"font-size: medium; color: #000000;\\">&nbsp;</span></p>\r\n<p><span style=\\"font-size: medium; color: #000000;\\">** Được đ&agrave;o tạo chuy&ecirc;n nghiệp, đầy đủ về kỹ năng kinh doanh, Digital marketing online, v&agrave; sản phẩm.</span></p>\r\n<p><span style=\\"font-size: medium; color: #000000;\\">&nbsp;</span></p>\r\n<p><span style=\\"font-size: medium; color: #000000;\\">*** Nhiều ch&iacute;nh s&aacute;ch cho nh&acirc;n vi&ecirc;n hấp dẫn ph&ugrave; hợp cho c&aacute;c bạn kinh doanh giỏi.&nbsp;</span></p>\r\n<p><strong><span style=\\"font-size: medium;\\"><span style=\\"color: #ff0000;\\">&nbsp;</span></span></strong></p>\r\n<p><strong><span style=\\"font-size: medium;\\"><img src=\\"http://ketnoimuasam.vn/upload/news/tuyen-dung_4.jpg\\" alt=\\"\\" width=\\"500\\" height=\\"323\\" /></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\"color: #ff6600;\\"><strong style=\\"font-size: small; line-height: 1.5;\\">*** <span style=\\"text-decoration: underline;\\">L&yacute; do v&igrave; sao bạn n&ecirc;n tham gia kinh doanh c&ugrave;ng Connect Group</span> :</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>1. L&agrave;m ở <a href=\\"https://www.facebook.com/ketnoikinhdoanh.net\\">CONNECT GROUP</a> vừa được học vừa được l&agrave;m, lại được giao lưu rất nhiều th&agrave;nh vi&ecirc;n từ nhiều ng&agrave;nh</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>2. Được l&atilde;nh đạo c&ocirc;ng ty hướng dẫn th&agrave;nh thạo, đầy đủ về Kỹ năng KD tr&ecirc;n Facebook, SEO TOP Google, K&ecirc;nh Youtube, Email/SMS Marketing v&agrave; c&aacute;c hệ thống phần mềm hỗ trợ, v&agrave; hệ thống quản l&yacute; doanh nghiệp tại <span style=\\"color: #0000ff;\\"><a href=\\"http://ketnoikinhdoanh.net\\"><span style=\\"color: #0000ff;\\">Dịch vụ C&ocirc;ng ty Kết Nối</span></a></span></strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong><span style=\\"color: #0000ff;\\"><span style=\\"color: #0000ff;\\">&nbsp;</span></span></strong></span></p>\r\n<p><span style=\\"color: #000000;\\"><span style=\\"font-size: small;\\"><strong>3. Họp định kỳ sinh hoạt \\"CLB CTV CONNECT\\"</strong></span><span style=\\"font-size: small;\\"><strong>&nbsp;</strong></span></span><span style=\\"font-size: small;\\"><strong style=\\"line-height: 1.5;\\">hằng tuần tại c&ocirc;ng ty để chia sẻ b&iacute; quyết kinh doanh v&agrave; được gặp gỡ giao lưu gi&aacute;m đốc c&aacute;c nh&atilde;n h&agrave;ng để t&igrave;m hiểu kỹ hơn về sản phẩm v&agrave; chia sẻ kinh doanh.</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong style=\\"line-height: 1.5;\\">&nbsp;</strong></span></p>\r\n<p>&nbsp;<img style=\\"float: left;\\" src=\\"http://ketnoimuasam.vn/upload/doitac/Connect_logo.png\\" alt=\\"\\" width=\\"277\\" height=\\"190\\" /></p>\r\n<p><span style=\\"text-decoration: underline;\\"><span style=\\"color: #000000; text-decoration: underline;\\"><strong><span style=\\"font-size: small;\\">&nbsp;Lịch sinh hoạt đầu năm CLB CTV CONNECT tổ chức v&agrave;o:</span></strong></span></span></p>\r\n<p><span style=\\"color: #0000ff;\\"><strong><span style=\\"font-size: small;\\">&nbsp;* S&aacute;ng thứ 6 ng&agrave;y <span style=\\"color: #ff0000;\\">10/01/2014</span> - Thời gian 8h30 - 11h30 </span></strong></span></p>\r\n<p><span style=\\"color: #0000ff;\\"><strong><span style=\\"font-size: small;\\">&nbsp; &nbsp; <em>( Vui l&ograve;ng li&ecirc;n hệ đăng k&yacute; trước khi tham gia )</em></span></strong></span></p>\r\n<p><span style=\\"color: #ff0000;\\"><strong><span style=\\"font-size: small;\\">&nbsp;Ph&ograve;ng họp Connect tại T&ograve;a nh&agrave; Rosasa, 60 Nguyễn Đ&igrave;nh Chiểu, P.Đa Kao, Q.1, TP HCM</span></strong></span></p>\r\n<p><span style=\\"color: #ff0000;\\"><strong><span style=\\"font-size: small;\\">&nbsp;<img src=\\"http://ketnoimuasam.vn/upload/doitac/phonghop.png\\" alt=\\"\\" width=\\"635\\" height=\\"378\\" /></span></strong></span></p>\r\n<p><span style=\\"color: #ff0000;\\"><strong><span style=\\"font-size: small;\\">&nbsp;<span style=\\"color: #0000ff;\\">C&aacute;c bạn tham gia h&atilde;y đăng k&yacute; sớm ( số lượng tham gia c&oacute; hạn )</span></span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\\"line-height: 1.5;\\" src=\\"http://ketnoimuasam.vn/upload/doitac/MrDung.png\\" alt=\\"\\