;c</strong></span>..</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>&nbsp;</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\\"http://ketnoimuasam.vn/upload/doitac/MrNhan.jpg\\" alt=\\"\\" width=\\"110\\" height=\\"140\\" />&nbsp;<span style=\\"font-size: small;\\"><strong><span style=\\"color: #ff6600;\\">&Ocirc;ng Huỳnh Dương Nh&acirc;n</span>&nbsp;-&nbsp;Gi&aacute;m đốc Kinh doanh Nh&atilde;n h&agrave;ng Gi&agrave;y tăng chiều cao ATTOM, nh&agrave; sản xuất giải ph&aacute;p TĂNG chiều cao với c&aacute;c mẫu Gi&agrave;y thời trang lịch l&atilde;m, thể thao, cao cấp ..d&agrave;nh cho doanh nh&acirc;n v&agrave; giới trẻ.</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong><img src=\\"http://ketnoimuasam.vn/upload/doitac/MrManh.png\\" alt=\\"\\" width=\\"110\\" height=\\"140\\" />&nbsp;<strong><span style=\\"color: #ff0000;\\">&Ocirc;ng Nguyễn Văn Mạnh</span>&nbsp;- Gi&aacute;m đốc OBUS, chuy&ecirc;n gia Facebook Marketing v&agrave; chia sẻ kiến thức, kỹ năng l&agrave;m gi&agrave;u cho c&aacute;c bạn trẻ với Website <a href=\\"http://obus.vn/M746\\">OBUS.VN</a> v&agrave; <a href=\\"http://obus.vn/M746\\">Ch&igrave;a kh&oacute;a l&agrave;m gi&agrave;u</a>.</strong></strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong><strong>&nbsp;</strong></strong></span></p>\r\n<p><img src=\\"http://ketnoimuasam.vn/upload/doitac/Noi_dung_chuong_trinh.png\\" alt=\\"\\" width=\\"983\\" height=\\"635\\" /></p>\r\n<p><span style=\\"font-size: small;\\"><strong><strong>&nbsp;</strong></strong></span></p>\r\n<p><span style=\\"text-decoration: underline; font-size: x-small; color: #ff0000;\\"><strong style=\\"line-height: 1.5;\\">*** Y&ecirc;u cầu chung khi trở th&agrave;nh CTV với CONNECT GROUP</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\"font-size: x-small;\\">Kh&