ages-1_1388574534.jpg', 'images-1_1388574534_300x200.jpg', 'Tuyển Cộng tác viên bán hàng CONNECT', '', 'Tuyển Cộng tác viên bán hàng CONNECT', '', 'Tuyển Cộng tác viên bán hàng CONNECT', '', '', '', '', '', '', '', '', '', '', 352),
	(2, 0, 0, 0, 'Tuyển nhân viên thiết kế đồ họa Website', 'tuyen-nhan-vien-thiet-ke-do-hoa-website', '', '<p><span style=\\"font-size: small;\\"><span style=\\"color: #0000ff;\\"><strong><img src=\\"http://ketnoimuasam.vn/upload/news/banner_AMIS.png\\" alt=\\"\\" width=\\"960\\" height=\\"50\\" /></strong></span></span></p>\r\n<p><span style=\\"font-size: small;\\"><span style=\\"color: #0000ff;\\"><strong>&nbsp;</strong></span></span></p>\r\n<p><span style=\\"font-size: small;\\"><span style=\\"color: #0000ff;\\"><strong>C&ocirc;ng ty Kết Nối </strong></span>l&agrave; một c&ocirc;ng ty Chuy&ecirc;n về C&ocirc;ng Nghệ Th&ocirc;ng Tin, tư vấn / hỗ trợ c&aacute;c hệ thống phần mềm, cung cấp tất cả c&aacute;c sản phẩm dịch vụ li&ecirc;n quan tới website, Digital marketing Online v&agrave; Thương mại điện tử h&agrave;ng h&oacute;a.</span></p>\r\n<p><span style=\\"font-size: small;\\"> Nhằm phục vụ nhu cầu cập nhật những h&igrave;nh ảnh đẹp nhất về sản phẩm đến kh&aacute;ch h&agrave;ng, v&agrave; thương hiệu c&ocirc;ng ty.</span></p>\r\n<p><span style=\\"font-size: small;\\">Mục ti&ecirc;u của Connect Group l&agrave; trở th&agrave;nh Website thương mại điện tử b&aacute;n lẻ SỐ 1 Việt Nam, đồng thời l&agrave; đối t&aacute;c kinh doanh h&agrave;ng đầu của c&aacute;c nh&atilde;n h&agrave;ng nổi tiếng c&ugrave;ng hợp t&aacute;c kinh doanh đến người ti&ecirc;u d&ugrave;ng.</span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>C&ocirc;ng ty Kết Nối tuyển dụng nh&acirc;n sự vị tr&iacute;: Nh&acirc;n vi&ecirc;n thiết kế đồ họa cho Website</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>Số lượng : 02</strong></span></p>\r\n<p><span style=\\"line-height: 1.5; font-size: small;\\">&nbsp;</span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>Y&ecirc;u cầu chung:</strong></span><br /><span style=\\"font-size: small;\\">-&nbsp;&nbsp;&nbsp; C&oacute; tinh thần đam m&ecirc;, y&ecirc;u th&iacute;ch c&ocirc;ng việc v&agrave; tinh thần tr&aacute;ch nhiệm cao.</span></p>\r\n<p><span style=\\"line-height: 1.5; font-size: small;\\">- &nbsp; &nbsp;Thiết kế ấn phẩm văn ph&ograve;ng, poster, brochure, t&agrave;i liệu h&igrave;nh ảnh c&ocirc;ng ty, website, banner, poster &hellip;</span></p>\r\n<p><span style=\\"line-height: 1.5; font-size: small;\\">- &nbsp; &nbsp;Sử dụng th&agrave;nh thạo một v&agrave;i trong số c&aacute;c c&ocirc;ng cụ sau Photoshop, AI illustrator, Corel, Flash, thiết kế 2D-3D v.v...</span></p>\r\n<p><span style=\\"font-size: small;\\">- &nbsp; &nbsp;L&agrave;m việc từ thứ 2 - thứ 6, 8h30 &ndash; 17h</span></p>\r\n<p><span style=\\"line-height: 1.5; font-size: small;\\">-&nbsp;&nbsp;&nbsp; C&oacute; kiến thức cơ bản về C&ocirc;ng Nghệ Th&ocirc;ng Tin, Đồ họa, Quảng c&aacute;o.</span></p>\r\n<p><span style=\\"font-size: small;\\">-&nbsp;&nbsp;&nbsp; Ưu ti&ecirc;n c&aacute;c bạn trẻ sinh vi&ecirc;n hoặc mới ra trường c&oacute; nhiệt huyết bắt đầu c&ocirc;ng việc, sẽ được đ&agrave;o tạo v&agrave; hướng dẫn th&ecirc;m.</span></p>\r\n<p><span style=\\"line-height: 1.5; font-size: small;\\">&nbsp;</span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>Quyền lợi:</strong></span></p>\r\n<ul>\r\n<li><span style=\\"font-size: small;\\">M&ocirc;i trường l&agrave;m việc chuy&ecirc;n nghiệp, rất thực tế, được Training định kỳ về chuy&ecirc;n m&ocirc;n v&agrave; về c&aacute;c dịch vụ của c&ocirc;ng ty.</span></li>\r\n<li><span style=\\"font-size: small;\\">C&oacute; cơ hội ph&aacute;t triển nghề nghiệp bền vững, học tập th&ecirc;m nhiều lĩnh vực kh&aacute;c như phần mềm, SEO, quản trị doanh nghiệp v.v..</span></li>\r\n<li><span style=\\"font-size: small;\\">Lương thỏa thuận, c&oacute; thể đăng k&yacute; l&agrave;m b&aacute;n thời gian hoặc to&agrave;n thời gian theo quy định c&ocirc;ng ty.</span></li>\r\n<li><span style=\\"font-size: small;\\">Sau 2 th&aacute;ng thử việc, khi l&agrave;m ch&iacute;nh thức sẽ được k&yacute; hợp đồng lao động v&agrave; hưởng c&aacute;c khoản phụ cấp theo ch&iacute;nh s&aacute;ch c&ocirc;ng ty.</span></li>\r\n</ul>\r\n<p><span style=\\"font-size: small;\\">&nbsp;</span></p>\r\n<p><span style=\\"font-size: small;\\">Tham gia v&agrave;o CONNECT GROUP&nbsp;bạn sẽ nhận được th&ecirc;m nhiều gi&aacute; trị hơn nữa, biết nhiều hơn, c&ugrave;ng với cơ hội ph&aacute;t triển nghề nghiệp.</span></p>\r\n<p><br /><span style=\\"font-size: small;\\">Hồ sơ th&ocirc;ng tin CV c&aacute; nh&acirc;n xin việc xin gửi về:&nbsp;<strong><a href=\\"mailto:info@ketnoikinhdoanh.net\\">info@ketnoikinhdoanh.net</a></strong><a href=\\"mailto:hr@fibo.vn\\"><br /></a></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>HOTLINE hỗ trợ : <span style=\\"color: #ff0000;\\">0902 822 801 - Ms Diễm</span></strong></span></p>\r\n<p><span style=\\"font-size: small;\\">&nbsp;<img src=\\"http://ketnoimuasam.vn/upload/news/tuyen_dung_5.jpg\\" alt=\\"\\" width=\\"398\\" height=\\"487\\" /></span></p>\r\n<p><span style=\\"text-decoration: underline; font-size: small;\\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\\"text-decoration: underline; font-size: small;\\"><strong>Th&ocirc;ng tin li&ecirc;n lạc:</strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>C&ocirc;ng ty TNHH Đầu tư Thương mại dịch vụ Kết Nối</strong></span><br /><span style=\\"font-size: small;\\">T&ograve;a nh&agrave; Rosana, 60 Nguyễn Đ&igrave;nh Chiểu, P.Đa Kao, Q.1, TP HCM</span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>Web:&nbsp;<span style=\\"font-family: \\\'Times New Roman\\\', Times, serif;\\"><span style=\\"color: #3333ff;\\"><a href=\\"http://ketnoikinhdoanh.net/\\" target=\\"_blank\\">ketnoikinhdoanh.net</a></span>&nbsp;I&nbsp;<a href=\\"http://ketnoimuasam.vn\\">http://ketnoimuasam.vn</a></span></strong></span></p>\r\n<p><span style=\\"font-size: small;\\"><strong>Facebook<span style=\\"line-height: 1.5;\\">: <a href=\\"https://www.facebook.com/ketnoikinhdoanh.net\\">CONNECT GROUP</a