INSERT INTO `table_dichvu` (`id`, `id_item`, `id_cat`, `tinnoibat`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `photo`, `thumb`, `alt_img`, `title_vi`, `title_en`, `description_vi`, `description_en`, `keywords_vi`, `keywords_en`, `title_cn`, `keywords_cn`, `description_cn`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `luotxem`) VALUES
	(5, 0, 0, 0, 'GIỚI THIỆU SƠ LƯỢC', 'gioi-thieu-so-luoc', '', '<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px"><strong><u>I.&nbsp;&nbsp;Tư vấn - Thiết kế - Thi c&ocirc;ng hệ thống bảo vệ m&ocirc;i trường:</u></strong></span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;HTXL nước thải c&ocirc;ng nghiệp: giặt tẩy, cao su, thực phẩm, giấy, dệt nhuộm&hellip;</span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;HTXL nước thải bệnh viện, ph&ograve;ng kh&aacute;m, cơ sở y tế;</span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;HTXL nước thải sinh hoạt: chung cư, cao ốc, văn ph&ograve;ng, kh&aacute;ch sạn&hellip;</span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;HTXL kh&iacute; thải: l&ograve; hơi, m&aacute;y ph&aacute;t điện, hơi dung m&ocirc;i, sơn&hellip;</span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;HTXL nước cấp c&ocirc;ng nghiệp: nước RO, l&agrave;m mềm&hellip;</span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;Hệ thống nước uống trực tiếp cho hộ gia đ&igrave;nh, cơ quan, x&iacute; nghiệp, bệnh viện, kh&aacute;ch sạn &hellip;</span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px"><strong><u>II.&nbsp;&nbsp;Dịch vụ lắp đặt</u></strong></span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;Hệ thống xử l&yacute; nước cấp.</span></span></p>\r\n\r\n<p><span style="font-family:tahoma,geneva,sans-serif"><span style="font-size:14px">-&nbsp;&nbsp;&nbsp;Hệ thống xử l&yacu