treatment </span></em><em><span style="font-family:georgia,serif">system<span style="font-size:14px">.</span></span></em></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Domestic wastewater t</span></em></span><em><span style="font-family:georgia,serif">reatment&nbsp;</span></em><em><span style="font-family:georgia,serif">system</span></em><span style="font-size:14px"><em><span style="font-family:georgia,serif">: apartment, building, office, hotel ...</span></em></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Emissions t</span></em></span><em><span style="font-family:georgia,serif">reatment&nbsp;</span></em><em><span style="font-family:georgia,serif">system</span></em><span style="font-size:14px"><em><span style="font-family:georgia,serif">: boilers, generators, gas solvents, paint ...</span></em></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Industrial supply&nbsp;water </span></em></span><em><span style="font-family:georgia,serif">system</span></em><span style="font-size:14px"><em><span style="font-family:georgia,serif">: RO water, softener ...</span></em></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Water s</span></em></span><em><span style="font-family:georgia,serif">ystem&nbsp;</span></em><span style="font-size:14px"><em><span style="font-family:georgia,serif">to households, offices, factories, hospitals, hotels ...</span></em></span></p>\r\n\r\n<p><strong><span style="color:#FF8C00"><span style="font-size:14px"><em><span style="font-family:georgia,serif">II. Installation services:</span></em></span></span></strong></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Drinking water treatment system.</span></em></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Wastewater treatment system.</span></em></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Electric control system, PLC programming, touch screen.</span></em></span></p>\r\n\r\n<p><span style="color:#FF8C00"><strong><span style="font-size:14px"><em><span style="font-family:georgia,serif">5. Maintenance services:</span></em></span></strong></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Maintenance of water treatment systems.</span></em></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Maintenance of electrical systems.</span></em></span></p>\r\n\r\n<p><span style="font-size:14px"><em><span style="font-family:georgia,serif">- Upgrading and repairing systems.</span></em></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="text-align:center">&nbsp;</p>\r\n', '', '', '', 13);
