	(1, 0, 0, 0, 'Máy Giặt', 'nhung-cau-hoi-thuong-giap-cua-may-giatcau-hoi-1-may-giat-cap-nuoc-khi-dang-o-giua-tien-trinh-giat-hoac-xa-dap-kiem-tra-khi-ban-bo-them-do-giat-khi-may-dang-hoat-dong-khi-muc-nuoc-khong-du-khi-may-giat-dieu-chinh-lai-trang-thai-can-bang-giai-quyet-khong-co', 'Những câu hỏi thường giặp của Máy Giặt\r\nCâu hỏi 1: \r\nMáy giặt cấp nước khi đang ở giữa tiến trình giặt hoặc xả? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Khi bạn bỏ thêm đồ giặt khi máy đang hoạt động \r\n- Khi mực nước không đủ. \r\n- Khi máy giặt điều chỉnh lại trạng thái cân bằng. \r\nGiải quyết: \r\n- Không có vấn đề gì. \r\n------------------------------ \r\n\r\nCâu hỏi 2: \r\nMáy có tiếng kêu lạ? \r\n\r\nĐáp: \r\nKiểm tra \r\nĐây là âm thanh của chất lỏng trên thùng giặt/vắt để giảm bớt sự rung động của máy giặt. \r\nGiải quyết: \r\n- Không có vấn đề gì. \r\n------------------------------ \r\n\r\nCâu hỏi 3: \r\nNước không chảy ra khỏi ống xả mặc dù đang ở chế độ xả tràn? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Đã cài đặt mức nước thấp hơn bình thường. \r\n- Áp suất nước thấp hơn bình thường. \r\nGiải quyết: \r\n- Cài đặt lại mực nước cho thích hợp. \r\n- Điều chỉnh lại tỷ lệ cấp nước (tiêu chuẩn là 15L/phút) \r\n------------------------------- \r\n\r\nCâu hỏi 4: \r\nMáy giặt hoàn toàn không hoạt động? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Đã nhấn công tắc nguồn POWER SWITCH và nút khởi động START/PAUSE chưa. \r\n- Dây điện nguồn có tiếp xúc tốt với ổ cắm hay không. \r\n- Nguồn điện đang sử dụng có bị hỏng không. \r\nGiải quyết: \r\n- Hãy thực hiện lại thao tác. \r\n- Nên sử dụng ổ cắm thích hợp. \r\n- Kiểm tra lại nguồn điện sử dụng. \r\n--------------------------------- \r\n\r\nCâu hỏi 5: \r\nBảng điều khiển bị nóng lên khi máy đang hoạt động? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Do những phần bên dưới bảng điều khiển phát nhiệt khi máy giặt hoạt động. \r\nGiải quyết: \r\n- Không có vấn đề gì. \r\n-------------------------------- \r\n\r\nCâu hỏi 6: \r\nNước không chảy vào thùng giặt/vắt? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Vòi cấp nước đã được mở chưa. \r\n- Nguồn nước cung cấp có bị cắt không. \r\n- Lưới kim loại ở ngõ nước vào có bị tắt nghẽn không. \r\nGiải quyết: \r\n- Hãy mở vòi cấp nước. \r\n- Kiểm tra lại nguồn nước cung cấp. \r\n- Tháo ống cấp nước ra khỏi máy và làm sạch lưới kim loại bằng bàn chải. \r\n--------------------------------- \r\n\r\nCâu hỏi 7: \r\nBột giặt còn dính trên áo quần sau khi giặt? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Đã dùng quá nhiều bột giặt , bột giặt có thể tồn đọng trên quần áo. \r\n- Nhiệt độ của nước quá thấp. \r\nGiải quyết: \r\n- Hãy sử dụng lượng bột giặt đúng theo tài liệu hướng dẫn sử dụng. \r\n- Nếu bột giặt khó hòa tan, hãy hòa tan chúng với nước ấm. Nhiết độ để hòa tan phải thấp hơn 40 độ C. \r\n------------------------------------- \r\n\r\nCâu hỏi 8: \r\nMáy không vắt? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Nắp máy giặt đã được đóng lại kỹ chưa. \r\n- Đồ giặt có bị dồn về một phía của thùng vắt không. \r\n- Ống xả nước có bị nghẹt không. \r\n- Máy có bị đặt nghiêng không. \r\nGiải quyết: \r\n- Đóng nắp máy giặt lại. \r\n- Điều chỉnh lại đồ giặt cho cân bằng. \r\n- Làm thông ống xả. \r\n- Điều chỉnh lại máy cho cân bằng. \r\n-------------------------------------- \r\n\r\nCâu hỏi 9: \r\nĐồ giặt bị rách? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Có vật lạ như kẹp tóc, đồng tiền, kim kẹp giấy,... lẫn với đồ giặt làm rách quần áo. \r\nGiải quyết: \r\n- Phải lấy hết các vật lạ ra. \r\n- Khi giặt các loại đồ giặt có đính kim tuyến, đồ lót nylon và sợi tổng hợp mỏng nên sử dụng lưới giặt nylon để bảo vệ. \r\n- Hãy cột chặt các sợi dây dài và kéo các móc khóa trên quần áo lại vì chúng khi mở tung ra có thể gây hư hại cho đồ giặt hoặc thùng giặt. \r\n------------------------------------ \r\n\r\nCâu hỏi 10: \r\nThời gian xả nước quá lâu? \r\n\r\nĐáp: \r\nKiểm tra \r\n- Ống xả nước có bị méo và biến dạng không. \r\n- Ống xả nước có được nối đúng như hướng dẫn không. \r\nGiải quyết: \r\n- Điều chỉnh lại cho đúng \r\n- Điều chỉnh lại độ dài của đoạn nối thêm ống xả cho phù hợp (ngắn hơn 3m)\r\n\r\n', '', '', '', '', '', '', '', 'dienlanhthienan@gmail.com', 1, 1, 1397835041, 1400155671, 11);
INSERT INTO `table_hoptac` (`id`, `id_item`, `id_cat`, `tinnoibat`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `photo`, `thumb`, `title_vi`, `title_en`, `description_vi`, `description_en`, `keywords_vi`, `keywords_en`, `title_cn`, `keywords_cn`, `description_cn`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `luotxem`) VALUES
