	(2, 0, 0, 0, 'quyền lợi hợp tác', 'quyen-loi-hop-tac', '', '<p><span><strong>FASHIONSHOPPING.VN :<span><br /></span></strong></span></p>\r\n<table border=\\"0\\" cellspacing=\\"0\\" cellpadding=\\"0\\">\r\n<tbody>\r\n<tr>\r\n<td align=\\"justify\\">\r\n<p align=\\"justify\\"><span><strong>Ban biet gi ve cong ty minh sap xin vao lam viec?</strong></span></p>\r\n<p align=\\"justify\\"><span>Neu cau tra loi la khong, ban chac chan se bi out du bang cap va nhieu yeu to khac cua ban co sao sang den co nao. Ban se tra loi ra sao neu nhu nha tuyen dung hoi ly do ban xin viec o day hay ban biet gi ve cong ty? The nen, se khong thua neu nhu ban bot chut thoi gian tim hieu ve cong ty minh sap xin vao lam viec. Ban se khong con cam thay lung tung truoc nha tuyen dung va quan trong nhat la ban da chung to cho nha tuyen dung biet ban cung quan tam den cong ty cua ho. Kien thuc:</span></p>\r\n<p align=\\"justify\\"><span>Viec on lai nhung kien thuc truoc khi buoc vao vong phong van se giup ban tu tin hon. Tuy nhien, ban nen chu y, nha tuyen dung rat it khi hoi ban nhung cau hoi chung chung ma thuong la di sau vao cac van de nguoi that viec that. Ban nen chuan bi nhung cau tra loi khi duoc hoi ve ca nhan dai loai nhu gia dinh, so thich, mau sac, gu an macINSERT INTO `table_hotline` (`id`, `ten`, `dienthoai`, `didong`, `photo`, `com`) VALUES
	(1, '', '08.6293.5290', '', '9667380.jpg', 'hotline');
INSERT INTO `table_huongdan` (`id`, `id_item`, `id_cat`, `tinnoibat`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `photo`, `thumb`, `title_vi`, `title_en`, `description_vi`, `description_en`, `keywords_vi`, `keywords_en`, `title_cn`, `keywords_cn`, `description_cn`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `luotxem`) VALUES
	(9, 0, 0, 0, 'Tuyển dụng', 'tuyen-dung', '', '<h2><span style="color:#0000CD">Hướng Dẫn Mua H&agrave;ng Tr&ecirc;n Website</span></h2>\r\n\r\n<p><span style="color:#0000CD"><strong><em>Bước 1&nbsp;</em>:&nbsp;</strong></span><span style="color:rgb(0, 0, 205); font-family:tahoma,geneva,sans-serif">Qu&yacute; kh&aacute;ch lướt xem c&aacute;c sản phẩm. Muốn xem th&ocirc;ng tin chi tiết về sản phẩm, Qu&yacute; kh&aacute;ch nhấn chọn v&agrave;o ngay sản phẩm để được xem nội dung chi tiết. Sau khi chọn số lượng, Bấm chọn&nbsp;</span><span style="color:#0000CD"><strong>cập nhật&nbsp;</strong></span><span style="color:rgb(0, 0, 205); font-family:tahoma,geneva,sans-serif">để bỏ h&agrave;ng v&agrave;o giỏ.Chọn tiếp danh mục sản phẩm kh&aacute;c v&agrave; đặt mua.</span></p>\r\n\r\n<p><span style="color:#0000CD"><span style="font-family:tahoma,geneva,sans-serif"><strong><em>Bước 2 :</em></strong>&nbsp;Khi Qu&yacute; kh&aacute;ch đ&atilde; chọn mua được sản phẩm, b&ecirc;n phải m&agrave;n h&igrave;nh sẽ th&ocirc;ng b&aacute;o Qu&yacute; kh&aacute;ch đ&atilde; c&oacute; mặt h&agrave;ng trong giỏ. Qu&yacute; kh&aacute;ch c&oacute; thể xem chi tiết lại giỏ h&agrave;ng của m&igrave;nh bằng c&aacute;ch nhấn chuột v&agrave;o Xem</span><strong>&nbsp;mua h&agrave;ng</strong><span style="font-family:tahoma,geneva,sans-serif">&nbsp;để xem lại c&aacute;c sản phẩm&nbsp;&nbsp;trước khi v&agrave;o bước&nbsp;</span><strong>Gửi&nbsp;đơn h&agrave;ng</strong><span style="font-family:tahoma,geneva,sans-serif">&nbsp;</span><strong>&nbsp;</strong><span style="font-family:tahoma,geneva,sans-serif">tại giỏ h&agrave;ng Qu&yacute; kh&aacute;ch chọn.</span></span></p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000CD"><strong>Mua tiếp</strong>&nbsp;:&nbsp;Qu&yacute; kh&aacute;ch c&oacute; thể tham quan gian h&agrave;ng v&agrave; mua th&ecirc;m mặt h&agrave;ng v&agrave;o&nbsp;<strong>giỏ h&agrave;ng</strong>&nbsp;đang c&oacute;</span></p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000CD"><strong>X&oacute;a tất cả&nbsp;</strong>:&nbsp;D&agrave;nh cho Kh&aacute;ch h&agrave;ng kh&ocirc;ng đặt h&agrave;ng nữa</span></p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000CD"><strong>Cập nhật</strong>&nbsp;:&nbsp;&nbsp;Qu&yacute; kh&aacute;ch c&oacute; thể thay đổi số lượng, bỏ sản phẩm ra khỏi giỏ h&agrave;ng sau đ&oacute; bấm v&agrave;o&nbsp;<strong>cập nhậ</strong>t để giỏ h&agrave;ng cập nhật lại th&ocirc;ng tin v&agrave; tổng gi&aacute; .</span></p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="color:#0000CD"><strong>Gửi đơn h&agrave;ng</strong>&nbsp;:&nbsp;Nếu Qu&yacute; kh&aacute;ch đ&atilde; đồng &yacute; với giỏ h&agrave;ng c&oacute; thể bấm v&agrave;o&nbsp;<strong>Gửi&nbsp;đơn h&agrave;ng</strong>&nbsp;&nbsp;để li&ecirc;n hệ trực tiếp với ch&uacute;ng t&ocirc;i .</span></p>\r\n', 3, 1, 1386610751, 1388396593, '', '', 'Tuyển dụng', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 57),
