INSERT INTO `table_news` (`id`, `id_item`, `id_cat`, `tinnoibat`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `alt_img`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `photo`, `thumb`, `title_vi`, `title_en`, `description_vi`, `description_en`, `keywords_vi`, `keywords_en`, `title_cn`, `keywords_cn`, `description_cn`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `luotxem`) VALUES
	(15, 0, 0, 0, 'An toàn sử dụng xe nâng', 'an-toan-su-dung-xe-nang', 'Xe nâng là một thiết bị vận hành tương đối phức tạp và yêu cầu tuân thủ nghiêm ngặt các quy trình, cũng như kỹ thuật để đảm bảo an toàn cho người vận hành và những người lao động xung quanh', '<p><strong> I. </strong><strong>KIỂM TRA TRƯỚC KHI VẬN H&Agrave;NG</strong></p>\r\n<p><strong>1. </strong>Kiểm tra thắng, đ&egrave;n v&agrave; c&ograve;i trước khi sử dụng xe.</p>\r\n<p>2. Đảm bảo thắt lưng an to&agrave;n vẫn c&ograve;n tốt.</p>\r\n<p>3. Đảm bảo biết r&otilde; sức n&acirc;ng của xe. V&agrave; kh&ocirc;ng sử dụng xe nếu thiếu hoặc chưa hiểu r&otilde; Biểu đồ tương quan sức n&acirc;ng v&agrave; cao độ (Load capacity chart).</p>\r\n<p>4. Đảm bảo rằng c&agrave;ng n&acirc;ng nằm ở giữa trục n&acirc;ng.</p>\r\n<p>5. Kiểm tra b&aacute;nh xe: kh&ocirc;ng vận h&agrave;nh xe trong trường hợp b&aacute;nh xe thiếu hơi (b&aacute;nh hơi) hoặc c&oacute; dấu hiệu bong tr&oacute;c lớp PU (b&aacute;nh PU)</p>\r\n<p>6. Kh&ocirc;ng sử dụng xe khi thiết bị b&aacute;o lỗi. Th&ocirc;ng b&aacute;o ngay lập tức đến bộ phận li&ecirc;n quan để khắc phục lỗi.</p>\r\n<p>7. N&ecirc;n trang bị đầy đủ thiết bị bảo hộ: gi&agrave;y, quần &aacute;o, k&iacute;nh chống ch&oacute;i&hellip;</p>\r\n<p><strong>&nbsp;&nbsp; &nbsp;&nbsp; II.&nbsp; </strong><strong>NGUY&Ecirc;N TẮC AN TO&Agrave;N KHI VẬN H&Agrave;NH</strong></p>\r\n<p><strong>1. </strong>Kh&ocirc;ng sử dụng xe xăng, dầu trong m&ocirc;i trường kh&ocirc;ng th&ocirc;ng tho&aacute;ng.</p>\r\n<p>2. Lu&ocirc;n quan s&aacute;t người đi bộ trong qu&aacute; tr&igrave;nh vận h&agrave;nh.</p>\r\n<p>3. Kh&ocirc;ng để bất cứ người n&agrave;o đứng/leo l&ecirc;n c&agrave;ng n&acirc;ng.</p>\r\n<p>4. Đảm bảo c&agrave;ng n&acirc;ng khi x&uacute;c pallet đ&uacute;ng c&aacute;ch, v&agrave; khối h&agrave;ng nằm vững tr&ecirc;n pallet trước khi n&acirc;ng v&agrave; di chuyển.</p>\r\n<p>5. Cần ch&uacute; &yacute; trần khi n&acirc;ng cao khung.</p>\r\n<p>6. Kh&ocirc;ng n&acirc;ng h&agrave;ng trong t&igrave;nh trạng khung n&acirc;ng ng&atilde; về ph&iacute;a trước.</p>\r\n<p>7. Lu&ocirc;n đặt h&agrave;ng nặng v&agrave;o ph&iacute;a trong của khung n&acirc;ng.</p>\r\n<p>8. Kh&ocirc;ng n&acirc;ng h&agrave;ng di chuyển khi tầm nh&igrave;n hạn chế (khuất tầm nh&igrave;n).</p>\r\n<p>9. Nếu cần thiết di chuyển khi tầm nh&igrave;n hạn chế (khuất tầm nh&igrave;n), cần c&oacute; 1 người hướng dẫn di chuyển dưới đất v&agrave; phải di chuyển với tốc độ chậm.</p>\r\n<p>10. Khi đến g&oacute;c khuất, phải sử dụng c&ograve;i v&agrave; di chuyển chậm.</p>\r\n<p>11. Giảm tốc độ khi rẽ tr&aacute;i/phải v&agrave; di chuyển tr&ecirc;n mặt s&agrave;n trơn trượt.</p>\r\n<p>12. Kh&ocirc;ng di chuyển xe với c&agrave;ng n&acirc;ng đang n&acirc;ng v&agrave; khung n&acirc;ng cao (kh&ocirc;ng c&oacute; tải)</p>\r\n<p>13. Tr&aacute;nh thắng gấp, đặc biệt l&agrave; khi đang n&acirc;ng h&agrave;ng.</p>\r\n<p>14. Kh&ocirc;ng đậu xe ở những mặt phẳng nghi&ecirc;ng.</p>\r\n<p>15. Kh&ocirc;ng để c&agrave;ng n&acirc;ng ở t&igrave;nh trạng đang n&acirc;ng khi kh&ocirc;ng sử dụng xe.</p>\r\n<p>16. Lu&ocirc;n nhớ sử dụng phanh đỗ xe (thắng tay) khi kh&ocirc;ng sử dụng xe.</p>\r\n<p>17. Lưu &yacute; khi kh&ocirc;ng sử dụng xe:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Đậu xe ở mặt phẳng thấp.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - D&ugrave;ng phanh đỗ xe (thắng tay).</p>\r\n<p>&nbsp; &nbsp;&nbsp; &nbsp; - Tắt m&aacute;y v&agrave; r&uacute;t ch&igrave;a kh&oacute;a xe.</p>\r\n<p><strong>&nbsp; &nbsp; &nbsp; III.&nbsp; </strong><strong>AN TO&Agrave;N KHI NẠP NHI&Ecirc;N LIỆU</strong></p>\r\n<p><strong>1. </strong>Lu&ocirc;n tắt m&aacute;y khi nạp nhi&ecirc;n liệu(ch&acirc;m nước cất). Tuyệt đối kh&ocirc;ng ch&acirc;m nước cất khi xe đang vận h&agrave;nh.</p>\r\n<p>2. Trong trường hợp kiểm tra b&igrave;nh ắc quy: phải c&oacute; trang bị bảo hộ (găng tay, k&iacute;nh, khẩu trang&hellip;)</p>\r\n<p><strong>Ngo&agrave;i những nguy&ecirc;n tắc cơ bản tối thiểu ở tr&ecirc;n, t&agrave;i xế vận h&agrave;nh xe n&acirc;ng phải qua &iacute;t nhất một lớp huấn luyện về an to&agrave;n lao động v&agrave; c&aacute;ch vận h&agrave;nh xe n&acirc;ng an to&agrave;n.</strong></p>', '', 1, 1, 1433567086, 1433605213, '1_1433605213.jpg', '1_1433605213_180x117.1875.jpg', 'An toàn sử dụng xe nâng', '', 'An toàn sử dụng xe nâng', '', 'An toàn sử dụng xe nâng', '', '', '', '', '', '', '', '', '', '', 386),
	(16, 0, 0, 0, '5 điểm nổi bật của xe nâng điện', '5-diem-noi-bat-cua-xe-nang-dien', 'Xe nâng có thể được vận hành bằng bình ắc quy hoặc nhiên liệu như xăng, dầu, gas. Tuy nhiên xe nâng điện lại có một số ưu điểm nhất định so với các loại xe khác. Một vài ưu điểm đó là về khí thải, tuổi thọ, tiếng ồn và quá trình bảo dưỡng. Đây là những ưu điểm dễ nhận thấy nhất ở loại xe nâng sử dụng nhiên liệu điện', '<p><strong>Kh&iacute; thải</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Một trong những ưu điểm đầu ti&ecirc;n của xe n&acirc;ng điện ch&iacute;nh l&agrave; kh&iacute; thải. Kh&aacute;c với c&aacute;c loại xe sử dụng nhi&ecirc;n liệu kh&aacute;c, xe n&acirc;ng điện ho&agrave;n to&agrave;n kh&ocirc;ng c&oacute; kh&iacute; thải. Đ&acirc;y l&agrave; một lợi &iacute;ch lớn nếu bạn dự định sử dụng xe trong kho. Mặc d&ugrave; xe n&acirc;ng sử dụng c&aacute;c loại nhi&ecirc;n liệu kh&aacute;c vẫn c&oacute; thể được vận h&agrave;nh trong kho, nhưng khu vực đ&oacute; cầm phải c&oacute; sự th&ocirc;ng tho&aacute;ng tốt. Do đ&oacute;, c&aacute;c xe sừ dụng nhi&ecirc;n liệu như dầu hay gas hầu như rất &iacute;t được sử dụng trong kho.</p>\r\n<p><strong>Nhi&ecirc;n liệu</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Một ưu điểm kh&aacute;c của xe n&acirc;ng điện ch&iacute;nh l&agrave; nhi&ecirc;n liệu. C&aacute;c d&ograve;ng xe n&acirc;ng điện n&agrave;y sử dụng nhi&ecirc;n liệu rẻ hơn rất nhiều so với c&aacute;c loại kh&aacute;c. Ngo&agrave;i ra cũng kh&ocirc;ng cần phải lưu trữ nhi&ecirc;n liệu giống c&aacute;c loại xe n&acirc;ng sử dụng nhi&ecirc;n liệu kh&aacute;c, do đ&oacute; cũng sẽ tiết kiệm diện t&iacute;ch kho d&agrave;nh cho việc lưu trữ nhi&ecirc;n liệu. Ngo&agrave;i việc chi ph&iacute; vận h&agrave;nh rẻ hơn, xe n&acirc;ng điện c&ograve;n c&oacute; tuổi thọ l&acirc;u hơn.</p>\r\n<p><strong>Tuổi thọ</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tuổi thọ vận h&agrave;nh cũng l&agrave; một ưu điểm nổi bật của xe n&acirc;ng điện. Do c&oacute; &iacute;t chi tiết cơ kh&iacute; vận h&agrave;nh hơn c&aacute;c loại xe kh&aacute;c, n&ecirc;n tuổi thọ của xe điện sẽ d&agrave;i hơn. Ngo&agrave;i ra do việc được sử dụng v&agrave; vận h&agrave;nh trong m&ocirc;i trường sạch hơn, tuổi thọ của xe n&acirc;ng điện cũng l&acirc;u hơn.</p>\r\n<p><strong>Bảo dưỡng</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vấn đề bảo dưỡng đối với xe n&acirc;ng điện cũng l&agrave; một ưu điểm lớn. Như đ&atilde; đề cập ở tr&ecirc;n, do c&oacute; &iacute;t chi tiết cơ kh&iacute; vận h&agrave;nh, n&ecirc;n việc bảo dưỡng xe n&acirc;ng điện cũng kh&ocirc;ng y&ecirc;u cầu thường xuy&ecirc;n như xe dầu. C&aacute;c xe sử dụng kh&iacute; đốt cũng cần y&ecirc;u cầu việc bảo dưỡng phải thường xuy&ecirc;n.</p>\r\n<p><strong>Tiếng ồn</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ưu điểm lớn của c&aacute;c loại xe điện l&agrave; tạo ra tiếng ồn ở mức thấp. Nếu bạn đ&atilde; từng nghe thử một xe dầu vận h&agrave;nh, chắc chắn bạn xe c&ocirc;ng nhận điều n&agrave;y. Đ&acirc;y cũng l&agrave; một ưu thế lớn khi xe vận h&agrave;nh trong kho.</p>', '', 2, 1, 1433567299, 1433605331, '2_1433605331.png', '2_1433605331_180x117.931034483.png', '5 điểm nổi bật của xe nâng điện', '', '5 điểm nổi bật của xe nâng điện', '', '5 điểm nổi bật của xe nâng điện', '', '', '', '', '', '', '', '', '', '', 348),
	(17, 0, 0, 0, 'Có nên phục hồi bình ắc quy xe nâng', 'co-nen-phuc-hoi-binh-ac-quy-xe-nang', 'Bình ắc-quy mới thông thường có thể hoạt động trong khoảng 1000 – 1200 chu kỳ sạc/xả khi sử dụng đúng tải. Mỗi lần sạc đầy bình có thể hoạt động liên tục từ 6-8 giờ nếu sử dụng đúng tải.', '<p><span style=\\"font-size: 12px;\\">B&igrave;nh ắc-quy mới th&ocirc;ng thường c&oacute; thể hoạt động trong khoảng 1000 &ndash; 1200 chu kỳ sạc/xả khi sử dụng đ&uacute;ng tải. Mỗi lần sạc đầy b&igrave;nh c&oacute; thể hoạt động li&ecirc;n tục từ 6-8 giờ nếu sử dụng đ&uacute;ng tải.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Như đ&atilde; đề cập đến trong b&agrave;i <a href=\\"http://duyphatforklift.vn/news/detail/10-dieu-can-biet-ve-acquy-xe-nang-45.html\\"><strong>10 ĐIỀU CẦN BIẾT VỀ ẮC-QUY XE N&Acirc;NG</strong></a>, việc sử dụng đ&uacute;ng tải l&agrave; v&ocirc; c&ugrave;ng quan trọng. V&igrave; mỗi ắc-quy sản xuất ra, nh&agrave; sản xuất đ&atilde; t&iacute;nh to&aacute;n từ d&ograve;ng tải xe cần sử dụng, nếu sử dụng qu&aacute; tải, b&igrave;nh sẽ n&oacute;ng nhanh v&agrave; c&aacute;c đĩa cực (plate) sẽ tho&aacute;i h&oacute;a rất nhanh, dẫn đến mục rửa c&aacute;c đĩa cực. Ngo&agrave;i ra, việc kiểm tra nồng độ nước b&igrave;nh, v&agrave; ch&acirc;m nước cất (lưu &yacute; chỉ ch&acirc;m nước cất) sẽ gi&uacute;p tuổi thọ b&igrave;nh cải thiện đ&aacute;ng kể.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tại sao t&ocirc;i lại đề cập lại vấn đề tr&ecirc;n?</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phục hồi b&igrave;nh ắc-quy thường được người sử dụng chọn để tiết kiệm chi ph&iacute;, nhưng kh&ocirc;ng phải b&igrave;nh ắc-quy n&agrave;o cũng c&oacute; thể phục hồi, v&agrave; <strong>chất lượng b&igrave;nh sau phục hồi cũng c&ograve;n t&ugrave;y thuộc v&agrave;o chất lượng b&igrave;nh c&ograve;n lại</strong>.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&aacute;c b&igrave;nh ắc-quy mới thường được nh&agrave; sản xuất bảo h&agrave;nh 1-2 năm t&ugrave;y h&atilde;ng. Nhưng trong 1-2 năm đ&oacute; nếu ta sử dụng kh&ocirc;ng đ&uacute;ng c&aacute;ch, hoặc kh&ocirc;ng kiểm tra ch&acirc;m nước, sạc xả định kỳ th&igrave; sau thời gian bảo h&agrave;nh, chất lượng b&igrave;nh sẽ xuống r&otilde; rệt. Kh&ocirc;ng loại trừ khả năng chất lượng ban đầu của b&igrave;nh kh&ocirc;ng đạt ti&ecirc;u chuẩn, th&igrave; trong thời gian bảo h&agrave;nh hoặc vừa hết thời gian bảo h&agrave;nh, chất lượng b&igrave;nh c&ograve;n lại rất thấp do c&aacute;c đĩa cực (plate) bị mục r&atilde;. Đối với c&aacute;c b&igrave;nh như vậy, th&igrave; khả năng c&oacute; thể phục hồi l&agrave; rất thấp, hoặc sau khi phục hồi chất lượng b&igrave;nh cũng khổng thể cải thiện nhiều. Với c&aacute;c b&igrave;nh c&oacute; chất lượng tốt, sau thời gian bảo h&agrave;nh, ta n&ecirc;n <strong>định kỳ phục hồi b&igrave;nh 6 th&aacute;ng, hoặc 3 th&aacute;ng</strong> t&ugrave;y khả năng t&agrave;i ch&iacute;nh v&agrave; nhu cầu sử dụng li&ecirc;n tục tối thiểu.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đối với c&aacute;c đơn vị c&oacute; tần suất sử dụng xe nhiều, phương &aacute;n phục hồi b&igrave;nh ắc-quy chỉ l&agrave; phương &aacute;n tạm thời nhằm tiết kiệm chi ph&iacute;, hoặc d&ugrave;ng b&igrave;nh phục hồi l&agrave;m b&igrave;nh dự ph&ograve;ng.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đối với c&aacute;c đơn vị c&oacute; tần suất sử dụng xe kh&ocirc;ng nhiều v&agrave; thời gian sử dụng xe li&ecirc;n tục ngắn, b&igrave;nh ắc-quy sau phục hồi vẫn c&oacute; thể đ&aacute;p ứng được nhu cầu sử dụng v&agrave; l&agrave; một phương &aacute;n tối ưu trong b&agrave;i to&aacute;n chi ph&iacute;.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Như vậy, để trả lời c&acirc;u hỏi ở tr&ecirc;n: &ldquo;C&oacute; n&ecirc;n phục hồi b&igrave;nh ắc-quy?&rdquo;. Ta cần xem x&eacute;t c&aacute;c yếu tố:</span></p>\r\n<p><span style=\\"font-size: 12px;\\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chất lượng b&igrave;nh c&ograve;n lại?</span></p>\r\n<p><span style=\\"font-size: 12px;\\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Thời gian sử dụng xe li&ecirc;n tục tối thiểu cần?</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp; Xin nhấn mạnh lại một &yacute;: B&igrave;nh ắc-quy sau khi phục hồi chắc chắn chất lượng sẽ kh&ocirc;ng được như b&igrave;nh ắc-quy mới v&agrave; cả b&igrave;nh ắc-quy đ&atilde; qua sử dụng với chất lượng c&ograve;n 80-85%, kh&aacute;ch h&agrave;ng n&ecirc;n c&acirc;n nhắc hoặc cần sự tư vấn kỹ lưỡng từ nh&agrave; cung cấp dịch vụ.</span></p>', '', 3, 1, 1433567362, 1433605411, '3_1433605411.png', '3_1433605411_180x138.881118881.png', 'Có nên phục hồi bình ắc quy xe nâng', '', 'Có nên phục hồi bình ắc quy xe nâng', '', 'Có nên phục hồi bình ắc quy xe nâng', '', '', '', '', '', '', '', '', '', '', 380),
	(18, 0, 0, 0, '10 điều cần biết về ắc quy xe nâng', '10-dieu-can-biet-ve-ac-quy-xe-nang', 'Vì mỗi ắc-quy sản xuất ra đều có 1 vòng đời tuổi thọ nhất định (thông thường khoảng 1200 chu kỳ sạc đối với ắc-quy mới), nên việc sử dụng đúng cách và tuân thủ những quy tắc tối thiểu trên là cần thiết để sử dụng ắc-quy hiệu quả và đảm bảo tuổi thọ ắc-quy', '<p><strong>1.&nbsp; Sử dụng tải ph&ugrave; hợp với ắc-quy</strong></p>\r\n<p>&nbsp;&nbsp; Mỗi ắc-quy được thiết kế c&oacute; th&ocirc;ng số kỹ thuật để sử dụng ph&ugrave; hợp với c&ocirc;ng suất của thiết bị, do đ&oacute; việc sử dụng tải kh&ocirc;ng ph&ugrave; hợp (đặc biệt qu&aacute; tải) sẽ l&agrave;m giảm tuổi thọ ắc-quy đ&aacute;ng kể. V&agrave; như vậy, th&igrave; kh&ocirc;ng c&oacute; nh&agrave; sản xuất ắc-quy n&agrave;o c&oacute; thể đảm bảo cho chất lượng của ắc-quy.</p>\r\n<p><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://duyphatforklift.vn/uploads/may_sac.jpg\\" alt=\\"\\" width=\\"186\\" height=\\"188\\" border=\\"0\\" /></p>\r\n<p style=\\"text-align: center;\\"><em>H&igrave;nh 1: Cần chọn m&aacute;y sạc ph&ugrave; hợp với mối loại ắc-quy</em></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>2.&nbsp; Chọn m&aacute;y sạc ph&ugrave; hợp với ắc-quy</strong></p>\r\n<p>&nbsp;&nbsp; D&ograve;ng sạc chuẩn cho mỗi loại ắc-quy t&ugrave;y v&agrave;o dung lượng của n&oacute;, th&ocirc;ng thường l&agrave; từ 1/10 &ndash; 1/8 dung lượng b&igrave;nh. Từ đ&oacute;, ta chọn m&aacute;y sạc ph&ugrave; hợp với ắc-quy đang sử dụng.</p>\r\n<p>Vd: B&igrave;nh ắc-quy c&oacute; th&ocirc;ng số kỹ thuật l&agrave; 48V-340Ah, th&igrave; d&ograve;ng sạc l&agrave; từ 34A-42A, như vậy m&aacute;y sạc c&oacute; d&ograve;ng sạc ~40A l&agrave; sử dụng tốt nhất cho loại ắc-quy n&agrave;y.</p>\r\n<p><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://duyphatforklift.vn/uploads/binh_acquy.jpg\\" alt=\\"\\" width=\\"203\\" height=\\"179\\" border=\\"0\\" /></p>\r\n<p style=\\"text-align: center;\\"><em>H&igrave;nh 2: Sạc v&agrave; ch&acirc;m nước cất đ&uacute;ng c&aacute;ch, c&oacute; thể k&eacute;o d&agrave;i tuổi thọ ắc-quy đến v&agrave;i năm</em></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>3.&nbsp; Kiểm tra c&aacute;p sạc</strong> (của b&igrave;nh ắc-quy v&agrave; m&aacute;y sạc)</p>\r\n<p>&nbsp;&nbsp; Lu&ocirc;n kiểm tra d&acirc;y v&agrave; giắc cắm trước khi sạc. Khi c&oacute; dấu hiệu rạn nứt tr&ecirc;n d&acirc;y hoặc giắc cắm cần phải thay thế ngay.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>4.&nbsp; Lu&ocirc;n sạc đầy sau mỗi ca l&agrave;m việc</strong></p>\r\n<p>&nbsp;&nbsp; Kh&ocirc;ng n&ecirc;n lưu trữ b&igrave;nh ắc &ndash;quy ở trạng th&aacute;i chưa sạc, hoặc kh&ocirc;ng sạc đầy (giữ trạng th&aacute;i chưa sạc l&acirc;u), v&igrave; như vậy sẽ l&agrave;m trơ c&aacute;c bản cực của ắc-quy (th&agrave;nh phần ch&iacute;nh của ắc-quy) v&agrave; l&agrave;m giảm đ&aacute;ng kể tuổi thọ ắc-quy.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>5.&nbsp; Chỉ ch&acirc;m nước sau khi sạc đầy</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>6.&nbsp; Ch&acirc;m nước cất thường xuy&ecirc;n, đ&uacute;ng loại nước cất</strong> v&agrave; ch&acirc;m vừa đủ (phủ qua bề mặt bản cực trong mỗi cell). Trong mỗi cell lu&ocirc;n c&oacute; vạch TOP (hoặc UPPER) định chuẩn lượng nước cần ch&acirc;m.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>7.&nbsp; Lu&ocirc;n ghi lại lịch tr&igrave;nh ch&acirc;m nước cất</strong></p>\r\n<p>&nbsp;&nbsp; Điều n&agrave;y gi&uacute;p nh&agrave; cung cấp nắm r&otilde; v&agrave; hỗ trợ tư vấn khi cần trong thời gian bảo h&agrave;nh, gi&uacute;p sử dụng ắc-quy hiệu quả v&agrave; l&acirc;u hơn.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>8.&nbsp; Ắc-quy khi sạc phải c&oacute; hiện tượng s&ocirc;i</strong></p>\r\n<p>&nbsp;&nbsp; Đ&acirc;y l&agrave; dấu hiệu cho thấy ắc-quy đang trong qu&aacute; tr&igrave;nh sạc đầy. Nếu cả qu&aacute; tr&igrave;nh sạc m&agrave; ắc-quy kh&ocirc;ng c&oacute; hiện tượng s&ocirc;i dung dịch, như vậy d&ograve;ng sạc ắc-quy chưa đủ, v&agrave; cần kiểm tra lại m&aacute;y sạc.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>9.&nbsp; Sạc ắc-quy ở nơi tho&aacute;ng kh&iacute;</strong></p>\r\n<p>&nbsp;&nbsp; V&igrave; trong qu&aacute; tr&igrave;nh sạc, ắc-quy sẽ s&ocirc;i v&agrave; sinh m&ugrave;i kh&oacute; chịu, n&ecirc;n khu vực sạc ắc-quy cần th&ocirc;ng tho&aacute;ng.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>10.&nbsp; Kh&ocirc;ng sạc khi ắc-quy qu&aacute; n&oacute;ng hoặc qu&aacute; lạnh</strong></p>\r\n<p>&nbsp;&nbsp; Khi vừa hoạt động li&ecirc;n tục xong, ắc-quy sẽ c&oacute; hiện tượng n&oacute;ng. N&ecirc;n để nguội hoặc giảm bớt nhiệt rồi mới sạc.</p>\r\n<p>&nbsp;&nbsp; Kh&ocirc;ng sạc ắc-quy trong kho lạnh</p>', '', 4, 1, 1433567448, 1433605480, '5_1433605480.jpg', '5_1433605480_180x134.826254826.jpg', '10 điều cần biết về ắc quy xe nâng', '', '10 điều cần biết về ắc quy xe nâng', '', '10 điều cần biết về ắc quy xe nâng', '', '', '', '', '', '', '', '', '', '', 397),
	(19, 0, 0, 0, 'Lựa chọn ắc quy cho xe nâng', 'lua-chon-ac-quy-cho-xe-nang', 'Mỗi hãng xe nâng thông thường lựa chọn một hoặc nhiều nhà cung cấp ắc-quy cho riêng mình. Do đó, ta dễ thấy dòng xe nâng của hãng chỉ sử dụng hiệu ắc-quy đó vì tin tưởng chất lượng từ nhà cung cấp, và là đối tác lâu năm.', '<p><span style=\\"font-size: 12px;\\">Thị trường ắc-quy hiện tại c&oacute; rất nhiều nh&agrave; cung cấp với nhiều nh&atilde;n hiệu ắc-quy kh&aacute;c nhau như: <strong>GS-Yuasa, Chloride Ceil, Rocket, Hawker, TAB&hellip; </strong>Do đ&oacute;, sẽ c&oacute; rất nhiều sự lựa chọn cho kh&aacute;ch h&agrave;ng t&ugrave;y v&agrave;o ch&iacute;nh s&aacute;ch bảo h&agrave;nh, chất lượng v&agrave; gi&aacute; cả của c&aacute;c nh&agrave; cung cấp.</span></p>\r\n<p><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://duyphatforklift.vn/uploads/forklift_battery_tab_bs.jpg\\" alt=\\"\\" width=\\"500\\" height=\\"500\\" border=\\"0\\" /></p>\r\n<p style=\\"text-align: center;\\"><strong>Ắc-quy TAB</strong> (xuất xứ Ch&acirc;u &Acirc;u) được sử dụng rất nhiều trong c&aacute;c <strong>xe n&acirc;ng điện TCM</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\\"font-size: 12px;\\">Khoan b&agrave;n đến chất lượng, c&acirc;u hỏi đặt ra l&agrave;: Ngo&agrave;i nh&atilde;n hiệu ắc-quy nh&agrave; cung cấp xe n&acirc;ng đang sử dụng, ta c&oacute; thể t&igrave;m một nh&agrave; cung cấp ắc-quy kh&aacute;c, nh&atilde;n hiệu kh&aacute;c?</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C&acirc;u trả lời l&agrave;: <strong>ho&agrave;n to&agrave;n c&oacute; thể thay đổi</strong> nh&atilde;n hiệu ắc-quy kh&aacute;c, miễn l&agrave; c&oacute; th&ocirc;ng số kỹ thuật ph&ugrave; hợp v&agrave; k&iacute;ch thước th&ugrave;ng sắt ph&ugrave; hợp với xe n&acirc;ng đang sử dụng.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nhưng tại sao lại phải thay đổi nh&atilde;n hiệu ắc-quy?</span></p>\r\n<p><span style=\\"font-size: 12px;\\">C&oacute; rất nhiều l&yacute; do:</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Kh&ocirc;ng t&igrave;m được nh&agrave; cung cấp ắc-quy đ&uacute;ng loại đang sử dụng ở thị trường trong nước.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Chất lượng nh&atilde;n hiệu ắc-quy đang sử dụng kh&ocirc;ng đạt y&ecirc;u cầu (<strong>th&ocirc;ng thường l&agrave; do mua kh&ocirc;ng đ&uacute;ng nh&agrave; cung cấp ch&iacute;nh h&atilde;ng</strong>)</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Ch&iacute;nh s&aacute;ch hỗ trợ th&ocirc;ng tin bảo quản, v&agrave; chế độ bảo h&agrave;nh kh&ocirc;ng tốt từ nh&agrave; cung cấp.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Gi&aacute; cả kh&ocirc;ng tương xứng với chất lượng.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&hellip;</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Người sử dụng thường băn khoăn hoặc ngại thay đổi sử dụng một nh&atilde;n hiệu ắc-quy mới, do t&acirc;m l&yacute; lo sợ kh&ocirc;ng đ&uacute;ng nh&atilde;n hiệu đ&oacute; th&igrave; kh&ocirc;ng thể sử dụng tốt, hoặc bắt gặp một nh&atilde;n hiệu lạ do thiếu kinh nghiệm trong ng&agrave;nh.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ch&iacute;nh t&acirc;m l&yacute; n&agrave;y g&acirc;y cản trở, v&agrave; hạn chế trong sự&nbsp; lựa chọn nh&agrave; cung cấp ắc-quy, hoặc chọn nhầm nh&agrave; cung cấp sản phẩm chất lượng kh&ocirc;ng đảm bảo.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bạn c&oacute; thể tham khảo hoặc hỏi thẳng nh&agrave; cung cấp của m&igrave;nh về việc thay đổi , bạn c&oacute; thể kh&ocirc;ng sử dụng ắc-quy nh&atilde;n hiệu đ&oacute;, m&agrave; l&agrave; một nh&atilde;n hiệu kh&aacute;c c&oacute; được hay kh&ocirc;ng? T&ocirc;i tin rằng một người b&aacute;n h&agrave;ng c&oacute; t&acirc;m sẽ cho bạn c&acirc;u trả lời thật sự.</span></p>\r\n<p><span style=\\"font-size: 12px;\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cuối c&ugrave;ng, điều t&ocirc;i muốn n&oacute;i ở đ&acirc;y:</span></p>\r\n<p><strong><span style=\\"font-size: 12px;\\">H&atilde;y l&agrave; một người mua h&agrave;ng s&aacute;ng suốt v&agrave; đừng hạn chế sự lựa chọn của m&igrave;nh.</span></strong></p>\r\n<p><strong><span style=\\"font-size: 12px;\\">H&atilde;y t&igrave;m cho m&igrave;nh một nh&agrave; cung cấp sản phẩm uy t&iacute;n, với chế độ hậu m&atilde;i tốt.</span></strong></p>', '', 5, 1, 1433568027, 1433605522, '4_1433605522.jpg', '4_1433605522_180x119.781818182.jpg', 'Lựa chọn ắc quy cho xe nâng', '', 'Lựa chọn ắc quy cho xe nâng', '', 'Lựa chọn ắc quy cho xe nâng', '', '', '', '', '', '', '', '', '', '', 318),
	(20, 0, 0, 0, 'Công nghệ mới của Ắc qui Kobe cho xe nâng điện', 'cong-nghe-moi-cua-ac-qui-kobe-cho-xe-nang-dien', 'Với công nghệ ắc qui acit chì cho xe nâng điện, Bình ắc qui KOBE sản xuất tại Nhật bản đã dần được biết đến nhờ sử dụng công nghệ tiên tiến bậc nhất trong quá trình sản xuất. Bình ắc qui xe nâng KOBE đã phát triển và chiếm lĩnh lòng tin của thị trường bằng chính bước đột phá về công nghệ sản xuất ắc qui xe nâng điện', '<h1>&ocirc;ng nghệ mới của Ắc qui Kobe cho xe n&acirc;ng điện <span>[14/05/2014]</span></h1>\r\n<p><img style=\\"float: left;\\" src=\\"data:image/jpeg;base64,\\" alt=\\"\\" width=\\"396\\" height=\\"210\\" border=\\"0\\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;&nbsp; Với c&ocirc;ng nghệ ắc qui acit ch&igrave; cho xe n&acirc;ng điện, B&igrave;nh ắc qui KOBE sản xuất tại Nhật bản đ&atilde; dần được biết đến nhờ sử dụng c&ocirc;ng nghệ ti&ecirc;n tiến bậc nhất trong qu&aacute; tr&igrave;nh sản xuất. B&igrave;nh ắc qui xe n&acirc;ng KOBE đ&atilde; ph&aacute;t triển v&agrave; chiếm lĩnh l&ograve;ng tin của thị trường bằng ch&iacute;nh bước đột ph&aacute; về c&ocirc;ng nghệ sản xuất ắc qui xe n&acirc;ng điện. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Với hai mẫu sản phẩm ti&ecirc;u biểu l&agrave; CV Ti&ecirc;u chuẩn v&agrave; CV Si&ecirc;u c&ocirc;ng suất, Kh&aacute;ch h&agrave;ng sẽ tuyệt đối y&ecirc;n t&acirc;m khi sử dụng b&igrave;nh ắc qui KOBE. Trong khi CV mẫu ti&ecirc;u chuẩn thể hiện cho kh&aacute;ch h&agrave;ng sự ổn định d&ograve;ng cung cấp, độ bền tuổi thọ th&igrave; sản phẩm CV Si&ecirc;u c&ocirc;ng suất lu&ocirc;n cung cấp them 10% c&ocirc;ng suất d&ograve;ng, trong mọi điều kiện để đảm bảo sử dụng vượt thời gian y&ecirc;u cầu thiết kế v&agrave; hơn 10% thời gian sử dụng so với c&aacute;c loại ắc qui điện hi&ecirc;n nay. Sử dụng c&ocirc;ng nghệ tạo khu&ocirc;n bằng &aacute;p lực cao cho loại b&igrave;nh h&agrave;n k&iacute;n, sử dụng những tấm t&aacute;ch bản cực đặc biệt để đạt hiệu suất tuyệt đối cho c&aacute;c tấm cực v&agrave; sử dụng vật liệu cao cấp để đ&oacute;ng vỏ v&agrave; nắp b&igrave;nh.</p>\r\n<p><strong>C&ocirc;ng nghệ h&agrave;n liền</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Phần th&acirc;n hai tấm cực sẽ được h&agrave;n liền v&agrave; t&aacute;ch biệt nhờ tấm v&aacute;ch ngăn chuy&ecirc;n dụng đặt giữa hai l&aacute; cực, gi&uacute;p cải thiện việc c&aacute;ch ly hai tấm cực do qu&aacute; tr&igrave;nh oxy ho&aacute; v&agrave; ngăn cản việc giải ph&oacute;ng bụi ch&igrave; của tấm cực trong qu&aacute; tr&igrave;nh sử dụng, sẽ tăng cao tuổi thọ của ắc qui.</p>\r\n<p><strong>V&aacute;ch ngăn</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Được tạo bởi nhựa tổng hợp cao ph&acirc;n tử, kh&ocirc;ng thấm nước v&agrave; c&aacute;ch điện tuyệt đối. Gi&uacute;p hạn chế qu&aacute; tr&igrave;nh giải ph&oacute;ng hạt ch&igrave; v&agrave; hạn chế sự tiếp x&uacute;c của c&aacute;c hạt oxide ch&igrave; với tấm cực v&agrave; giữa hai tấm cực với nhau.</p>\r\n<p><strong>Vỏ b&igrave;nh v&agrave; b&igrave;nh</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Được sản xuất từ nguy&ecirc;n liệu nhựa PP cao cấp, chịu nhiệt v&agrave; chịu lực va đập.</p>\r\n<p><strong>Phao b&aacute;o nước</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Miệng nạp nước rộng, dễ d&agrave;ng đổ nước, phao b&aacute;o nước chống tr&agrave;n gắn liền tr&ecirc;n miệng cửa nạp dễ quan s&aacute;t mức nước khi đổ. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Phần xương tấm cực được pha trộn loại vật liệu kim loại đặc biệt. Phần l&aacute; cực được sản xuất theo phương ph&aacute;p h&agrave;n kết hợp với đ&uacute;c n&eacute;n &aacute;p lực cao nhằm hạn chế tối đa giải ph&oacute;ng hạt ch&igrave; trong qu&aacute; tr&igrave;nh hoạt động v&agrave; tiếp x&uacute;c với oxide.</p>', '', 6, 1, 1433568086, 1433605556, '6_1433605556.jpg', '6_1433605556_180x79.397260274.jpg', 'Công nghệ mới của Ắc qui Kobe cho xe nâng điện', '', 'Công nghệ mới của Ắc qui Kobe cho xe nâng điện', '', 'Công nghệ mới của Ắc qui Kobe cho xe nâng điện', '', '', '', '', '', '', '', '', '', '', 343),
	(21, 0, 0, 0, 'Thông tư về nhập khẩu máy móc thiết bị đã qua sử dụng ', 'thong-tu-ve-nhap-khau-may-moc-thiet-bi-da-qua-su-dung', '', '<table style=\\"width: 640px; height: 98px;\\" border=\\"0\\" cellspacing=\\"0\\" cellpadding=\\"0\\">\r\n<tbody>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"274\\">\r\n<h1><span style=\\"font-size: 15px;\\">BỘ KHOA HỌC V&Agrave; C&Ocirc;NG NGHỆ</span></h1>\r\n<h1><span style=\\"font-size: 15px;\\">&nbsp;&nbsp;&nbsp; </span><span style=\\"font-size: 11px;\\">Số:20 /2014/TT-BKHCN</span></h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td valign=\\"top\\" width=\\"350\\">\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; CỘNG HO&Agrave; X&Atilde; HỘI CHỦ NGHĨA VIỆT NAM</strong></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Độc lập - Tự do - Hạnh ph&uacute;c</strong></p>\r\n&nbsp;<br clear=\\"ALL\\" />\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <em>H&agrave; Nội, ng&agrave;y 15 &nbsp;th&aacute;ng 7 &nbsp;năm 2014</em></p>\r\n<p><em>&nbsp;</em></p>\r\n<p><em>&nbsp;</em></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align=\\"center\\"><strong>TH&Ocirc;NG TƯ</strong></p>\r\n<p align=\\"center\\">&nbsp;<strong>Quy định việc nhập khẩu m&aacute;y m&oacute;c, thiết bị, </strong></p>\r\n<p align=\\"center\\"><strong>d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng</strong></p>\r\n<p align=\\"center\\">&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><em>&nbsp;&nbsp; Căn cứ Nghị định số 20/2013/NĐ-CP ng&agrave;y 26 th&aacute;ng 02 năm 2013 của Ch&iacute;nh phủ quy định chức năng, nhiệm vụ, quyền hạn v&agrave; cơ cấu tổ chức của Bộ Khoa học v&agrave; C&ocirc;ng nghệ;</em></p>\r\n<p><em>&nbsp;&nbsp; Căn cứ Nghị định số 187/2013/NĐ-CP ng&agrave;y 20 th&aacute;ng 11 năm 2013 của Ch&iacute;nh phủ Quy định chi tiết thi h&agrave;nh Luật Thương mại về hoạt động mua b&aacute;n h&agrave;ng ho&aacute; quốc tế v&agrave; c&aacute;c hoạt động đại l&yacute; mua, b&aacute;n, gia c&ocirc;ng v&agrave; qu&aacute; cảnh h&agrave;ng h&oacute;a với nước ngo&agrave;i</em>;</p>\r\n<p><em>&nbsp;&nbsp; Căn cứ Nghị định số 132/2008/NĐ-CP ng&agrave;y 31 th&aacute;ng 12 năm 2008 của Ch&iacute;nh phủ </em><em>Quy định chi tiết thi h&agrave;nh một số điều của Luật Chất lượng sản phẩm, h&agrave;ng ho&aacute;;</em></p>\r\n<p><em>&nbsp;&nbsp; X&eacute;t đề nghị của Vụ trưởng Vụ Đ&aacute;nh gi&aacute;, Thẩm định v&agrave; Gi&aacute;m định C&ocirc;ng nghệ;</em></p>\r\n<p><em>&nbsp;&nbsp; Bộ trưởng Bộ Khoa học v&agrave; C&ocirc;ng nghệ ban h&agrave;nh Th&ocirc;ng tư quy định việc nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng.</em></p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 1. Phạm vi điều chỉnh</strong></p>\r\n<p>&nbsp;&nbsp; 1. Th&ocirc;ng tư n&agrave;y quy định điều kiện v&agrave; thủ tục nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng, bao gồm cả phụ t&ugrave;ng, linh kiện, bộ phận thay thế.</p>\r\n<p>&nbsp;&nbsp; 2. Th&ocirc;ng tư n&agrave;y kh&ocirc;ng &aacute;p dụng đối với c&aacute;c trường hợp nhập khẩu <a href=\\"http://cokhigialong.com\\" target=\\"_blank\\">m&aacute;y m&oacute;c thiết bị</a>, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng sau đ&acirc;y:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) Qu&aacute; cảnh; chuyển khẩu; tạm nhập, t&aacute;i xuất (trừ c&aacute;c hợp đồng gia c&ocirc;ng; trường hợp nhập khẩu để sản xuất, thi c&ocirc;ng thực hiện c&aacute;c dự &aacute;n đầu tư); tạm xuất, t&aacute;i nhập; thực hiện hợp đồng dịch vụ sửa chữa, bảo dưỡng;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) Phục vụ nghi&ecirc;n cứu khoa học v&agrave; ph&aacute;t triển c&ocirc;ng nghệ, trong nước chưa sản xuất được;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c) Nhận chuyển giao từ c&aacute;c khu chế xuất trong nước;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d) Phục vụ nhiệm vụ an ninh, quốc ph&ograve;ng;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; đ) H&agrave;ng viện trợ của tổ chức phi ch&iacute;nh phủ nước ngo&agrave;i.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 2.&nbsp; Đối tượng &aacute;p dụng</strong></p>\r\n<p>&nbsp;&nbsp; Th&ocirc;ng tư n&agrave;y &aacute;p dụng đối với c&aacute;c cơ quan quản l&yacute; nh&agrave; nước, doanh nghiệp, tổ chức, c&aacute; nh&acirc;n c&oacute; li&ecirc;n quan đến việc nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng theo quy định tại Điều 1 Th&ocirc;ng tư n&agrave;y.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 3. Giải th&iacute;ch từ ngữ</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trong Th&ocirc;ng tư n&agrave;y, c&aacute;c từ ngữ dưới đ&acirc;y được hiểu như sau:</p>\r\n<p>&nbsp;&nbsp; 1.<em> D&acirc;y chuyền c&ocirc;ng nghệ</em> l&agrave; hệ thống c&aacute;c thiết bị, c&ocirc;ng cụ, phương tiện được bố tr&iacute; lắp đặt theo sơ đồ, quy tr&igrave;nh c&ocirc;ng nghệ bảo đảm vận h&agrave;nh đồng bộ để sản xuất sản phẩm<em>.</em></p>\r\n<p>&nbsp;&nbsp; 2. <em>Thời gian sử dụng (t&iacute;nh theo năm)</em> l&agrave; thời gian được x&aacute;c định từ năm sản xuất đến năm nhập khẩu của m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng.</p>\r\n<p class=\\"normal-p\\">&nbsp;&nbsp; 3. <em>Chất lượng c&ograve;n lại (t&iacute;nh theo %) so với chất lượng ban đầu</em> l&agrave; mức độ đạt được của c&aacute;c th&ocirc;ng số kỹ thuật của m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng so với c&aacute;c th&ocirc;ng số kỹ thuật của m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ khi chưa sử dụng (mới 100%).</p>\r\n<p class=\\"normal-p\\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 4. Nguy&ecirc;n tắc quản l&yacute; việc nhập khẩu</strong></p>\r\n<p>&nbsp;&nbsp;&nbsp; 1. Khuyến kh&iacute;ch doanh nghiệp nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ mới, c&ocirc;ng nghệ cao, tr&igrave;nh độ c&ocirc;ng nghệ ti&ecirc;n tiến.</p>\r\n<p>&nbsp;&nbsp;&nbsp; 2. M&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng nhập khẩu phải đ&aacute;p ứng c&aacute;c y&ecirc;u cầu về chất lượng, an to&agrave;n, tiết kiệm năng lượng v&agrave; bảo vệ m&ocirc;i trường.</p>\r\n<p>&nbsp;&nbsp;&nbsp; 3. M&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng được nhập khẩu ngo&agrave;i việc đ&aacute;p ứng c&aacute;c điều kiện quy định tại Th&ocirc;ng tư n&agrave;y, phải đ&aacute;p ứng c&aacute;c quy định hiện h&agrave;nh của Ch&iacute;nh phủ, Bộ, ng&agrave;nh về nhập khẩu h&agrave;ng h&oacute;a.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Điều 5. M&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng cấm nhập khẩu</strong></p>\r\n<p>&nbsp;&nbsp; M&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng cấm nhập khẩu bao gồm:</p>\r\n<p>&nbsp;&nbsp; 1. Thuộc Danh mục h&agrave;ng h&oacute;a cấm nhập khẩu ban h&agrave;nh k&egrave;m theo Nghị định số 187/2013/NĐ-CP ng&agrave;y 20 th&aacute;ng 11 năm 2013 của Ch&iacute;nh phủ quy định chi tiết thi h&agrave;nh Luật Thương mại về hoạt động mua b&aacute;n h&agrave;ng h&oacute;a quốc tế v&agrave; c&aacute;c hoạt động đại l&yacute; mua, b&aacute;n, gia c&ocirc;ng v&agrave; qu&aacute; cảnh h&agrave;ng h&oacute;a với nước ngo&agrave;i.</p>\r\n<p>&nbsp;&nbsp; 2. Thuộc Danh mục h&agrave;ng h&oacute;a đ&atilde; qua sử dụng cấm nhập khẩu, Danh mục phương tiện đ&atilde; qua sử dụng cấm nhập khẩu ban h&agrave;nh k&egrave;m theo Th&ocirc;ng tư số 04/2014/TT-BCT ng&agrave;y 27 th&aacute;ng 01 năm 2014 của Bộ C&ocirc;ng Thương quy định chi tiết thi h&agrave;nh một số điều của Nghị định số 187/2013/NĐ-CP ng&agrave;y 20 th&aacute;ng 11 năm 2013 của Ch&iacute;nh phủ quy định chi tiết thi h&agrave;nh Luật Thương mại về hoạt động mua b&aacute;n h&agrave;ng h&oacute;a quốc tế v&agrave; c&aacute;c hoạt động đại l&yacute; mua, b&aacute;n, gia c&ocirc;ng v&agrave; qu&aacute; cảnh h&agrave;ng h&oacute;a với nước ngo&agrave;i.</p>\r\n<p>&nbsp;&nbsp; 3. Thuộc Danh mục sản phẩm c&ocirc;ng nghệ th&ocirc;ng tin đ&atilde; qua sử dụng cấm nhập khẩu do Bộ Th&ocirc;ng tin v&agrave; Truyền th&ocirc;ng ban h&agrave;nh k&egrave;m theo Th&ocirc;ng tư số 11/2012/TT-BTTTT ng&agrave;y 17 th&aacute;ng 7 năm 2012 quy định Danh mục sản phẩm c&ocirc;ng nghệ th&ocirc;ng tin đ&atilde; qua sử dụng cấm nhập khẩu.</p>\r\n<p>&nbsp;&nbsp; 4. C&aacute;c Danh mục h&agrave;ng h&oacute;a đ&atilde; qua sử dụng cấm nhập khẩu do c&aacute;c Bộ, ng&agrave;nh kh&aacute;c ban h&agrave;nh theo quy định tại Nghị định số 187/2013/NĐ-CP ng&agrave;y 20 th&aacute;ng 11 năm 2013 của Ch&iacute;nh phủ quy định chi tiết thi h&agrave;nh Luật Thương mại về hoạt động mua b&aacute;n h&agrave;ng h&oacute;a quốc tế v&agrave; c&aacute;c hoạt động đại l&yacute; mua, b&aacute;n, gia c&ocirc;ng v&agrave; qu&aacute; cảnh h&agrave;ng h&oacute;a với nước ngo&agrave;i.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 6. Điều kiện nhập khẩu m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng </strong></p>\r\n<p>&nbsp;&nbsp; 1. M&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng kh&ocirc;ng thuộc Điều 5 Th&ocirc;ng tư n&agrave;y v&agrave; kh&ocirc;ng thuộc khoản 2 Điều n&agrave;y được ph&eacute;p nhập khẩu nếu đ&aacute;p ứng c&aacute;c điều kiện sau:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) <strong>C&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 05 năm</strong>;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) <strong>C&oacute; chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n</strong>.</p>\r\n<p>&nbsp;&nbsp; 2. Điều kiện nhập khẩu đối với một số trường hợp đặc biệt:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) C&aacute;c loại m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng được ph&eacute;p nhập khẩu nếu c&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 03 năm v&agrave; chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n, bao gồm:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị phục vụ sản xuất n&ocirc;ng nghiệp.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị sử dụng trong ng&agrave;nh bia, rượu, nước giải kh&aacute;t c&oacute; cồn v&agrave; kh&ocirc;ng cồn.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị ng&agrave;nh bưu ch&iacute;nh: thiết bị chia chọn thư, bưu kiện; m&aacute;y lồng gấp phong b&igrave;; m&aacute;y sản xuất phong b&igrave;; thiết bị băng tải.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) C&aacute;c loại m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng được ph&eacute;p nhập khẩu nếu c&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 07 năm v&agrave; chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n, bao gồm:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị trong lĩnh vực địa chất, kho&aacute;ng sản.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị phục vụ đ&oacute;ng t&agrave;u, sửa chữa t&agrave;u.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị phục vụ x&acirc;y dựng c&ocirc;ng tr&igrave;nh dầu kh&iacute; biển.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị phục vụ x&acirc;y dựng c&ocirc;ng tr&igrave;nh hạ tầng giao th&ocirc;ng.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y m&oacute;c, thiết bị phục vụ hoạt động sản xuất trong ng&agrave;nh in: m&aacute;y ghi phim, m&aacute;y ghi kẽm, m&aacute;y tạo khu&ocirc;n in, m&aacute;y dao x&eacute;n (cắt) giấy, m&aacute;y đ&oacute;ng s&aacute;ch (đ&oacute;ng th&eacute;p hoặc kh&acirc;u chỉ), m&aacute;y gấp s&aacute;ch, m&aacute;y v&agrave;o b&igrave;a s&aacute;ch.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c) C&aacute;c loại m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng được ph&eacute;p nhập khẩu nếu c&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 10 năm v&agrave; chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n, bao gồm:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Động cơ m&aacute;y thủy sử dụng cho t&agrave;u đ&aacute;nh bắt xa bờ.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - M&aacute;y kỵ m&atilde; li&ecirc;n hợp phục vụ hoạt động sản xuất trong ng&agrave;nh in.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d) C&aacute;c loại m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng được ph&eacute;p nhập khẩu nếu c&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 15 năm v&agrave; chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n, bao gồm: m&aacute;y in offset, m&aacute;y in ống đồng, m&aacute;y in flexo phục vụ hoạt động sản xuất trong ng&agrave;nh in.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 7. Điều kiện nhập khẩu d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng </strong></p>\r\n<p>&nbsp;&nbsp; 1. D&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng kh&ocirc;ng thuộc Điều 5 Th&ocirc;ng tư n&agrave;y v&agrave; kh&ocirc;ng thuộc khoản 2 Điều n&agrave;y được ph&eacute;p nhập khẩu nếu đ&aacute;p ứng c&aacute;c điều kiện sau:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) C&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 05 năm;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) C&oacute; chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c) Việc sử dụng d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng được n&ecirc;u trong hồ sơ dự &aacute;n đầu tư đ&atilde; nộp tại cơ quan quản l&yacute; về đầu tư hoặc được cấp c&oacute; thẩm quyền ph&ecirc; duyệt;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d) Ph&ugrave; hợp với y&ecirc;u cầu quản l&yacute; chuy&ecirc;n ng&agrave;nh của c&aacute;c Bộ, ng&agrave;nh;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; đ) Được gi&aacute;m định chất lượng tại nước xuất khẩu trước khi th&aacute;o dỡ, đ&oacute;ng g&oacute;i nhập khẩu.</p>\r\n<p>&nbsp;&nbsp; 2. Điều kiện nhập khẩu đối với một số trường hợp đặc biệt:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) D&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng được ph&eacute;p nhập khẩu nếu c&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 03 năm, chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n v&agrave; đ&aacute;p ứng c&aacute;c quy định n&ecirc;u tại điểm c, d, đ khoản 1 Điều n&agrave;y, bao gồm:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - D&acirc;y chuyền c&ocirc;ng nghệ sử dụng trong ng&agrave;nh bia, rượu, nước giải kh&aacute;t c&oacute; cồn v&agrave; kh&ocirc;ng cồn.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - D&acirc;y chuyền chia chọn tự động thư, bưu kiện trong ng&agrave;nh bưu ch&iacute;nh.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) D&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng được ph&eacute;p nhập khẩu nếu c&oacute; thời gian sử dụng kh&ocirc;ng qu&aacute; 10 năm v&agrave; chất lượng c&ograve;n lại so với chất lượng ban đầu từ 80% trở l&ecirc;n v&agrave; đ&aacute;p ứng c&aacute;c quy định n&ecirc;u tại điểm c, d, đ khoản 1 Điều n&agrave;y, bao gồm: d&acirc;y chuyền li&ecirc;n hợp phục vụ hoạt động sản xuất trong ng&agrave;nh in.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 8. Thủ tục nhập khẩu m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng </strong></p>\r\n<p>&nbsp;&nbsp; 1. Doanh nghiệp thực hiện thủ tục nhập khẩu tại cơ quan hải quan nơi nhập khẩu h&agrave;ng h&oacute;a. Ngo&agrave;i hồ sơ nhập khẩu theo quy định, doanh nghiệp phải gửi tới cơ quan hải quan c&aacute;c t&agrave;i liệu sau:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) T&agrave;i liệu kỹ thuật thể hiện năm sản xuất của m&aacute;y m&oacute;c, thiết bị nhập khẩu;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) Chứng thư gi&aacute;m định chất lượng do tổ chức gi&aacute;m định đủ điều kiện quy định tại khoản 1 Điều 10 Th&ocirc;ng tư n&agrave;y cấp. Nếu chứng thư gi&aacute;m định do tổ chức gi&aacute;m định nước ngo&agrave;i đủ điều kiện quy định tại khoản 5 Điều 11 Th&ocirc;ng tư n&agrave;y cấp, doanh nghiệp phải gửi k&egrave;m theo Bản sao hợp ph&aacute;p chứng chỉ c&ocirc;ng nhận hệ thống quản l&yacute; ph&ugrave; hợp ti&ecirc;u chuẩn quốc tế ISO/IEC 17020 phi&ecirc;n bản hiện h&agrave;nh của tổ chức gi&aacute;m định.</p>\r\n<p>&nbsp;&nbsp; 2. Cơ quan hải quan căn cứ t&agrave;i liệu doanh nghiệp nộp, x&aacute;c định <a href=\\"http://duyphatforklift.vn/cokhigialong.com/may-ep-thuy-luc-75.html\\" target=\\"_blank\\">m&aacute;y &eacute;p thủy lực</a> đ&atilde; qua sử dụng đ&aacute;p ứng điều kiện nhập khẩu theo quy định tại Điều 6 Th&ocirc;ng tư n&agrave;y, thực hiện thủ tục th&ocirc;ng quan theo quy định.</p>\r\n<p>&nbsp;&nbsp; 3. Ngo&agrave;i c&aacute;c y&ecirc;u cầu tr&ecirc;n, doanh nghiệp phải tu&acirc;n thủ đầy đủ c&aacute;c quy định hiện h&agrave;nh kh&aacute;c của Ch&iacute;nh phủ, c&aacute;c Bộ, ng&agrave;nh đối với m&aacute;y m&oacute;c, thiết bị khi nhập khẩu.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 9. Thủ tục nhập khẩu d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng</strong></p>\r\n<p>&nbsp;&nbsp; 1. Doanh nghiệp thực hiện thủ tục nhập khẩu tại cơ quan hải quan nơi nhập khẩu h&agrave;ng h&oacute;a. Ngo&agrave;i hồ sơ nhập khẩu theo quy định, doanh nghiệp phải gửi tới cơ quan hải quan c&aacute;c t&agrave;i liệu sau:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) T&agrave;i liệu kỹ thuật thể hiện năm sản xuất của d&acirc;y chuyền c&ocirc;ng nghệ nhập khẩu;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) Chứng thư gi&aacute;m định chất lượng do tổ chức gi&aacute;m định đủ điều kiện quy định tại khoản 2 Điều 10 Th&ocirc;ng tư n&agrave;y cấp. Nếu chứng thư gi&aacute;m định do tổ chức gi&aacute;m định nước ngo&agrave;i đủ điều kiện quy định tại khoản 5 Điều 11 Th&ocirc;ng tư n&agrave;y cấp, doanh nghiệp phải gửi k&egrave;m theo Bản sao hợp ph&aacute;p chứng chỉ c&ocirc;ng nhận hệ thống quản l&yacute; ph&ugrave; hợp ti&ecirc;u chuẩn quốc tế ISO/IEC 17020 phi&ecirc;n bản hiện h&agrave;nh của tổ chức gi&aacute;m định.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c) Thuyết minh dự &aacute;n đầu tư đ&atilde; nộp tại cơ quan quản l&yacute; về đầu tư hoặc được cấp c&oacute; thẩm quyền ph&ecirc; duyệt, trong đ&oacute; thể hiện d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng dự kiến nhập khẩu (bản sao).</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d) Đối với d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng thuộc diện quản l&yacute; của c&aacute;c Bộ, ng&agrave;nh, phải c&oacute; văn bản cho ph&eacute;p nhập khẩu của cơ quan quản l&yacute; chuy&ecirc;n ng&agrave;nh.</p>\r\n<p>&nbsp;&nbsp; 2. Cơ quan hải quan căn cứ t&agrave;i liệu doanh nghiệp nộp, x&aacute;c định d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng đủ điều kiện nhập khẩu theo quy định tại Điều 7 Th&ocirc;ng tư n&agrave;y, thực hiện thủ tục th&ocirc;ng quan theo quy định.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 10. Y&ecirc;u cầu chung về chứng thư gi&aacute;m định</strong></p>\r\n<p>&nbsp;&nbsp; 1. Chứng thư gi&aacute;m định đối với m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng do tổ chức gi&aacute;m định được chỉ định cấp. Trường hợp thực hiện gi&aacute;m định tại nước xuất khẩu, nếu chưa c&oacute; tổ chức gi&aacute;m định được chỉ định ph&ugrave; hợp, doanh nghiệp được ph&eacute;p lựa chọn, sử dụng tổ chức gi&aacute;m định nước ngo&agrave;i đủ điều kiện quy định tại khoản 5 Điều 11 Th&ocirc;ng tư n&agrave;y để thực hiện việc gi&aacute;m định chất lượng.</p>\r\n<p>&nbsp;&nbsp; 2. Chứng thư gi&aacute;m định đối với d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng do tổ chức gi&aacute;m định được chỉ định cấp hoặc tổ chức gi&aacute;m định nước ngo&agrave;i đủ điều kiện quy định tại khoản 5 Điều 11 Th&ocirc;ng tư n&agrave;y cấp tại nước xuất khẩu trước khi th&aacute;o dỡ, đ&oacute;ng g&oacute;i nhập khẩu.</p>\r\n<p>&nbsp;&nbsp; 3. Đối với m&aacute;y m&oacute;c, thiết bị đ&atilde; qua sử dụng, khuyến kh&iacute;ch doanh nghiệp thực hiện gi&aacute;m định chất lượng tại nước xuất khẩu để tr&aacute;nh &aacute;ch tắc tại cửa khẩu v&agrave; giảm thời gian lưu kho b&atilde;i.</p>\r\n<p>&nbsp;&nbsp; 4. Trong qu&aacute; tr&igrave;nh thực hiện thủ tục th&ocirc;ng quan, khi c&oacute; căn cứ x&aacute;c định m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ thực tế c&oacute; chất lượng kh&ocirc;ng ph&ugrave; hợp với chứng thư gi&aacute;m định, cơ quan hải quan c&oacute; quyền y&ecirc;u cầu gi&aacute;m định lại. Trường hợp c&oacute; sự kh&ocirc;ng thống nhất về kết quả gi&aacute;m định chất lượng giữa c&aacute;c tổ chức gi&aacute;m định, Bộ Khoa học v&agrave; C&ocirc;ng nghệ l&agrave; cơ quan c&oacute; &yacute; kiến quyết định cuối c&ugrave;ng.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 11. Y&ecirc;u cầu đối với tổ chức gi&aacute;m định </strong></p>\r\n<p>&nbsp;&nbsp; 1. L&agrave; tổ chức được th&agrave;nh lập theo quy định của ph&aacute;p luật, c&oacute; chức năng gi&aacute;m định về chất lượng h&agrave;ng h&oacute;a l&agrave; m&aacute;y m&oacute;c, thiết bị, c&ocirc;ng nghệ.</p>\r\n<p>&nbsp;&nbsp; 2. C&oacute; năng lực gi&aacute;m định đ&aacute;p ứng c&aacute;c y&ecirc;u cầu quy định trong ti&ecirc;u chuẩn quốc gia TCVN ISO/IEC 17020 hoặc ti&ecirc;u chuẩn quốc tế ISO/IEC 17020 phi&ecirc;n bản hiện h&agrave;nh.</p>\r\n<p>&nbsp;&nbsp; 3. C&oacute; &iacute;t nhất 02 gi&aacute;m định vi&ecirc;n đạt ti&ecirc;u chuẩn sau:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) C&oacute; tr&igrave;nh độ đại học trở l&ecirc;n v&agrave; c&oacute; năng lực chuy&ecirc;n m&ocirc;n ph&ugrave; hợp với y&ecirc;u cầu v&agrave; lĩnh vực gi&aacute;m định;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) C&oacute; &iacute;t nhất 03 năm l&agrave;m việc trong lĩnh vực cần gi&aacute;m định;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c) C&oacute; chứng chỉ gi&aacute;m định về lĩnh vực cần gi&aacute;m định trong trường hợp ph&aacute;p luật quy định phải c&oacute; chứng chỉ.</p>\r\n<p>&nbsp;&nbsp; 4. C&oacute; phương ph&aacute;p gi&aacute;m định chất lượng v&agrave; quy tr&igrave;nh gi&aacute;m định m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ do l&atilde;nh đạo tổ chức gi&aacute;m định ph&ecirc; duyệt.</p>\r\n<p>&nbsp;&nbsp; 5. Ri&ecirc;ng đối với tổ chức gi&aacute;m định nước ngo&agrave;i được doanh nghiệp nhập khẩu lựa chọn để thực hiện gi&aacute;m định tại nước xuất khẩu phải đ&aacute;p ứng c&aacute;c điều kiện sau:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) C&oacute; đăng k&yacute; kinh doanh h&agrave;nh nghề gi&aacute;m định m&aacute;y m&oacute;c, thiết bị, c&ocirc;ng nghệ ở nước sở tại;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) C&oacute; chứng chỉ c&ocirc;ng nhận hệ thống quản l&yacute; ph&ugrave; hợp ti&ecirc;u chuẩn quốc tế ISO/IEC 17020 phi&ecirc;n bản hiện h&agrave;nh, được cấp bởi tổ chức c&ocirc;ng nhận hợp ph&aacute;p l&agrave; th&agrave;nh vi&ecirc;n của Hiệp hội C&ocirc;ng nhận ph&ograve;ng th&iacute; nghiệm quốc tế (ILAC - The International Laboratory Accreditation Cooperation) v&agrave;/hoặc Hiệp hội C&ocirc;ng nhận ph&ograve;ng th&iacute; nghiệm Ch&acirc;u &Aacute; - Th&aacute;i B&igrave;nh Dương (APLAC - Asia Pacific Laboratory Accreditation Cooperation).</p>\r\n<p>&nbsp;&nbsp; 6. Tổ chức gi&aacute;m định phải tu&acirc;n thủ nguy&ecirc;n tắc độc lập, kh&aacute;ch quan, khoa học trong hoạt động v&agrave; chịu tr&aacute;ch nhiệm trước ph&aacute;p luật về t&iacute;nh ch&iacute;nh x&aacute;c của kết quả gi&aacute;m định.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 12. Chỉ định tổ chức gi&aacute;m định</strong></p>\r\n<p>&nbsp;&nbsp; 1. Việc chỉ định c&aacute;c tổ chức gi&aacute;m định do c&aacute;c Bộ, ng&agrave;nh thực hiện.</p>\r\n<p>&nbsp;&nbsp; 2. C&aacute;c Bộ, ng&agrave;nh quy định tr&igrave;nh tự, thủ tục chỉ định tổ chức gi&aacute;m định v&agrave; thực hiện việc chỉ định tổ chức gi&aacute;m định đủ năng lực thực hiện gi&aacute;m định chất lượng m&aacute;y m&oacute;c, thiết bị trong lĩnh vực được ph&acirc;n c&ocirc;ng quản l&yacute; dựa tr&ecirc;n c&aacute;c văn bản sau đ&acirc;y:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a) Th&ocirc;ng tư số 09/2009/TT-BKHCN ng&agrave;y 08 th&aacute;ng 4 năm 2009 của Bộ Khoa học v&agrave; C&ocirc;ng nghệ hướng dẫn y&ecirc;u cầu, tr&igrave;nh tự, thủ tục chỉ định tổ chức đ&aacute;nh gi&aacute; sự ph&ugrave; hợp v&agrave; Th&ocirc;ng tư số 11/2011/TT-BKHCN ng&agrave;y 30 th&aacute;ng 6 năm 2011 của Bộ Khoa học v&agrave; C&ocirc;ng nghệ sửa đổi, bổ sung một số quy định của Th&ocirc;ng tư số 09/2009/TT-BKHCN ng&agrave;y 08 th&aacute;ng 4 năm 2009 hướng dẫn y&ecirc;u cầu, tr&igrave;nh tự, thủ tục chỉ định tổ chức đ&aacute;nh gi&aacute; sự ph&ugrave; hợp.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b) Th&ocirc;ng tư số 27/2007/TT-BKHCN ng&agrave;y 31 th&aacute;ng 10 năm 2007 của Bộ Khoa học v&agrave; C&ocirc;ng nghệ hướng dẫn việc k&yacute; kết v&agrave; thực hiện Hiệp định v&agrave; Thỏa thuận thừa nhận lẫn nhau kết quả đ&aacute;nh gi&aacute; sự ph&ugrave; hợp.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c) Th&ocirc;ng tư số 26/2013/TT-BKHCN ng&agrave;y 15 th&aacute;ng 11 năm 2013 của Bộ Khoa học v&agrave; C&ocirc;ng nghệ quy định y&ecirc;u cầu, tr&igrave;nh tự v&agrave; thủ tục chỉ định tổ chức đ&aacute;nh gi&aacute; sự ph&ugrave; hợp nước ngo&agrave;i thực hiện đ&aacute;nh gi&aacute; sự ph&ugrave; hợp của sản phẩm, h&agrave;ng h&oacute;a theo quy chuẩn kỹ thuật quốc gia do Bộ Khoa học v&agrave; C&ocirc;ng nghệ ban h&agrave;nh.</p>\r\n<p>&nbsp;&nbsp; 3. C&aacute;c Bộ, ng&agrave;nh c&oacute; tr&aacute;ch nhiệm th&ocirc;ng b&aacute;o c&ocirc;ng khai tr&ecirc;n cổng th&ocirc;ng tin điện tử của Bộ, ng&agrave;nh c&aacute;c th&ocirc;ng tin về tổ chức gi&aacute;m định được chỉ định để c&aacute;c cơ quan nh&agrave; nước, doanh nghiệp, tổ chức, c&aacute; nh&acirc;n c&oacute; li&ecirc;n quan biết, lựa chọn. Th&ocirc;ng tin cơ bản bao gồm: t&ecirc;n tổ chức, địa chỉ, số điện thoại, email, fax, website, lĩnh vực gi&aacute;m định được chỉ định, mẫu chứng thư gi&aacute;m định v&agrave; mẫu chữ k&yacute; tr&ecirc;n chứng thư gi&aacute;m định.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>Điều </strong><strong>13</strong><strong>.&nbsp; </strong><strong>Kiểm tra, xử l&yacute; vi phạm</strong></p>\r\n<p>&nbsp;&nbsp; 1. C&aacute;c cơ quan, doanh nghiệp, tổ chức, c&aacute; nh&acirc;n c&oacute; li&ecirc;n quan đến hoạt động nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng chịu sự kiểm tra của cơ quan nh&agrave; nước c&oacute; thẩm quyền việc thực hiện c&aacute;c quy định tại Th&ocirc;ng tư n&agrave;y.</p>\r\n<p>&nbsp;&nbsp; 2. Mọi h&agrave;nh vi vi phạm c&aacute;c quy định n&ecirc;u tại Th&ocirc;ng tư n&agrave;y, t&ugrave;y theo t&iacute;nh chất v&agrave; mức độ, sẽ bị xử l&yacute; theo c&aacute;c quy định của ph&aacute;p luật hiện h&agrave;nh.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 14. </strong><strong>Tổ chức thực hiện</strong></p>\r\n<p>&nbsp;&nbsp; 1. C&aacute;c Bộ, ng&agrave;nh, địa phương phối hợp với Bộ Khoa học v&agrave; C&ocirc;ng nghệ theo d&otilde;i, hướng dẫn việc nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng thuộc lĩnh vực được ph&acirc;n c&ocirc;ng quản l&yacute;.</p>\r\n<p>&nbsp;&nbsp; 2. C&aacute;c Bộ, ng&agrave;nh tổ chức việc chỉ định tổ chức gi&aacute;m định thuộc lĩnh vực quản l&yacute; v&agrave; gửi danh s&aacute;ch k&egrave;m theo th&ocirc;ng tin của tổ chức gi&aacute;m định được chỉ định về Bộ Khoa học v&agrave; C&ocirc;ng nghệ để tổng hợp chung.</p>\r\n<p>&nbsp;&nbsp; 3. Bộ Kế hoạch v&agrave; Đầu tư c&oacute; tr&aacute;ch nhiệm c&ocirc;ng bố, cập nhật thường xuy&ecirc;n danh mục m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ trong nước đ&atilde; sản xuất được.</p>\r\n<p>&nbsp;&nbsp; 4. Bộ Khoa học v&agrave; C&ocirc;ng nghệ c&oacute; tr&aacute;ch nhiệm c&ocirc;ng bố danh mục m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng cấm nhập khẩu từ c&aacute;c nước đ&atilde; c&ocirc;ng bố loại bỏ do lạc hậu, chất lượng k&eacute;m, g&acirc;y &ocirc; nhiễm m&ocirc;i trường.</p>\r\n<p>&nbsp;&nbsp; 5. Tổng cục Hải quan thực hiện thủ tục nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng theo quy định tại Th&ocirc;ng tư n&agrave;y.</p>\r\n<p>&nbsp;&nbsp; 6. Trong qu&aacute; tr&igrave;nh thực hiện việc nhập khẩu m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng, nếu c&oacute; sự kh&ocirc;ng thống nhất về việc x&aacute;c định lĩnh vực v&agrave; điều kiện nhập khẩu, doanh nghiệp cần gửi văn bản đề nghị k&egrave;m theo hồ sơ về Bộ Khoa học v&agrave; C&ocirc;ng nghệ để được xem x&eacute;t, giải quyết.</p>\r\n<p>&nbsp;&nbsp; 7. Trường hợp m&aacute;y m&oacute;c, thiết bị, d&acirc;y chuyền c&ocirc;ng nghệ đ&atilde; qua sử dụng kh&ocirc;ng đ&aacute;p ứng điều kiện về thời gian sử dụng nhưng đ&atilde; được sửa chữa, t&acirc;n trang v&agrave; đ&aacute;p ứng c&aacute;c y&ecirc;u cầu về chất lượng c&ograve;n lại theo quy định tại Điều 6, Điều 7 Th&ocirc;ng tư n&agrave;y; đ&aacute;p ứng c&aacute;c y&ecirc;u cầu về an to&agrave;n, tiết kiệm năng lượng v&agrave; bảo vệ m&ocirc;i trường, Bộ Khoa học v&agrave; C&ocirc;ng nghệ sẽ chủ tr&igrave;, phối hợp với c&aacute;c Bộ, ng&agrave;nh li&ecirc;n quan để xem x&eacute;t, giải quyết.</p>\r\n<p>&nbsp;&nbsp; 8. Bộ Khoa học v&agrave; C&ocirc;ng nghệ giao Vụ Đ&aacute;nh gi&aacute;, Thẩm định v&agrave; Gi&aacute;m định C&ocirc;ng nghệ l&agrave;m đầu mối triển khai thực hiện Th&ocirc;ng tư n&agrave;y.</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Điều 15. Hiệu lực thi h&agrave;nh</strong></p>\r\n<p>&nbsp;&nbsp; 1. Th&ocirc;ng tư n&agrave;y c&oacute; hiệu lực từ ng&agrave;y <strong>01 th&aacute;ng 9 năm 2014.</strong></p>\r\n<p>&nbsp;&nbsp; 2. Điều khoản chuyển tiếp:</p>\r\n<p>&nbsp;&nbsp; Trường hợp c&aacute;c hợp đồng mua b&aacute;n đ&atilde; được k&yacute; kết v&agrave; h&agrave;ng h&oacute;a đ&atilde; được đưa l&ecirc;n phương tiện vận chuyển trước ng&agrave;y Th&ocirc;ng tư n&agrave;y c&oacute; hiệu lực thi h&agrave;nh th&igrave; kh&ocirc;ng thuộc sự điều chỉnh của Th&ocirc;ng tư n&agrave;y.</p>\r\n<p>&nbsp;&nbsp; 3. Trong qu&aacute; tr&igrave;nh thực hiện, nếu c&oacute; vướng mắc, c&aacute;c Bộ, cơ quan ngang Bộ v&agrave; cơ quan trực thuộc Ch&iacute;nh phủ, tổ chức, c&aacute; nh&acirc;n cần phản &aacute;nh về Bộ Khoa học v&agrave; C&ocirc;ng nghệ để sửa đổi, bổ sung cho ph&ugrave; hợp./.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<table style=\\"width: 646px; height: 250px;\\" border=\\"1\\" cellspacing=\\"0\\" cellpadding=\\"0\\">\r\n<tbody>\r\n<tr>\r\n<td valign=\\"top\\" width=\\"343\\">\r\n<p><strong><em>Nơi nhận:</em></strong></p>\r\n<p>- Thủ tướng &nbsp;v&agrave; c&aacute;c Ph&oacute; Thủ tướng Ch&iacute;nh phủ;</p>\r\n<p>- C&aacute;c Bộ, cơ quan ngang Bộ, cơ quan thuộc Ch&iacute;nh phủ;</p>\r\n<p>- Văn ph&ograve;ng Chủ tịch nước; Văn ph&ograve;ng Quốc Hội;</p>\r\n<p>- UBND tỉnh, th&agrave;nh phố trực thuộc TW;</p>\r\n<p>- Sở KHCN tỉnh, th&agrave;nh phố trực thuộc TW;</p>\r\n<p>- T&ograve;a &aacute;n Nh&acirc;n d&acirc;n tối cao;</p>\r\n<p>- Viện Kiểm s&aacute;t nh&acirc;n d&acirc;n tối cao;</p>\r\n<p>- C&ocirc;ng b&aacute;o;</p>\r\n<p>- Cục Kiểm tra VBQPPL (Bộ Tư ph&aacute;p);</p>\r\n<p>- Lưu VT, Vụ ĐTG.</p>\r\n</td>\r\n<td valign=\\"top\\" width=\\"252\\">\r\n<h3><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>BỘ TRƯỞNG</strong></h3>\r\n<p>&nbsp;</p>\r\n<p align=\\"center\\"><strong><em>(đ&atilde; k&yacute;)</em></strong></p>\r\n<p align=\\"center\\">&nbsp;</p>\r\n<p align=\\"center\\"><strong>&nbsp;&nbsp; Nguyễn Qu&acirc;n</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 7, 1, 1433568134, 1433605613, '7_1433605613.jpg', '7_1433605613_180x94.0298507463.jpg', 'Thông tư về nhập khẩu máy móc thiết bị đã qua sử dụng ', '', 'Thông tư về nhập khẩu máy móc thiết bị đã qua sử dụng ', '', 'Thông tư về nhập khẩu máy móc thiết bị đã qua sử dụng ', '', '', '', '', '', '', '', '', '', '', 437),
	(22, 0, 0, 0, 'XE leaf Nissan dùng pin để cấp điện cho tòa nhà ', 'xe-leaf-nissan-dung-pin-de-cap-dien-cho-toa-nha', 'Hãng sản xuất xe nâng Nissan của Nhật Bản đang phát triển một hệ thống sản phẩm đặc biệt dành các công ty xưa nay đưa tiêu chí tiết kiệm chi phí lên hàng đầu , nhất là trong thời buổi kinh tế khó khan và sụt giảm trên toàn cầu .Đó là việc sử dụng pin của xe điện Leaf EV để chiếu sáng cho tòa nhà văn phòng của mình . Tại nới họ làm việc mà không cần phải sử dụng đến hệ thống chiếu sáng điện thông thường  . Điều này sẽ làm giảm các chi phí hàng tháng trong hóa đơn tiền điện cho mỗi công ty .', '<div>\r\n<div class=\\"separator\\">&nbsp;<img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"http://localhost/nangcautoanliem/upload/smallimg_01_v3.jpg\\" alt=\\"\\" width=\\"360\\" height=\\"480\\" /></div>\r\n<div class=\\"separator\\">&nbsp;</div>\r\n<div><br /> Hiện nay Nissan forklift đang thử ngh<a href=\\"http://www.chothuexenang.info/\\" target=\\"_blank\\">i</a>ệm hệ thống n&agrave;y bằng c&aacute;ch d&ugrave;ng 6 chiếc xe điện Leaf &nbsp;để kết nối với hệ thống ph&acirc;n phối điện cho t&ograve;a nh&agrave;.những chiếc xe n&agrave;y đều l&agrave; xe của nh&acirc;n vi&ecirc;n l&agrave;m việc trong t&ograve;a nh&agrave; của mỗi c&ocirc;ng ty .<br /> <br /> &Yacute; tưởng n&agrave;y được c&aacute;c Chuy&ecirc;n gia của h&atilde;ng Nissan triển khai rất đơn giản: những chiếc xe điện Leaf EV sẽ &nbsp;cung cấp điện cho t&ograve;a nh&agrave; c&ocirc;ng ty nơi họ l&agrave;m việc trong thời gian được cho l&agrave; l&uacute;c cao điểm trong ng&agrave;y, thời điểm n&agrave;y gi&aacute; điện &nbsp;đắt nhất v&agrave; v&agrave;o thời gian thấp điểm &nbsp;gi&aacute; điện sẽ rẻ hơn th&igrave; &nbsp;những xe n&agrave;y lại tiến h&agrave;nh &nbsp;nạp điện v&agrave;o ắc quy. H&atilde;ng xe n&acirc;ng v&agrave; xe hơi Nissan cho biết những chiếc xe n&agrave;y sẽ lại sạc đầy điện trước giờ họ tan sở v&aacute; sử dụng để l&aacute;i xe về nh&agrave;.<br /> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div>\r\n<div class=\\"separator\\">&nbsp;<img style=\\"float: left; margin: 10px;\\" src=\\"http://localhost/nangcautoanliem/upload/xenang/RG_reachtruck.JPG\\" alt=\\"\\" width=\\"282\\" height=\\"355\\" /></div>\r\n&nbsp; sản phẩm tr&ecirc;n &nbsp;tr&ecirc;n đ&atilde; được đưa v&agrave;o thử nghiệm trong năm vừa qua &nbsp;tại Trung t&acirc;m c&ocirc;ng nghệ ti&ecirc;n tiến của h&atilde;ng xe n&acirc;n<a href=\\"http://www.chothuexenang.info/\\" target=\\"_blank\\">g</a> Nissan ở th&agrave;nh phố Atsugi, Nhật Bản. Kết quả thu được rất&nbsp;&nbsp;&nbsp; khả quan việc kiểm so&aacute;t thời gian xả v&agrave; nạp điện&nbsp; của những xe điện n&agrave;y, t&ograve;a nh&agrave; &nbsp;c&ocirc;ng ty n&oacute;i tr&ecirc;n đ&atilde; tiết kiệm được được 25,6 kW điện mỗi ng&agrave;y v&agrave;o l&uacute;c cao điểm trong m&ugrave;a H&egrave;.<br /> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n<div class=\\"separator\\">&nbsp;</div>\r\n<br /> H&atilde;ng xe n&acirc;ng , xe hơi Nissan khẳng định sản phẩm &nbsp;n&agrave;y kh&ocirc;ng c&oacute; g&acirc;y ảnh hưởng g&igrave; đến &nbsp;việc đi lại của người sử dụng xe , đi xe cũng như những ảnh hưởng đến &nbsp;hư hỏng đến chiếc xe của họ. Sau khi cuộc thử nghiệm ho&agrave;n th&agrave;nh ,H&atilde;ng <a href=\\"http://www.chothuexenang.info/\\" target=\\"_blank\\">xe n&acirc;ng &nbsp;Nissan </a>đ&atilde; đạt được mức giảm 2,5% lượng điện sử dụng trong giờ cao điểm, tương ứng với việc tiết kiệm được 500.000 yen (4.864 USD) tiền điện.<br /> H&atilde;ng xe Nissan Nhật tiết lộ họ sẽ tiến h&agrave;nh thử nghiệm th&ecirc;m trong một thời gian nữa v&agrave; sẽ c&oacute; những điều chỉnh cải tiến để ho&agrave;n thiện sản phẩm v&agrave; ph&aacute;t triển ch&uacute;ng th&agrave;nh hệ thống d&ugrave;ng cho&ldquo;xe Leaf cho mọi nh&agrave;&rdquo;. Sản phẩm n&agrave;y sẽ n&agrave;y cung cấp nguồn điện dự trử &nbsp;cho c&aacute;c hộ gia đ<a href=\\"http://www.chothuexenang.info/\\" target=\\"_blank\\">&igrave;</a>nh v&agrave; c&aacute;c to&agrave;n nh&agrave; văn ph&ograve;ng c&ocirc;ng ty.Trong tương lai xa hơn h&atilde;ng cho biết sẽ ph&aacute;t triển m&ocirc; h&igrave;nh n&agrave;y v&agrave;o cho c&aacute;c xe n&acirc;ng điện , v&agrave; hệ thống nh&agrave; xưởng kho b&atilde;i sẽ được cung cấp nguồn điện từ sản phẩm n&agrave;y &nbsp;H&atilde;ng xe n&agrave;y hy vọng hệ thống tr&ecirc;n sẽ khuyến kh&iacute;ch người sử dụng xe Leaf sạc pin cho xe của họ v&agrave;o ban đ&ecirc;m v&agrave;o l&uacute;c thời gian thấp điểm hoặc khuyến kh&iacute;ch nạp điện bằng n&acirc;ng lượng mặt trời để tiết kiệm chi ph&iacute; v&agrave; bảo vệ m&ocirc;i trường .<br /> www.chothuexenang.info</div>', '', 8, 1, 1433568312, 1433605656, '8_1433605656.jpg', '8_1433605656_180x137.475.jpg', 'XE leaf Nissan dùng pin để cấp điện cho tòa nhà ', '', 'XE leaf Nissan dùng pin để cấp điện cho tòa nhà ', '', 'XE leaf Nissan dùng pin để cấp điện cho tòa nhà ', '', '', '', '', '', '', '', '', '', '', 321);
