INSERT INTO `table_promotion` (`id`, `id_item`, `id_cat`, `tinnoibat`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `photo`, `thumb`, `alt_img`, `title_vi`, `title_en`, `description_vi`, `description_en`, `keywords_vi`, `keywords_en`, `title_cn`, `keywords_cn`, `description_cn`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `luotxem`) VALUES
	(2, 0, 0, 1, 'Adsl Viettel khuyến mãi sinh viên', 'adsl-viettel-khuyen-mai-sinh-vien', 'Viễn thông quân đội vì một tương lai đất nước. Adsl Viettel khuyến mãi hỗ trợ giảm phí lắp đặt và cước sử dụng hàng tháng cho các bạn sinh viên. Bạn là sinh viên đang theo học tại các trường cao đẳng, đại học. Các bạn sẽ được giảm phí hòa mạng và phí dùng hàng tháng. Để biết thêm thông tin chi tiết, xin vui lòng liên hệ theo hot line: 0988 978 259 (hot line chung tại Hà Nội và tpHCM).', '<h2>Adsl Viettel khuyến m&atilde;i lắp mới cho sinh vi&ecirc;n</h2>\r\n<p><img class="aligncenter size-full wp-image-704" title="adsl-viettel-khuyen-mai-sinh-vien" src="http://www.adslviettel.vn/wp-content/uploads/2013/07/adsl-viettel-khuyen-mai-sinh-vien.png" alt="adsl viettel khuyen mai" width="691" height="208" /></p>\r\n<p>Ch&uacute; &yacute;: bảng gi&aacute; tr&ecirc;n đ&acirc;y chưa bao gồm 10% VAT. &Aacute;p dụng ưu đ&atilde;i cho sinh vi&ecirc;n đến hết th&aacute;ng 9/2013.</p>\r\n<ul>\r\n<li>Ph&iacute; lắp đặt 200k, tặng 1 modem adsl 1 cổng. (Lấy modem wifi 4p đ&oacute;ng th&ecirc;m 400k để đổi thiết bị)</li>\r\n<li>Nếu trả trước 6 th&aacute;ng, bạn sẽ được miễn ph&iacute; lắp đặt 200k v&agrave; tặng th&ecirc;m 1 th&aacute;ng sử dụng miễn ph&iacute;, cước c&ograve;n 180k/th&aacute;ng</li>\r\n<li><em><strong>Adsl Viettel khuyến m&atilde;i hấp dẫn cho sinh vi&ecirc;n</strong></em></li>\r\n</ul>\r\n<h3>C&aacute;c chương tr&igrave;nh khuyến m&atilde;i li&ecirc;n quan</h3>\r\n<p>Nếu c&oacute; nhu cầu d&ugrave;ng th&ecirc;m điện thoại b&agrave;n, c&aacute;c bạn c&oacute; thể đăng k&yacute; lu&ocirc;n v&agrave; kh&ocirc;ng mất th&ecirc;m ph&iacute; (nếu lấy m&aacute;y th&igrave; đ&oacute;ng th&ecirc;m 200k). Với c&aacute;c g&oacute;i cước gi&aacute; rẻ c&ugrave;ng chương tr&igrave;nh giảm ph&iacute; hấp dẫn. Viễn th&ocirc;ng qu&acirc;n đội người bạn của sinh vi&ecirc;n. Hot line li&ecirc;n hệ: 0988 978 259 gặp A.Tiến để biết th&ecirc;m chi tiết.</p>\r\n<h2>Thủ tục đăng k&yacute; lắp đặt adsl viettel khuyến m&atilde;i</h2>\r\n<ol>\r\n<li>Đối với c&aacute;c bạn sinh vi&ecirc;n đang theo học c&aacute;c bạn chỉ cần c&oacute; 1 bản cmt photo v&agrave; 1 thẻ sinh vi&ecirc;n photo l&agrave; được.</li>\r\n<li>Đối với c&aacute;c bạn sinh vi&ecirc;n chuẩn bị nhập học chưa c&oacute; thẻ sinh vi&ecirc;n, c&aacute;c bạn chỉ cần cmt v&agrave; giấy b&aacute;o tr&uacute;ng tuyển của c&aacute;c trường đại học, cao đẳng đ&atilde; tr&uacute;ng tuyển.</li>\r\n</ol>\r\n<p><img class="aligncenter size-medium wp-image-705" title="viettel-khuyen-mai-sinh-vien" src="http://www.adslviettel.vn/wp-content/uploads/2013/07/viettel-khuyen-mai-sinh-vien-300x225.jpg" alt="adsl viettel khuyen mai cho sinh vien" width="325" height="225" /></p>\r\n<p>&nbsp;</p>', 1, 1, 1395280740, 1395280768, 'viettelkhuyenmaisinhvien_1395280768.jpg', 'viettelkhuyenmaisinhvien_1395280768_300x250.jpg', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 4);
