INSERT INTO `table_service` (`id`, `id_item`, `id_cat`, `tinnoibat`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `alt_img`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `photo`, `thumb`, `title_vi`, `title_en`, `description_vi`, `description_en`, `keywords_vi`, `keywords_en`, `title_cn`, `keywords_cn`, `description_cn`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `luotxem`) VALUES
	(1, 0, 0, 0, 'Vận chuyển hàng hóa', 'van-chuyen-hang-hoa', 'Vận chuyển hàng hóa', '<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;HTXL nước thải c&ocirc;ng nghiệp: giặt tẩy, cao su, thực phẩm, giấy, dệt nhuộm&hellip;</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;HTXL nước thải bệnh viện, ph&ograve;ng kh&aacute;m, cơ sở y tế;</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;HTXL nước thải sinh hoạt: chung cư, cao ốc, văn ph&ograve;ng, kh&aacute;ch sạn&hellip;</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;HTXL kh&iacute; thải: l&ograve; hơi, m&aacute;y ph&aacute;t điện, hơi dung m&ocirc;i, sơn&hellip;</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;HTXL nước cấp c&ocirc;ng nghiệp: nước RO, l&agrave;m mềm&hellip;</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;Hệ thống nước uống trực tiếp cho hộ gia đ&igrave;nh, cơ quan, x&iacute; nghiệp, bệnh viện, kh&aacute;ch sạn &hellip;</span></span></em></p>', 'TƯ VẤN - THIẾT KẾ - THI CÔNG HỆ THỐNG BẢO VỆ MÔI TRƯỜNG', 1, 1, 1402100944, 1450548660, 'awda_1450548660.jpg', 'awda_1450548660_180x139.2.jpg', 'Vận chuyển hàng hóa', '', 'Vận chuyển hàng hóa', '', 'Vận chuyển hàng hóa', '', '', '', '', '', '', '', '', '', '', 5),
	(4, 0, 0, 0, 'Chuyển nhà văn phòng', 'chuyen-nha-van-phong', 'Chuyển nhà văn phòng', '<p><em><span style="font-family: georgia,serif;"><span style="font-size: 16px;">-&nbsp;&nbsp;&nbsp;Hệ thống xử l&yacute; nước cấp.</span></span></em></p>\r\n<p><em><span style="font-family: georgia,serif;"><span style="font-size: 16px;">-&nbsp;&nbsp;&nbsp;Hệ thống xử l&yacute; nước thải.</span></span></em></p>\r\n<p><em><span style="font-family: georgia,serif;"><span style="font-size: 16px;">-&nbsp;&nbsp;&nbsp;Hệ thống điện điều khiển, lập tr&igrave;nh PLC, m&agrave;n h&igrave;nh cảm ứng.</span></span></em></p>', 'DỊCH VỤ LẮP ĐẶT', 1, 1, 1402142317, 1450548646, 'aefafa_1450548645.jpg', 'aefafa_1450548646_180x91.636363636364.jpg', 'Chuyển nhà văn phòng', '', 'Chuyển nhà văn phòng', '', 'Chuyển nhà văn phòng', '', '', '', '', '', '', '', '', '', '', 9),
	(5, 0, 0, 0, 'Xe nâng - xe cẩu giá rẻ', 'xe-nang-xe-cau-gia-re', 'Xe nâng - xe cẩu giá rẻ', '<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;Bảo tr&igrave; hệ thống xử l&yacute; nước.</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;Bảo tr&igrave; hệ thống điện.</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">-&nbsp;&nbsp;&nbsp;N&acirc;ng cấp, sửa chữa hệ thống.</span></span></em></p>\r\n<p><em><span style="font-size: 16px;"><span style="font-family: georgia,serif;">Lấy ti&ecirc;u ch&iacute; &ldquo; TẬN T&Acirc;M &ndash; NỖ LỰC &ndash; UY T&Iacute;N &ndash; CHẤT LƯỢNG&rdquo; l&agrave; nền tảng chiến lược cho sự ph&aacute;t triển bền vững v&agrave; l&acirc;u d&agrave;i của ch&uacute;ng t&ocirc;i. C&ugrave;ng với đội ngũ kỹ sư, nh&acirc;n vi&ecirc;n nhiệt t&igrave;nh, gi&agrave;u kinh nghiệm,&nbsp;c&ocirc;ng ty&nbsp;chuy&ecirc;n gia c&ocirc;ng v&agrave; sản xuất trực tiếp thiết bị, ch&uacute;ng t&ocirc;i đảm bảo sẽ mang đến cho Qu&yacute; kh&aacute;ch h&agrave;ng dịch vụ tốt nhất với chi ph&iacute; thấp nhất. Ch&uacute;ng t&ocirc;i hy vọng sẽ được hợp t&aacute;c c&ugrave;ng Qu&yacute; kh&aacute;ch h&agrave;ng.</span></span></em></p>', 'DỊCH VỤ BẢO TRÌ', 1, 1, 1402142345, 1450548805, 'img0201_1450548805.JPG', 'img0201_1450548805_180x135.jpg', 'Xe nâng - xe cẩu giá rẻ', '', 'Xe nâng - xe cẩu giá rẻ', '', 'Xe nâng - xe cẩu giá rẻ', '', '', '', '', '', '', '', '', '', '', 9);
