INSERT INTO `table_solution` (`id`, `id_item`, `id_cat`, `tinnoibat`, `ten_vi`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `alt_img`, `files`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `photo`, `thumb`, `title_vi`, `title_en`, `description_vi`, `description_en`, `keywords_vi`, `keywords_en`, `title_cn`, `keywords_cn`, `description_cn`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `luotxem`) VALUES
	(1, 0, 0, 0, 'CÁC BIỆN PHÁP XỬ LÝ CHẤT THẢI RẮN', 'cac-bien-phap-xu-ly-chat-thai-ran', '', '<div style=\\"margin-left:10px;\\">\r\n<div style=\\"clear:both;\\">&nbsp;</div>\r\n\r\n<div>\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">C&ugrave;ng với sự ph&aacute;t triển của nền kinh tế, chất lượng cuộc sống của nh&acirc;n d&acirc;n ng&agrave;y một tăng cao k&eacute;o theo đ&oacute; l&agrave; sự gia tăng về chất thải đặc biệt l&agrave; ở c&aacute;c khu đ&ocirc; thị, khu c&ocirc;ng nghiệp, khu chế xuất... Trong đ&oacute; nổi l&ecirc;n l&agrave; sự ảnh hưởng của chất thải rắn. Chất thải rắn kh&ocirc;ng những ảnh hưởng trực tiếp tới sức khoẻ con người m&agrave; n&oacute; c&ograve;n g&acirc;y mất vẻ mỹ quan, ảnh hưởng gi&aacute;n tiếp tới m&ocirc;i trường văn ho&aacute; &ndash; x&atilde; hội &ndash; kinh tế. Ch&iacute;nh v&igrave; vậy, c&ocirc;ng t&aacute;c quản l&yacute;, xử l&yacute; chất thải rắn lu&ocirc;n được quan t&acirc;m h&agrave;ng đầu.</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><strong>Một số biện ph&aacute;p kỹ thuật xử l&yacute; chất thải rắn tr&ecirc;n thế giới thường &aacute;p dụng:</strong></span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- Phương ph&aacute;p ch&ocirc;n lấp chất thải hợp vệ sinh:&nbsp;Phương ph&aacute;p n&agrave;y chi ph&iacute; rẻ nhất, b&igrave;nh qu&acirc;n ở c&aacute;c khu vực Đ&ocirc;ng Nam &Aacute; l&agrave; 1-2 USD/tấn. phương ph&aacute;p n&agrave;y thường ph&ugrave; hợp với c&aacute;c nước đang ph&aacute;t triển</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- Phương ph&aacute;p chế biến chất thải rắn c&oacute; nguồn gốc hữu cơ th&agrave;nh ph&acirc;n ủ hữu cơ (compost): Phương ph&aacute;p n&agrave;y chi ph&iacute; th&ocirc;ng thường từ 8-10 USD/tấn. Th&agrave;nh phẩm thu được d&ugrave;ng để phục vụ cho n&ocirc;ng nghiệp, vừa c&oacute; t&aacute;c dụng cải tạo đất vừa thu được sản phẩm kh&ocirc;ng bị nhiễm ho&aacute; chất dư tồn trong qu&aacute; tr&igrave;nh sinh trưởng. Th&agrave;nh phần n&agrave;y được đ&aacute;nh gi&aacute; cao ở c&aacute;c nước ph&aacute;t triển.</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">Nhược điểm của phương ph&aacute;p n&agrave;y l&agrave;: Qu&aacute; tr&igrave;nh xử l&yacute; k&eacute;o d&agrave;i, b&igrave;nh thường l&agrave; từ 2-3 th&aacute;ng, tốn diện t&iacute;ch. Một nh&agrave; m&aacute;y sản xuất ph&acirc;n hữu cơ từ chất thải rắn c&ocirc;ng xuất xử l&yacute; 100.000 tấn chất thải/năm cần c&oacute; diện t&iacute;ch l&agrave; 6ha.</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- Phương ph&aacute;p thi&ecirc;u đốt: Phương ph&aacute;p n&agrave;y chi ph&iacute; cao, th&ocirc;ng thường từ 20-30 USD/tấn nhưng chu tr&igrave;nh xử l&yacute; ngắn, chỉ từ 2-3 ng&agrave;y, diện t&iacute;ch sử dụng chỉ bằng 1/6 diện t&iacute;ch l&agrave;m ph&acirc;n hữu cơ c&oacute; c&ugrave;ng c&ocirc;ng suất.</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">Chi ph&iacute; cao n&ecirc;n chỉ c&oacute; c&aacute;c nước ph&aacute;t triển &aacute;p dụng, ở c&aacute;c nước đang ph&aacute;t triển n&ecirc;n &aacute;p dụng phương ph&aacute;p n&agrave;y ở quy m&ocirc; nhỏ để xử l&yacute; chất độc hại như: Chất thải bệnh viện, chất thải c&ocirc;ng nghiệp, chất thải n&ocirc;ng nghiệp...</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- C&aacute;c kỹ thuật kh&aacute;c: &Eacute;p ở &aacute;p lực cao c&aacute;c th&agrave;nh phần v&ocirc; cơ, chất dẻo... để tạo ra c&aacute;c sản phẩm như tấm tường, trần nh&agrave;, tủ, b&agrave;n ghế,...</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em style=\\"line-height:1.6em\\"><strong>C&aacute;c biện ph&aacute;p kỹ thuật xử l&iacute; chất thải rắn tại Việt Nam</strong></em></span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">C&ugrave;ng với xu thế chung của thế giới, ở nước ta trong những năm gần đ&acirc;y ch&iacute;nh phủ rất coi trọng việc bảo vệ m&ocirc;i trường v&agrave; c&aacute;c biện ph&aacute;p để quản l&iacute; chất thải rắn. C&aacute;c phương ph&aacute;p xử l&yacute; chất thải rắn đang được &aacute;p dụng tại ViệtNam&nbsp;hiện nay tập chung v&agrave;o:</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- T&aacute;i chế chất thải: Việc t&aacute;i chế chất thải chỉ mang t&iacute;nh tự ph&aacute;t, tập trung ở những th&agrave;nh phố lớn H&agrave; Nội, Hải Ph&ograve;ng, TP. Hồ Ch&iacute; Minh... C&aacute;c loại phế thải c&oacute; gi&aacute; trị như: Thuỷ tinh, Đồng, Nh&ocirc;m, sắt, giấy... được đội ngũ đồng n&aacute;t thu mua ngay tại nguồn, chỉ c&ograve;n một lượng nhỏ tới b&atilde;i r&aacute;c v&agrave; tiếp tục thu nhặt tại đ&oacute;. Tất cả phế liệu thu gom được chuyển đến c&aacute;c l&agrave;ng nghề. Tại đ&acirc;y qu&aacute; tr&igrave;nh t&aacute;i chế được thực hiện. Việc thu hồi sử dụng chất thải rắn g&oacute;p phần đ&aacute;ng kể cho việc giảm khối lượng chất thải đưa đến b&atilde;i ch&ocirc;n lấp, tận dụng được nguồn nguy&ecirc;n liệu đầu v&agrave;o cho c&aacute;c qu&aacute; tr&igrave;nh sản xuất, tạo c&ocirc;ng ăn việc l&agrave;m cho một số lao động.</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- Đốt chất thải: Được &aacute;p dụng để xử l&iacute; chất thải nguy hại như chất thải bệnh viện, c&aacute;c bệnh viện lao, viện 198 mới x&acirc;y l&ograve; đốt chất thải. Tại H&agrave; Nội c&oacute; l&ograve; đốt chất thải bệnh viện c&ocirc;ng suất 3,2tấn/ng&agrave;y đặt tại T&acirc;y M&ocirc;. Tại TP. Hồ Ch&iacute; Minh c&oacute; l&ograve; đốt chất thải bệnh viện c&ocirc;ng suất 7,5 tấn/ng&agrave;y. Phương ph&aacute;p đốt chất thải c&ograve;n được d&ugrave;ng để xử l&iacute; chất thải c&ocirc;ng nghiệp như l&ograve; đốt chất thải giầy da ở Hải Ph&ograve;ng, l&ograve; đốt cao su c&ocirc;ng suất 2,5tấn/ ng&agrave;y ở Đồng Nai.</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- Ch&ocirc;n lấp chất thải rắn:</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">Ch&ocirc;n lấp đơn thuần kh&ocirc;ng qua xử l&iacute;, đ&acirc;y l&agrave; phương ph&aacute;p phổ biến nhất theo thống k&ecirc;, nước ta c&oacute; khoảng 149 b&atilde;i r&aacute;c cũ kh&ocirc;ng hợp vệ sinh,trong đ&oacute; 21 b&atilde;i r&aacute;c thuộc cấp tỉnh - th&agrave;nh phố, 128 b&atilde;i r&aacute;c cấp huyện &ndash; thi trấn.&nbsp;Được sự gi&uacute;p đỡ của nước ngo&agrave;i đ&atilde; x&acirc;y dựng c&aacute;c b&atilde;i ch&ocirc;n lấp hợp vệ sinh ở c&aacute;c th&agrave;nh phố lớn như: H&agrave; Nội, Hải Ph&ograve;ng, Huế, TP. Hồ Ch&iacute; Minh, Bắc Giang.</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">- Chế biến th&agrave;nh ph&acirc;n hữu cơ: Phương ph&aacute;p l&agrave;m ph&acirc;n hữu cơ c&oacute; ưu điểm l&agrave;m giảm lượng r&aacute;c thải hữu cơ cần ch&ocirc;n lấp, cung cấp ph&acirc;n b&oacute;n phục vụ n&ocirc;ng nghiệp. Phương ph&aacute;p n&agrave;y rất ph&ugrave; hợp cho việc xử l&iacute; chất thải rắn sinh hoạt, phương ph&aacute;p n&agrave;y được &aacute;p dụng rất c&oacute; hiệu quả như ở Cầu Diễn, H&agrave; Nội (c&ocirc;ng nghệ ủ hiếu kh&iacute;(compostry) &ndash; c&ocirc;ng nghệ T&acirc;y Ban Nha với c&ocirc;ng suất 50.000 tấn r&aacute;c/năm &ndash; SP 13200 tấn/năm, c&ocirc;ng nghệ Ph&aacute;p &ndash; TBN ủ sinh học chất thải hữu cơ &aacute;p dụng tại Nam Định với c&ocirc;ng suất thiết kế 78.000 tấn r&aacute;c/năm ). Ở th&agrave;nh phố Việt Tr&igrave; với c&ocirc;ng suất thiết kế 30.000 tấn r&aacute;c/năm...</span></span></p>\r\n\r\n<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\">Với c&aacute;c biện ph&aacute;p kỹ thuật xử l&yacute; chất thải rắn n&agrave;y tuỳ v&agrave;o điều kiện của mỗi quốc gia c&oacute; thể &aacute;p dụng những c&ocirc;ng nghệ kh&aacute;c nhau cho ph&ugrave; hợp.&nbsp;Chi ph&iacute; cho c&aacute;c loại h&igrave;nh c&ocirc;ng nghệ xử l&iacute; ở c&aacute;c quốc gia kh&aacute;c nhau được thể hiện:</span></span></p>\r\n\r\n<table border=\\"1\\" cellpadding=\\"0\\" cellspacing=\\"0\\" style=\\"width:483px\\">\r\n	<tbody>\r\n		<tr>\r\n			<td rowspan=\\"2\\" style=\\"width:33px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>C&ocirc;ng nghệ xử l&iacute;</strong></em></span></span></p>\r\n			</td>\r\n			<td colspan=\\"3\\" style=\\"width:420px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>Chi ph&iacute; xử l&iacute;</strong></em></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"width:123px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>Quốc gia</strong></em></span></span></p>\r\n\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>thu nhập thấp</strong></em></span></span></p>\r\n\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>370USD/Người/năm</strong></em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:130px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>Quốc gia thu nhập tb</strong></em></span></span></p>\r\n\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>2400USD/Người/năm</strong></em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:137px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>Quốc gia</strong></em></span></span></p>\r\n\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>thu nhập cao</strong></em></span></span></p>\r\n\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em><strong>22000USD/Người/năm</strong></em></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"width:33px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>Ch&ocirc;n lấp hở</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:123px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>0,5 &ndash; 2,0 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:130px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>1,0 - 3,0 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:137px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>5,0 - 10 USD/tấn</em></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"width:33px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>Ch&ocirc;n lấp c&oacute; kiểm so&aacute;t</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:123px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>3,0 - 10 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:130px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>8,0 - 15 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:137px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>20 &ndash; 50 USD/tấn</em></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"width:33px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>Ủ sinh học</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:123px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>5 -20 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:130px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>10 - 40 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"width:137px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>20 - 60 USD/tấn</em></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\\"height:46px; width:33px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>Đốt</em></span></span></p>\r\n			</td>\r\n			<td style=\\"height:46px; width:123px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>40 - 60 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"height:46px; width:130px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>30 - 80 USD/tấn</em></span></span></p>\r\n			</td>\r\n			<td style=\\"height:46px; width:137px\\">\r\n			<p><span style=\\"font-size:14px\\"><span style=\\"font-family:times new roman,times,serif\\"><em>20 - 100 USD/tấn</em></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n', 'Các biện pháp kỹ thuật xử lí chất thải rắn', 'slide-1402064390.rar', 1, 1, 1402064390, 1404461050, 'cleanenvironment13565111_1404461050.jpg', 'cleanenvironment13565111_1404461050_238.26979472141x250.jpg', 'CÁC BIỆN PHÁP XỬ LÝ CHẤT THẢI RẮN', 'The technical methods of solid waste handling', 'CÁC BIỆN PHÁP XỬ LÝ CHẤT THẢI RẮN', 'The technical methods of solid waste handling', 'CÁC BIỆN PHÁP XỬ LÝ CHẤT THẢI RẮN', 'The technical methods of solid waste handling', '', '', '', 'The technical methods of solid waste handling', '', '<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>Along with development of economy and quality of life of people on a high drag which is an increase of waste especially in urban areas, industrial zones, export processing zones ... In that emerged was the impact of solid waste. Solid wastes no direct impact to human health, but also cause loss of visual aesthetics, indirect impact on the environment and cultural - social - economic. Therefore, the management and handling of solid waste is always of primary concern.</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>Some technical measures to handle solid waste in the world are common:</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Methods of burial hygienic method is the cheapest cost on average in the Southeast Asian region is 1-2 USD / ton. This method is usually suitable for the developing countries</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Method of processing solid waste derived compost organics organic matter (compost): This method typically cost 8-10 USD / ton. The final product obtained is used to serve agriculture, both land reclamation work has earned no products contaminated residues exist in the growth process. This component is highly developed in the country.</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>The downside of this method is: The process lasts, normally 2-3 months, consuming area. A factory producing organic fertilizer from solid waste processing capacity of 100,000 tonnes of waste / year should be an area of ​​6 hectares.</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Incineration method: This method is expensive, typically U.S. $ 20-30 / t but short processing cycle, only 2-3 days, the area is only used by sixth compost area engine of the same capacity.</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>High cost should only be applied in developed countries, developing countries should adopt this method on a small scale to handle hazardous materials, such as hospital waste, industrial waste, agricultural waste now ...</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Other techniques: Injection at high pressure inorganic components, plastics ... to create products such as wall paneling, ceilings, cabinets, furniture, ...</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>General trend of today&#39;s world is limited landfill space requirements for large, difficult location planning, investment costs and high management, to handle pollution emissions, leachate during long. Priority processing solutions according to the &quot;3Rs-Reduce, Reuse, Recycle - reduce, reuse, recycle&quot; to minimize waste at source by encouraging reuse, recycling, while reducing and reuse of the waste management sector. The processed waste are disposed to develop sorting at source in order to recover the valuable material put into recycling, rubbish at creating resources from.</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>The techniques of solid waste treatment in Vietnam</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>Along with the general trend of the world, in our country in recent years the government attaches great importance to environmental protection and measures to manage solid waste. The method of solid waste disposal is being applied in VietNam currently focus on:</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Waste Recycling: The recycling just spontaneous, concentrated in the major cities of Ha Noi, Hai Phong, Ho Chi Minh City. Ho Chi Minh City ... The kind of valuable waste such as glass, copper, aluminum, iron, paper ... the team was worth purchasing at source, only a small amount and continue to landfill collected there. All waste collected is sent to the village. At this recycling process is done. The recovery of solid wastes use contribute significantly to reducing the volume of waste sent to landfill, take advantage of the power input to the production process, create jobs for some workers .</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Burning of wastes: Applied to treat hazardous waste such as hospital waste, hospital employees, 198 hospital new build waste incinerators. In Hanoi hospital waste incinerator capacity of 3.2 tons / day located in Western model. At City. Ho Chi Minh hospital waste incinerator capacity of 7.5 tons / day. Waste combustion method can also be used to treat industrial wastes such as waste incinerators in Hai Phong shoe leather, rubber incinerator capacity of 2.5 tons / day in Dong Nai.</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Burying Solid Waste:</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>Burying the past is not merely handle, this is the most common method according to statistics, the country has about 149 old landfills unhygienic, in which 21 of the provincial landfill - city, District 128 landfill - of the town. With the help of foreign building sanitary landfills in large cities such as Hanoi, Hai Phong, Hue, HCMC. Ho Chi Minh, Bac Giang.</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>- Processing of organic fertilizer: compost method has the advantage of reducing the amount of organic waste landfill needs, provide fertilizer for agriculture. This method is suitable for solid waste disposal activities, this method is applied very effectively as in Cau Dien, Hanoi (aerobic composting technology (compostry) - Spain technology with capacity of 50,000 tons of waste / year - SP 13200 tons / year, the French technology - Spain biological composting organic wastes applied in Nam Dinh with a design capacity of 78,000 tons of waste / year). In Vietnam Tri city with a design capacity of 30,000 tons of waste / year ...</em></span></span></p>\r\n\r\n<p><span style=\\"font-family:times new roman,times,serif\\"><span style=\\"font-size:14px\\"><em>With the techniques of solid waste processing depending on the conditions of each country can adopt different technologies accordingly. The cost for this kind of processing technologies in different countries are shown:</em></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', 22),
	(2, 0, 0, 0, 'QUY TRÌNH XỬ LÝ NƯỚC THẢI XI MẠ', 'quy-trinh-xu-ly-nuoc-thai-xi-ma', '', '<p><strong>Quy tr&igrave;nh c&ocirc;ng nghệ</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\\"\\" src=\\"http://hoanxanh.com/upload/images/XI%20M%E1%BA%A0.JPG\\" style=\\"color:rgb(34, 34, 34); font-family:arial,verdana,sans-serif; font-size:12px; height:500px; line-height:18px; opacity:0.9; width:300px\\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;<strong><em>Thuyết minh sơ đồ c&ocirc;ng nghệ</em></strong></p>\r\n\r\n<ul>\r\n	<li>Nước thải sản xuất được dẫn theo đường tho&aacute;t ri&ecirc;ng ra hệ thống xử l&yacute; nước thải.D&ograve;ng thải được đưa v&agrave;o hầm tiếp nhận, SCR đặt trước đường ống hầm tiếp nhận c&oacute; nhiệm vụ loại bỏ c&aacute;c chất rắn c&oacute; k&iacute;ch thước lớn như giấy gỗ, ni long, giẻ&nbsp;lau&hellip;để bảo vệ m&aacute;y m&oacute;c thiết bị cho c&ocirc;ng đoạn tiếp theo. Nước thải được bơm qua bể điều h&ograve;a.</li>\r\n	<li>Tại bể điều h&ograve;a, m&aacute;y khuấy trộn ch&igrave;m sẽ h&ograve;a trộn đồng đều nước thải tr&ecirc;n to&agrave;n diện t&iacute;ch bể, ngăn ngừa sự lắng cặn ở bể sinh ra m&ugrave;i kh&oacute; chịu. Bể điều h&ograve;a c&oacute; chức năng điều h&ograve;a lưu lượng v&agrave; nồng độ nước thải trước khi đi v&agrave;o giai đoạn tiếp theo.</li>\r\n	<li>Nước thải từ bể điều h&ograve;a bơm được qua bể phản ứng. Bơm định lượng c&oacute; nhiệm vụ ch&acirc;m h&oacute;a chất trung h&ograve;a, polymer, PAC nhằm tăng qu&aacute; tr&igrave;nh keo tụ tạo b&ocirc;ng v&agrave; trung h&ograve;a nồng độ pH c&oacute; trong nước thải. Nhờ hệ thống motor c&aacute;nh khuấy với tốc độ chậm, c&aacute;c hạt cặn li ti sẽ va chạm kết d&iacute;nh với nhau th&agrave;nh c&aacute;c hạt b&ocirc;ng cặn c&oacute; k&iacute;ch thước lớn hơn rất nhiều. H&agrave;m lượng b&ocirc;ng cặn v&agrave; nước sẽ tự chảy qua bể lắng.</li>\r\n	<li>Tại bể lắng c&aacute;c hạt cặn c&oacute; k&iacute;ch thước lớn sẽ lắng xuống theo nguy&ecirc;n l&yacute; trọng lực sau một thời gian b&ugrave;n từ bể lắng sẽ được đưa đến bể chứa b&ugrave;n.</li>\r\n	<li>Nước thải&nbsp; sau khi lắng sẽ tự chảy qua bể trung gian chuẩn bị cho qu&aacute; tr&igrave;nh lọc &aacute;p lực</li>\r\n	<li>Bể lọc &aacute;p lực gồm c&aacute;c lớp vật liệu: s&otilde;i đỡ, c&aacute;t, than hoạt t&iacute;nh để loại bỏ c&aacute;c hợp chất hữu cơ h&ograve;a tan c&aacute;c nguy&ecirc;n tố dạng vết những chất kh&oacute; hoặc kh&ocirc;ng ph&acirc;n giải sinh học v&agrave; c&aacute;c halogen hữu cơ nhằm đặt được những y&ecirc;u cầu quy định, nước rửa ngược từ bể được dẫn về bể chứa b&ugrave;n.</li>\r\n	<li><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/XI%20MA.png\\" style=\\"height:500px; width:844px\\" /></li>\r\n</ul>\r\n', '', 'cong-nghe-nuoc-thai-xi-mamodel-1404378914.pdf', 1, 1, 1404378194, 1404462674, 'cleanenvironment13565111_1404460961.jpg', 'cleanenvironment13565111_1404460961_238.26979472141x250.jpg', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI XI MẠ', 'Flate Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI XI MẠ', 'Flate Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI XI MẠ', 'Flate Wastewater Treatment', '', '', '', 'Flate Wastewater Treatment', '', '<p><strong>Quy tr&igrave;nh c&ocirc;ng nghệ</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\\"\\" src=\\"http://hoanxanh.com/upload/images/XI%20M%E1%BA%A0.JPG\\" style=\\"color:rgb(34, 34, 34); font-family:arial,verdana,sans-serif; font-size:12px; height:500px; line-height:18px; opacity:0.9; width:300px\\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;<strong><em>Thuyết minh sơ đồ c&ocirc;ng nghệ</em></strong></p>\r\n\r\n<ul>\r\n	<li>Nước thải sản xuất được dẫn theo đường tho&aacute;t ri&ecirc;ng ra hệ thống xử l&yacute; nước thải.D&ograve;ng thải được đưa v&agrave;o hầm tiếp nhận, SCR đặt trước đường ống hầm tiếp nhận c&oacute; nhiệm vụ loại bỏ c&aacute;c chất rắn c&oacute; k&iacute;ch thước lớn như giấy gỗ, ni long, giẻ&nbsp;lau&hellip;để bảo vệ m&aacute;y m&oacute;c thiết bị cho c&ocirc;ng đoạn tiếp theo. Nước thải được bơm qua bể điều h&ograve;a.</li>\r\n	<li>Tại bể điều h&ograve;a, m&aacute;y khuấy trộn ch&igrave;m sẽ h&ograve;a trộn đồng đều nước thải tr&ecirc;n to&agrave;n diện t&iacute;ch bể, ngăn ngừa sự lắng cặn ở bể sinh ra m&ugrave;i kh&oacute; chịu. Bể điều h&ograve;a c&oacute; chức năng điều h&ograve;a lưu lượng v&agrave; nồng độ nước thải trước khi đi v&agrave;o giai đoạn tiếp theo.</li>\r\n	<li>Nước thải từ bể điều h&ograve;a bơm được qua bể phản ứng. Bơm định lượng c&oacute; nhiệm vụ ch&acirc;m h&oacute;a chất trung h&ograve;a, polymer, PAC nhằm tăng qu&aacute; tr&igrave;nh keo tụ tạo b&ocirc;ng v&agrave; trung h&ograve;a nồng độ pH c&oacute; trong nước thải. Nhờ hệ thống motor c&aacute;nh khuấy với tốc độ chậm, c&aacute;c hạt cặn li ti sẽ va chạm kết d&iacute;nh với nhau th&agrave;nh c&aacute;c hạt b&ocirc;ng cặn c&oacute; k&iacute;ch thước lớn hơn rất nhiều. H&agrave;m lượng b&ocirc;ng cặn v&agrave; nước sẽ tự chảy qua bể lắng.</li>\r\n	<li>Tại bể lắng c&aacute;c hạt cặn c&oacute; k&iacute;ch thước lớn sẽ lắng xuống theo nguy&ecirc;n l&yacute; trọng lực sau một thời gian b&ugrave;n từ bể lắng sẽ được đưa đến bể chứa b&ugrave;n.</li>\r\n	<li>Nước thải&nbsp; sau khi lắng sẽ tự chảy qua bể trung gian chuẩn bị cho qu&aacute; tr&igrave;nh lọc &aacute;p lực</li>\r\n	<li>Bể lọc &aacute;p lực gồm c&aacute;c lớp vật liệu: s&otilde;i đỡ, c&aacute;t, than hoạt t&iacute;nh để loại bỏ c&aacute;c hợp chất hữu cơ h&ograve;a tan c&aacute;c nguy&ecirc;n tố dạng vết những chất kh&oacute; hoặc kh&ocirc;ng ph&acirc;n giải sinh học v&agrave; c&aacute;c halogen hữu cơ nhằm đặt được những y&ecirc;u cầu quy định, nước rửa ngược từ bể được dẫn về bể chứa b&ugrave;n.</li>\r\n	<li><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/XI%20MA.png\\" style=\\"height:500px; width:844px\\" /></li>\r\n</ul>\r\n', '', '', '', 11),
	(3, 0, 0, 0, 'QUY TRÌNH XỬ LÝ NƯỚC THẢI THUỘC DA', 'quy-trinh-xu-ly-nuoc-thai-thuoc-da', '', '<table align=\\"left\\" cellpadding=\\"0\\" cellspacing=\\"0\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/THUOC%20DA.png\\" style=\\"height:500px; width:688px\\" /></p>\r\n\r\n<p><strong><em>Thuyết minh sơ đồ c&ocirc;ng nghệ</em></strong></p>\r\n\r\n<ul>\r\n	<li>Nước thải thuộc da được chia th&agrave;nh 3 nguồn ch&iacute;nh.nước thải chứa sunfua, chứa crom, v&agrave; nguồn thải kh&aacute;c.Để tăng hiệu quả xử l&yacute; cần xử l&yacute; sơ bộ tại nguồn thải trước khi đưa v&agrave;o sử l&yacute; tập trung.</li>\r\n	<li>D&ograve;ng nước thải chứa crom được tập trung v&agrave;o bể v&agrave; được bơm h&oacute;a chất trung h&ograve;a trợ keo tụ v&agrave;o nhằm kết tủa hợp chất của crom đồng thời l&agrave;m tăng qu&aacute; tr&igrave;nh đ&ocirc;ng tụ hợp chất h&oacute;a học,sau đ&oacute; nước thải được dẫn về bể điều h&ograve;a.</li>\r\n	<li>D&ograve;ng nước thải chứa sunfua được đưa về bể chứa, tại đ&acirc;y d&ograve;ng nước thải được sục kh&iacute; nhằm oxy h&oacute;a c&aacute;c hợp chất chứa sunfua c&oacute; trong nước thải.</li>\r\n	<li>Sau đ&oacute; tất cả nguồn thải được tập trung về bể điều h&ograve;a, do nước thải thường c&oacute; nồng độ v&agrave; lưu lượng kh&ocirc;ng ổn định theo một đơn vị thời gian n&ecirc;n cần phải ổn định lưu lượng v&agrave; nồng độ trước khi đưa v&agrave;o xử l&yacute;.</li>\r\n	<li>Tại bể lắng sơ bộ ta ch&acirc;m h&oacute;a chất keo tụ v&agrave;o nhằm tăng tr&igrave;nh lắng v&agrave; khử một phần BOD,COD c&oacute; trong nước thải.</li>\r\n	<li>Sau bể lắng sơ bộ nước thải chảy qua bể xử l&yacute; sinh học hiếu kh&iacute; (ở đ&acirc;y ta chọn bể aerotank ). nhờ c&aacute;c vi sinh vật hiếu kh&iacute; c&oacute; trong bể, c&aacute;c vi sinh vật n&agrave;y tiếp nhận oxy từ qu&aacute; tr&igrave;nh thổi kh&iacute; chuyển h&oacute;a c&aacute;c chất lơ lững v&agrave; h&ograve;a tan tạo th&agrave;nh sinh khối. V&igrave; qu&aacute; tr&igrave;nh n&agrave;y c&oacute; thể l&agrave;m giảm 70 &ndash; 80% h&agrave;m lượng BOD,COD.</li>\r\n	<li>Sau đ&oacute; nước thải được đưa về bể lắng 2, mục đ&iacute;ch l&agrave; lắng phần b&ugrave;n c&ograve;n lại từ qu&aacute; tr&igrave;nh xử l&yacute; sinh học v&agrave; tạp chất lơ lửng. Một phần b&ugrave;n lắng được tuần ho&agrave;n về bể sinh học,phần c&ograve;n lại th&igrave; đưa về bể chứa b&ugrave;n.</li>\r\n	<li>Từ thiết bị lắng nước thải được đưa về bể khử tr&ugrave;ng nhằm loại bỏ c&aacute;c vi sinh vật g&acirc;y bệnh v&agrave; l&agrave;m giảm m&ugrave;i h&ocirc;i trong nước thải.Sau khi khử tr&ugrave;ng nước thải đặt ti&ecirc;u chuẩn x&atilde; thải</li>\r\n	<li>B&ugrave;n th&agrave;i từ qu&aacute; tr&igrave;nh lắng được đưa về bể chứa b&ugrave;n nhằm l&agrave;m giảm khối lượng v&agrave; ồn định b&ugrave;n thải, phần nước tach b&ugrave;n được đưa về lại bể điều h&ograve;a v&agrave; tiếp tục một quy tr&igrave;nh.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/THUOC%20DA(1).png\\" style=\\"height:500px; width:890px\\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', 1, 1, 1404460338, 1404462833, 'cleanenvironment13565111_1404460939.jpg', 'cleanenvironment13565111_1404460939_238.26979472141x250.jpg', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI THUỘC DA', 'Leather Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI THUỘC DA', 'Leather Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI THUỘC DA', 'Leather Wastewater Treatment', '', '', '', 'Leather Wastewater Treatment', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/THUOC%20DA.png\\" style=\\"height:500px; opacity:0.9; width:688px\\" /></p>\r\n\r\n<p><strong><em>Thuyết minh sơ đồ c&ocirc;ng nghệ</em></strong></p>\r\n\r\n<ul>\r\n	<li>Nước thải thuộc da được chia th&agrave;nh 3 nguồn ch&iacute;nh.nước