ải được đưa về bể khử tr&ugrave;ng nhằm loại bỏ c&aacute;c vi sinh vật g&acirc;y bệnh v&agrave; l&agrave;m giảm m&ugrave;i h&ocirc;i trong nước thải.Sau khi khử tr&ugrave;ng nước thải đặt ti&ecirc;u chuẩn x&atilde; thải</li>\r\n	<li>B&ugrave;n th&agrave;i từ qu&aacute; tr&igrave;nh lắng được đưa về bể chứa b&ugrave;n nhằm l&agrave;m giảm khối lượng v&agrave; ồn định b&ugrave;n thải, phần nước tach b&ugrave;n được đưa về lại bể điều h&ograve;a v&agrave; tiếp tục một quy tr&igrave;nh.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/THUOC%20DA(1).png\\" style=\\"height:500px; width:890px\\" /></p>\r\n', '', '', '', 2),
	(4, 0, 0, 0, 'QUY TRÌNH XỬ LÝ NƯỚC THẢI TINH BỘT', 'quy-trinh-xu-ly-nuoc-thai-tinh-bot', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20TINH%20BOT(1).png\\" style=\\"height:500px; width:615px\\" /></p>\r\n\r\n<p>- NT chế biến tinh bột khoai m&igrave; được cho qua song chắn r&aacute;c (SCR) đến bể tiếp nhận. SCR c&oacute; t&aacute;c dụng loại bỏ c&aacute;c tạp chất g&acirc;y tắt nghẽn hệ thống xử l&yacute;.</p>\r\n\r\n<p>- NT từ bể tiếp nhận được bơm l&ecirc;n bể điều h&ograve;a. Bể điều ho&agrave; giữ chức năng điều ho&agrave; NT về lưu lượng v&agrave; nồng độ.</p>\r\n\r\n<p>- NT&nbsp; được dẫn đến bể phản ứng tại đ&acirc;y ta ch&acirc;m h&oacute;a chất v&agrave;o nhờ hệ thống bơm định lượng mục đ&iacute;ch l&agrave;m cho qu&aacute; tr&igrave;nh keo tụ tạo b&ocirc;ng diễn ra đảm bảo qu&aacute; tr&igrave;nh lắng diễn ra một c&aacute;ch dễ d&agrave;ng.</p>\r\n\r\n<p>- NT tiếp tục được đưa v&agrave;o bể lắng 1 để loại bỏ cặn tinh bột mịn cặn từ qu&aacute; tr&igrave;nh keo tụ trước đ&oacute; c&oacute; khả năng lắng được.</p>\r\n\r\n<p>- NT được dẫn v&agrave;o bể axit với 2 ng&agrave;y lưu nước nhằm mục đ&iacute;ch khử độc tố CN<sup>-</sup>&nbsp;v&agrave; chuyển h&oacute;a c&aacute;c hợp chất kh&oacute; ph&acirc;n hủy th&agrave;nh c&aacute;c hợp chất đơn giản dễ ph&acirc;n hủy sinh học. Vi sinh vật hoạt động trong bể axit được lấy từ b&ugrave;n tự hoại.</p>\r\n\r\n<p>- Sau khi được xử l&yacute; ở bể axit, NT được trung h&ograve;a bằng v&ocirc;i về pH khoảng 6,5 &ndash; 7,5 tại bể trung h&ograve;a nhằm tạo điều kiện cho qu&aacute; tr&igrave;nh xử l&yacute; sinh học tiếp theo.</p>\r\n\r\n<p>- Khi qua bể lắng nước thải được dẫn đến bể AAO tại đ&acirc;y qu&aacute; tr&igrave;nh xử l&yacute; sinh học diễn ra với nhiều hệ sinh vật kh&aacute;c nhau.Đầu ti&ecirc;n l&agrave; yếm kh&iacute; tiếp theo l&agrave; thiếu kh&iacute; cuối c&ugrave;ng l&agrave; hiếu kh&iacute;,qu&aacute; tr&igrave;nh n&agrave;y xảy ra một c&aacute;ch li&ecirc;n tục.Do đ&oacute; h&agrave;m lượng c&aacute;c chất hữu cơ COD, BOD giảm xuống đến 80 -90% khi qua bể n&agrave;y.</p>\r\n\r\n<p>- Sau khi xử l&yacute; ở bể lọc sinh học NT tiếp tục chảy sang bể lắng 2 để lắng b&ugrave;n hoạt t&iacute;nh. Lượng b&ugrave;n n&agrave;y được r&uacute;t khỏi bể lắng bằng hệ thống bơm b&ugrave;n v&agrave; tuần ho&agrave;n về bể lọc sinh học hiếu kh&iacute;, b&ugrave;n dư được dẫn về bể n&eacute;n b&ugrave;n.</p>\r\n\r\n<p>- NT từ bể lắng 2 tiếp tục chảy qua hồ hiếu kh&iacute; với thời gian lưu nước 10 ng&agrave;y nhằm ổn định nguồn nước thải. Sau đ&oacute; thải ra nguồn tiếp nhận.</p>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/TINH%20BOT.png\\" style=\\"height:500px; width:904px\\" /></p>\r\n', '', 'cong-nghe-nuoc-thai-tinh-botmodel-1404463296.pdf', 1, 1, 1404463296, 0, 'cleanenvironment13565111_1404463295.jpg', 'cleanenvironment13565111_1404463295_238.26979472141x250.jpg', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI TINH BỘT', 'Flour Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI TINH BỘT', 'Flour Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI TINH BỘT', 'Flour Wastewater Treatment', '', '', '', 'Flour Wastewater Treatment', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20TINH%20BOT(1).png\\" style=\\"height:500px; width:615px\\" /></p>\r\n\r\n<p>- NT chế biến tinh bột khoai m&igrave; được cho qua song chắn r&aacute;c (SCR) đến bể tiếp nhận. SCR c&oacute; t&aacute;c dụng loại bỏ c&aacute;c tạp chất g&acirc;y tắt nghẽn hệ thống xử l&yacute;.</p>\r\n\r\n<p>- NT từ bể tiếp nhận được bơm l&ecirc;n bể điều h&ograve;a. Bể điều ho&agrave; giữ chức năng điều ho&agrave; NT về lưu lượng v&agrave; nồng độ.</p>\r\n\r\n<p>- NT&nbsp; được dẫn đến bể phản ứng tại đ&acirc;y ta ch&acirc;m h&oacute;a chất v&agrave;o nhờ hệ thống bơm định lượng mục đ&iacute;ch l&agrave;m cho qu&aacute; tr&igrave;nh keo tụ tạo b&ocirc;ng diễn ra đảm bảo qu&aacute; tr&igrave;nh lắng diễn ra một c&aacute;ch dễ d&agrave;ng.</p>\r\n\r\n<p>- NT tiếp tục được đưa v&agrave;o bể lắng 1 để loại bỏ cặn tinh bột mịn cặn từ qu&aacute; tr&igrave;nh keo tụ trước đ&oacute; c&oacute; khả năng lắng được.</p>\r\n\r\n<p>- NT được dẫn v&agrave;o bể axit với 2 ng&agrave;y lưu nước nhằm mục đ&iacute;ch khử độc tố CN<sup>-</sup>&nbsp;v&agrave; chuyển h&oacute;a c&aacute;c hợp chất kh&oacute; ph&acirc;n hủy th&agrave;nh c&aacute;c hợp chất đơn giản dễ ph&acirc;n hủy sinh học. Vi sinh vật hoạt động trong bể axit được lấy từ b&ugrave;n tự hoại.</p>\r\n\r\n<p>- Sau khi được xử l&yacute; ở bể axit, NT được trung h&ograve;a bằng v&ocirc;i về pH khoảng 6,5 &ndash; 7,5 tại bể trung h&ograve;a nhằm tạo điều kiện cho qu&aacute; tr&igrave;nh xử l&yacute; sinh học tiếp theo.</p>\r\n\r\n<p>- Khi qua bể lắng nước thải được dẫn đến bể AAO tại đ&acirc;y qu&aacute; tr&igrave;nh xử l&yacute; sinh học diễn ra với nhiều hệ sinh vật kh&aacute;c nhau.Đầu ti&ecirc;n l&agrave; yếm kh&iacute; tiếp theo l&agrave; thiếu kh&iacute; cuối c&ugrave;ng l&agrave; hiếu kh&iacute;,qu&aacute; tr&igrave;nh n&agrave;y xảy ra một c&aacute;ch li&ecirc;n tục.Do đ&oacute; h&agrave;m lượng c&aacute;c chất hữu cơ COD, BOD giảm xuống đến 80 -90% khi qua bể n&agrave;y.</p>\r\n\r\n<p>- Sau khi xử l&yacute; ở bể lọc sinh học NT tiếp tục chảy sang bể lắng 2 để lắng b&ugrave;n hoạt t&iacute;nh. Lượng b&ugrave;n n&agrave;y được r&uacute;t khỏi bể lắng bằng hệ thống bơm b&ugrave;n v&agrave; tuần ho&agrave;n về bể lọc sinh học hiếu kh&iacute;, b&ugrave;n dư được dẫn về bể n&eacute;n b&ugrave;n.</p>\r\n\r\n<p>- NT từ bể lắng 2 tiếp tục chảy qua hồ hiếu kh&iacute; với thời gian lưu nước 10 ng&agrave;y nhằm ổn định nguồn nước thải. Sau đ&oacute; thải ra nguồn tiếp nhận.</p>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/TINH%20BOT.png\\" style=\\"height:500px; width:904px\\" /></p>\r\n', '', '', '', 0),
	(5, 0, 0, 0, 'QUY TRÌNH XỬ LÝ NƯỚC THẢI DỆT NHUỘM', 'quy-trinh-xu-ly-nuoc-thai-det-nhuom', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20DET%20NHUOM.png\\" style=\\"height:600px; width:607px\\" /></p>\r\n\r\n<ul>\r\n	<li>Nước thải từ hầm tiếp nhận dẫn song chắn r&aacute;c sẽ được loại bỏ những tạp chất kh&ocirc; (vải, nilong...), sau đ&oacute; nước thải được qua bể điều h&ograve;a v&agrave; nhờ qu&aacute; tr&igrave;nh khuấy trộn kết hợp với thổi kh&iacute; sơ bộ,nhằm oxy h&agrave;m lượng hữu cơ trong nước thải.Mục đ&iacute;ch của qu&aacute; tr&igrave;nh n&agrave;y l&agrave; ổn định nồng độ v&agrave; lượng nước trong nước thải.</li>\r\n	<li>Tiếp theo nước thải từ bể điều h&ograve;a được bơm ch&igrave;m l&ecirc;n bể phản ứng c&oacute; khuấy trộn để thực hiện qu&aacute; tr&igrave;nh keo tụ c&aacute;c hạt cặn lơ lửng sau đ&oacute; được bơm qua bể lắng I để loại bỏ c&aacute;c loại cặn th&ocirc;, nặng c&oacute; thể g&acirc;y trở ngại cho c&aacute;c c&ocirc;ng đoạn xử l&yacute; sau.</li>\r\n	<li>Nước thải từ bể lắng I tự chảy tr&agrave;n qua bể Aerotank c&oacute; x&aacute;o trộn.Tại bể Aerotank qu&aacute; tr&igrave;nh sinh học hiếu kh&iacute; xảy ra v&agrave; được duy tr&igrave; nhờ kh&ocirc;ng kh&iacute; cấp kh&iacute; từ m&aacute;y thổi kh&iacute;, c&aacute;c vi sinh vật hiếu kh&iacute; (tr&ecirc;n b&ugrave;n hoạt t&iacute;nh) sẽ ph&acirc;n hủy c&aacute;c chất hữu cơ c&ograve;n lại trong nước thải th&agrave;nh c&aacute;c chất v&ocirc; cơ ở dạng đơn giản. Hiệu xuất xử l&yacute; của Aerotank đạt khoảng 70 &ndash;85 %.</li>\r\n	<li>Tiếp đến nước thải được dẫn sang bể lắng II v&agrave; diễn ra lắng cặn hoạt t&iacute;nh, b&ugrave;n sẽ lắng xuống đ&aacute;y bể, nước thải ph&iacute;a tr&ecirc;n được chảy tr&agrave;n qua bể tiếp x&uacute;c khử tr&ugrave;ng bằng dung dịch Clo, nhằm ti&ecirc;u diệt vi khuẩn trước khi thải ra nguồn tiếp nhận.</li>\r\n	<li>B&ugrave;n từ bể lắng II một phần sẽ được tuần ho&agrave;n về bể Aerotank nhằm duy tr&igrave; lượng vi sinh vật c&oacute; trong bể.</li>\r\n	<li>Một phần c&ugrave;ng với lượng b&ugrave;n sinh ra từ bể lắng I sẽ được chuyển v&agrave;o bể chứa b&ugrave;n để t&aacute;ch nước, trong giai đoạn n&agrave;y polymer được ch&acirc;m v&agrave;o nhằm tăng hiệu quả t&aacute;ch nước ra khỏi b&ugrave;n.</li>\r\n	<li>Nước t&aacute;ch b&ugrave;n sẽ được tuần ho&agrave;n trở lại bể điều h&ograve;a. Lượng b&ugrave;n từ bể chứa b&ugrave;n sẽ được chuyển sang m&aacute;y n&eacute;n b&ugrave;n sau đ&oacute; sẽ được chở đi ch&ocirc;n lấp.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/DET%20NHUOM.png\\" style=\\"height:500px; width:939px\\" /></p>\r\n', '', '', 1, 1, 1404463321, 1404463601, 'cleanenvironment13565111_1404463601.jpg', 'cleanenvironment13565111_1404463601_238.26979472141x250.jpg', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI DỆT NHUỘM', 'Textile Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI DỆT NHUỘM', 'Textile Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI DỆT NHUỘM', 'Textile Wastewater Treatment', '', '', '', 'Textile Wastewater Treatment', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20DET%20NHUOM.png\\" style=\\"height:600px; width:607px\\" /></p>\r\n\r\n<ul>\r\n	<li>Nước thải từ hầm tiếp nhận dẫn song chắn r&aacute;c sẽ được loại bỏ những tạp chất kh&ocirc; (vải, nilong...), sau đ&oacute; nước thải được qua bể điều h&ograve;a v&agrave; nhờ qu&aacute; tr&igrave;nh khuấy trộn kết hợp với thổi kh&iacute; sơ bộ,nhằm oxy h&agrave;m lượng hữu cơ trong nước thải.Mục đ&iacute;ch của qu&aacute; tr&igrave;nh n&agrave;y l&agrave; ổn định nồng độ v&agrave; lượng nước trong nước thải.</li>\r\n	<li>Tiếp theo nước thải từ bể điều h&ograve;a được bơm ch&igrave;m l&ecirc;n bể phản ứng c&oacute; khuấy trộn để thực hiện qu&aacute; tr&igrave;nh keo tụ c&aacute;c hạt cặn lơ lửng sau đ&oacute; được bơm qua bể lắng I để loại bỏ c&aacute;c loại cặn th&ocirc;, nặng c&oacute; thể g&acirc;y trở ngại cho c&aacute;c c&ocirc;ng đoạn xử l&yacute; sau.</li>\r\n	<li>Nước thải từ bể lắng I tự chảy tr&agrave;n qua bể Aerotank c&oacute; x&aacute;o trộn.Tại bể Aerotank qu&aacute; tr&igrave;nh sinh học hiếu kh&iacute; xảy ra v&agrave; được duy tr&igrave; nhờ kh&ocirc;ng kh&iacute; cấp kh&iacute; từ m&aacute;y thổi kh&iacute;, c&aacute;c vi sinh vật hiếu kh&iacute; (tr&ecirc;n b&ugrave;n hoạt t&iacute;nh) sẽ ph&acirc;n hủy c&aacute;c chất hữu cơ c&ograve;n lại trong nước thải th&agrave;nh c&aacute;c chất v&ocirc; cơ ở dạng đơn giản. Hiệu xuất xử l&yacute; của Aerotank đạt khoảng 70 &ndash;85 %.</li>\r\n	<li>Tiếp đến nước thải được dẫn sang bể lắng II v&agrave; diễn ra lắng cặn hoạt t&iacute;nh, b&ugrave;n sẽ lắng xuống đ&aacute;y bể, nước thải ph&iacute;a tr&ecirc;n được chảy tr&agrave;n qua bể tiếp x&uacute;c khử tr&ugrave;ng bằng dung dịch Clo, nhằm ti&ecirc;u diệt vi khuẩn trước khi thải ra nguồn tiếp nhận.</li>\r\n	<li>B&ugrave;n từ bể lắng II một phần sẽ được tuần ho&agrave;n về bể Aerotank nhằm duy tr&igrave; lượng vi sinh vật c&oacute; trong bể.</li>\r\n	<li>Một phần c&ugrave;ng với lượng b&ugrave;n sinh ra từ bể lắng I sẽ được chuyển v&agrave;o bể chứa b&ugrave;n để t&aacute;ch nước, trong giai đoạn n&agrave;y polymer được ch&acirc;m v&agrave;o nhằm tăng hiệu quả t&aacute;ch nước ra khỏi b&ugrave;n.</li>\r\n	<li>Nước t&aacute;ch b&ugrave;n sẽ được tuần ho&agrave;n trở lại bể điều h&ograve;a. Lượng b&ugrave;n từ bể chứa b&ugrave;n sẽ được chuyển sang m&aacute;y n&eacute;n b&ugrave;n sau đ&oacute; sẽ được chở đi ch&ocirc;n lấp.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/DET%20NHUOM.png\\" style=\\"height:500px; width:939px\\" /></p>\r\n', '', '', '', 1),
	(6, 0, 0, 0, 'QUY TRÌNH XỬ LÝ NƯỚC THẢI CAO SU', 'quy-trinh-xu-ly-nuoc-thai-cao-su', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20CAO%20SU.png\\" style=\\"height:600px; width:675px\\" /></p>\r\n\r\n<ul>\r\n	<li>Nước thải từ c&ocirc;ng đoạn sản xuất mủ cao su được thu gom dẫn qua song chắn r&aacute;c (SCR) th&ocirc; đi v&agrave;o bể tiếp nhận. SCR th&ocirc; c&oacute; nhiệm vụ loại bỏ tạp chất c&oacute; k&iacute;ch thước lớn.</li>\r\n	<li>Tại bể thu gom nhờ c&oacute; hệ thống gạn mũ được lắp đặt do đ&oacute; sẽ thu lại được một phần cặn cao su tươi,mặt kh&aacute;c để loại bỏ c&aacute;c cặn cao su ở dạng huyền ph&ugrave;. Tại đ&acirc;y nước thải đi qua với tốc độ rất chậm, hạn chế tối đa khả năng x&aacute;o trộn v&agrave; c&aacute;c hạt cao su sẽ tự động nỗi l&ecirc;n bề mặt do ch&ecirc;nh lệch tỉ trọng so với nước.</li>\r\n	<li>Nước được chảy tự nhi&ecirc;n qua bể điều h&ograve;a với vận tốc 1.5m/s, bể điều h&ograve;a giữ chức năng điều h&ograve;a nước thải về lưu lượng v&agrave; nồng độ nhằm tang hiệu quả xử l&yacute; cho c&aacute;c c&ocirc;ng tr&igrave;nh sau.</li>\r\n	<li>Sau đ&oacute; nước thải đi qua bể lắng đứng tại đ&acirc;y mục đ&iacute;ch của c&ocirc;ng tr&igrave;nh n&agrave;y l&agrave; tạo thời gian để c&aacute;c phản ứng diễn ra v&agrave; thu hồi cặn của c&aacute;c phản ứng n&agrave;y.</li>\r\n	<li>Khi qua bể lắng nước thải được dẫn đến bể AAO tại đ&acirc;y qu&aacute; tr&igrave;nh xử l&yacute; sinh học diễn ra với nhiều hệ sinh vật kh&aacute;c nhau. Đầu ti&ecirc;n l&agrave; yếm kh&iacute; tiếp theo l&agrave; thiếu kh&iacute; cuối c&ugrave;ng l&agrave; hiếu kh&iacute;,qu&aacute; tr&igrave;nh n&agrave;y xảy ra một c&aacute;ch li&ecirc;n tục. Do đ&oacute; h&agrave;m lượng c&aacute;c chất hữu cơ COD,BOD giảm xuống đến 80 - 90% khi qua bể n&agrave;y.</li>\r\n	<li>Tiếp đến nước được dẫn qua bề lắng 2 để lắng b&ugrave;n hoạt t&iacute;nh, phần nước sau lắng được dẫn tự nhi&ecirc;n qua hồ ho&agrave;n thiện rồi được dẫn tới nguồn tiếp nhận, lượng b&ugrave;n n&agrave;y được r&uacute;t khỏi bể lắng bằng hệ thống bơm b&ugrave;n v&agrave; tuần ho&agrave;n b&ugrave;n về bể sinh học hiếu kh&iacute;,b&ugrave;n dư được dẫn về bể n&eacute;n b&ugrave;n.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>B&ugrave;n từ bể chứa b&ugrave;n được bơm qua bể n&eacute;n b&ugrave;n tại đ&acirc;y b&ugrave;n được n&eacute;n lại th&agrave;nh từng khối nhằm giảm lượng nước c&oacute; trong b&ugrave;n sau đ&oacute; m&aacute;y lọc &eacute;p b&ugrave;n n&eacute;n b&ugrave;n th&agrave;nh b&aacute;nh b&ugrave;n (m&aacute;y &eacute;p b&ugrave;n d&acirc;y đai) b&aacute;nh b&ugrave;n được v&ocirc; bao vận chuyển đến nơi xử l&yacute;.</li>\r\n	<li>Phần nước t&aacute;ch b&ugrave;n được đưa trở lại bể điều h&ograve;a.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/CAO%20SU(1).png\\" style=\\"height:500px; width:890px\\" /></p>\r\n', '', '', 1, 1, 1404463943, 0, 'cleanenvironment13565111_1404463943.jpg', 'cleanenvironment13565111_1404463943_238.26979472141x250.jpg', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI CAO SU', 'Rubber Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI CAO SU', 'Rubber Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI CAO SU', 'Rubber Wastewater Treatment', '', '', '', 'Rubber Wastewater Treatment', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20CAO%20SU.png\\" style=\\"height:600px; width:675px\\" /></p>\r\n\r\n<ul>\r\n	<li>Nước thải từ c&ocirc;ng đoạn sản xuất mủ cao su được thu gom dẫn qua song chắn r&aacute;c (SCR) th&ocirc; đi v&agrave;o bể tiếp nhận. SCR th&ocirc; c&oacute; nhiệm vụ loại bỏ tạp chất c&oacute; k&iacute;ch thước lớn.</li>\r\n	<li>Tại bể thu gom nhờ c&oacute; hệ thống gạn mũ được lắp đặt do đ&oacute; sẽ thu lại được một phần cặn cao su tươi,mặt kh&aacute;c để loại bỏ c&aacute;c cặn cao su ở dạng huyền ph&ugrave;. Tại đ&acirc;y nước thải đi qua với tốc độ rất chậm, hạn chế tối đa khả năng x&aacute;o trộn v&agrave; c&aacute;c hạt cao su sẽ tự động nỗi l&ecirc;n bề mặt do ch&ecirc;nh lệch tỉ trọng so với nước.</li>\r\n	<li>Nước được chảy tự nhi&ecirc;n qua bể điều h&ograve;a với vận tốc 1.5m/s, bể điều h&ograve;a giữ chức năng điều h&ograve;a nước thải về lưu lượng v&agrave; nồng độ nhằm tang hiệu quả xử l&yacute; cho c&aacute;c c&ocirc;ng tr&igrave;nh sau.</li>\r\n	<li>Sau đ&oacute; nước thải đi qua bể lắng đứng tại đ&acirc;y mục đ&iacute;ch của c&ocirc;ng tr&igrave;nh n&agrave;y l&agrave; tạo thời gian để c&aacute;c phản ứng diễn ra v&agrave; thu hồi cặn của c&aacute;c phản ứng n&agrave;y.</li>\r\n	<li>Khi qua bể lắng nước thải được dẫn đến bể AAO tại đ&acirc;y qu&aacute; tr&igrave;nh xử l&yacute; sinh học diễn ra với nhiều hệ sinh vật kh&aacute;c nhau. Đầu ti&ecirc;n l&agrave; yếm kh&iacute; tiếp theo l&agrave; thiếu kh&iacute; cuối c&ugrave;ng l&agrave; hiếu kh&iacute;,qu&aacute; tr&igrave;nh n&agrave;y xảy ra một c&aacute;ch li&ecirc;n tục. Do đ&oacute; h&agrave;m lượng c&aacute;c chất hữu cơ COD,BOD giảm xuống đến 80 - 90% khi qua bể n&agrave;y.</li>\r\n	<li>Tiếp đến nước được dẫn qua bề lắng 2 để lắng b&ugrave;n hoạt t&iacute;nh, phần nước sau lắng được dẫn tự nhi&ecirc;n qua hồ ho&agrave;n thiện rồi được dẫn tới nguồn tiếp nhận, lượng b&ugrave;n n&agrave;y được r&uacute;t khỏi bể lắng bằng hệ thống bơm b&ugrave;n v&agrave; tuần ho&agrave;n b&ugrave;n về bể sinh học hiếu kh&iacute;,b&ugrave;n dư được dẫn về bể n&eacute;n b&ugrave;n.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>B&ugrave;n từ bể chứa b&ugrave;n được bơm qua bể n&eacute;n b&ugrave;n tại đ&acirc;y b&ugrave;n được n&eacute;n lại th&agrave;nh từng khối nhằm giảm lượng nước c&oacute; trong b&ugrave;n sau đ&oacute; m&aacute;y lọc &eacute;p b&ugrave;n n&eacute;n b&ugrave;n th&agrave;nh b&aacute;nh b&ugrave;n (m&aacute;y &eacute;p b&ugrave;n d&acirc;y đai) b&aacute;nh b&ugrave;n được v&ocirc; bao vận chuyển đến nơi xử l&yacute;.</li>\r\n	<li>Phần nước t&aacute;ch b&ugrave;n được đưa trở lại bể điều h&ograve;a.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/CAO%20SU(1).png\\" style=\\"height:500px; width:890px\\" /></p>\r\n', '', '', '', 0),
	(7, 0, 0, 0, 'QUY TRÌNH XỬ LÝ NƯỚC THẢI SINH HOẠT', 'quy-trinh-xu-ly-nuoc-thai-sinh-hoat', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20SINH%20HOAT.png\\" style=\\"height:460px; width:819px\\" /></p>\r\n\r\n<ul>\r\n	<li>Nước thải thủy sản từ qu&aacute; tr&igrave;nh sản xuất sẽ được tập trung về bể tự hoại.Tại đ&acirc;y nhờ hệ vi sinh vật kị kh&iacute; h&agrave;m lượng hữu cơ COD,BOD sẽ được khử một c&aacute;ch đ&aacute;ng kể trước khi dẫn qua bể điều h&ograve;a</li>\r\n	<li>Tại bể điều h&ograve;a nước thải sẽ được ổn định về lưu lượng v&agrave; nồng độ.Do h&agrave;m lượng t&iacute;nh chất nước thải thường kh&ocirc;ng ổn định trong một đơn vị thời gian.Nếu sự dao động n&agrave;y kh&ocirc;ng được ổn định th&igrave; sẽ rất kh&oacute; xử l&yacute; cho c&aacute;c c&ocirc;ng đoạn về sau v&igrave; v&acirc;y đ&acirc;y l&agrave; giai đoạn kh&ocirc;ng thể thiếu trong qu&aacute; tr&igrave;nh xử l&yacute; nước thải</li>\r\n	<li>Nước thải sau khi qua bể điều h&ograve;a được đưa về bể sinh học.Tại đ&acirc;y sẽ thực hiện qu&aacute; tr&igrave;nh ph&acirc;n hủy c&aacute;c chất hữu cơ c&oacute; trong nước nhờ c&aacute;c vi sinh vật hiếu kh&iacute;.C&aacute;c vi sinh vật sẽ sử dụng h&agrave;m lượng oxy được cung cấp từ thiết bị sục kh&iacute; để ph&acirc;n hủy c&aacute;c chất hữu cơ (BOD,COD) c&oacute; trong nước th&agrave;nh CO2 v&agrave; nước.Việc sụt kh&iacute; nhằm duy tr&igrave; trạng th&aacute;i lơ lững của b&ugrave;n hoạt t&iacute;nh v&agrave; cung cấp oxy cho c&aacute;c vi sinh vật hiếu kh&iacute;.</li>\r\n	<li>Từ bể sinh học nước thải được dẫn qua bể lắng 2,mục đ&iacute;ch của bể n&agrave;y l&agrave; giữ lại h&agrave;m lượng b&ugrave;n từ qu&aacute; tr&igrave;nh sinh học v&agrave; một phần tạp chất lơ lững.Một phần b&ugrave;n được tuần ho&agrave;n vể bể sinh học,phần b&ugrave;n dư th&igrave; được dẩn về bể chứa b&ugrave;n.</li>\r\n	<li>Cuối c&ugrave;ng nước thải được dẫn qua bể khử tr&ugrave;ng nhằm loại bỏ vi sinh vật g&acirc;y bệnh v&agrave; giảm m&ugrave;i h&ocirc;i trong nước thải.sau khi qua bể khử tr&ugrave;ng nước thải đặt ti&ecirc;u chuẩn x&atilde; thải.</li>\r\n	<li>B&ugrave;n thải từ bể chứa b&ugrave;n sẽ được thu gom v&agrave; xủ l&yacute; một c&aacute;ch th&iacute;ch hợp.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/SINH%20HOAT.png\\" style=\\"height:500px; width:883px\\" /></p>\r\n', '', '', 1, 1, 1404464216, 0, 'cleanenvironment13565111_1404464216.jpg', 'cleanenvironment13565111_1404464216_238.26979472141x250.jpg', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI SINH HOẠT', 'Sewage Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI SINH HOẠT', 'Sewage Wastewater Treatment', 'QUY TRÌNH XỬ LÝ NƯỚC THẢI SINH HOẠT', 'Sewage Wastewater Treatment', '', '', '', 'Sewage Wastewater Treatment', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20SINH%20HOAT.png\\" style=\\"height:460px; width:819px\\" /></p>\r\n\r\n<ul>\r\n	<li>Nước thải thủy sản từ qu&aacute; tr&igrave;nh sản xuất sẽ được tập trung về bể tự hoại.Tại đ&acirc;y nhờ hệ vi sinh vật kị kh&iacute; h&agrave;m lượng hữu cơ COD,BOD sẽ được khử một c&aacute;ch đ&aacute;ng kể trước khi dẫn qua bể điều h&ograve;a</li>\r\n	<li>Tại bể điều h&ograve;a nước thải sẽ được ổn định về lưu lượng v&agrave; nồng độ.Do h&agrave;m lượng t&iacute;nh chất nước thải thường kh&ocirc;ng ổn định trong một đơn vị thời gian.Nếu sự dao động n&agrave;y kh&ocirc;ng được ổn định th&igrave; sẽ rất kh&oacute; xử l&yacute; cho c&aacute;c c&ocirc;ng đoạn về sau v&igrave; v&acirc;y đ&acirc;y l&agrave; giai đoạn kh&ocirc;ng thể thiếu trong qu&aacute; tr&igrave;nh xử l&yacute; nước thải</li>\r\n	<li>Nước thải sau khi qua bể điều h&ograve;a được đưa về bể sinh học.Tại đ&acirc;y sẽ thực hiện qu&aacute; tr&igrave;nh ph&acirc;n hủy c&aacute;c chất hữu cơ c&oacute; trong nước nhờ c&aacute;c vi sinh vật hiếu kh&iacute;.C&aacute;c vi sinh vật sẽ sử dụng h&agrave;m lượng oxy được cung cấp từ thiết bị sục kh&iacute; để ph&acirc;n hủy c&aacute;c chất hữu cơ (BOD,COD) c&oacute; trong nước th&agrave;nh CO2 v&agrave; nước.Việc sụt kh&iacute; nhằm duy tr&igrave; trạng th&aacute;i lơ lững của b&ugrave;n hoạt t&iacute;nh v&agrave; cung cấp oxy cho c&aacute;c vi sinh vật hiếu kh&iacute;.</li>\r\n	<li>Từ bể sinh học nước thải được dẫn qua bể lắng 2,mục đ&iacute;ch của bể n&agrave;y l&agrave; giữ lại h&agrave;m lượng b&ugrave;n từ qu&aacute; tr&igrave;nh sinh học v&agrave; một phần tạp chất lơ lững.Một phần b&ugrave;n được tuần ho&agrave;n vể bể sinh học,phần b&ugrave;n dư th&igrave; được dẩn về bể chứa b&ugrave;n.</li>\r\n	<li>Cuối c&ugrave;ng nước thải được dẫn qua bể khử tr&ugrave;ng nhằm loại bỏ vi sinh vật g&acirc;y bệnh v&agrave; giảm m&ugrave;i h&ocirc;i trong nước thải.sau khi qua bể khử tr&ugrave;ng nước thải đặt ti&ecirc;u chuẩn x&atilde; thải.</li>\r\n	<li>B&ugrave;n thải từ bể chứa b&ugrave;n sẽ được thu gom v&agrave; xủ l&yacute; một c&aacute;ch th&iacute;ch hợp.</li>\r\n</ul>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/SINH%20HOAT.png\\" style=\\"height:500px; width:883px\\" /></p>\r\n', '', '', '', 0),
	(8, 0, 0, 0, 'QUY TRÌNH XỬ LÝ NƯỚC THẢI THỦY SẢN', 'quy-trinh-xu-ly-nuoc-thai-thuy-san', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/QT%20THUY%20SAN.png\\" style=\\"height:500px; width:779px\\" /></p>\r\n\r\n<ul>\r\n	<li>Nước thải thủy sản từ qu&aacute; tr&igrave;nh sản xuất sẽ được tập trung về hố thu gom.Tại song chắn rắc c&aacute;c tạp chất c&oacute; k&iacute;ch thước lớn sẽ được giữ lại đảm bảo điều kiện thuận lợi cho hệ thống v&agrave; tr&aacute;ch tắc nghẹt đường ống.</li>\r\n	<li>Sau khi qua hố thu gom nước thải được dẫn v&agrave;o bể điều h&ograve;a.mục đ&iacute;ch ch&iacute;nh của bể điều h&ograve;a l&agrave; ổn định nước thải về lưu lượng v&agrave; nồng độ n&acirc;ng cao hiệu quả xử l&yacute; d&acirc;y chuyền sau.</li>\r\n	<li>Nước thải tiếp tục được v&agrave;o bể phản ứng tại đ&acirc;y c&oacute; gắn 2 bơm h&oacute;a chất keo tụ v&agrave; trợ keo tụ nhằm tăng k&iacute;ch thước hạt cặn b&ocirc;ng cặn qua đ&oacute; loại trừ h&agrave;m lượng hữu cơ v&agrave; c&aacute;c chất g&acirc;y &ocirc; nhiễm c&oacute; trong nước thải.Nước thải được đưa v&agrave;o bể lắng nhằm tạo thời gian để lắng h&agrave;m lượng cặn từ qu&aacute; tr&igrave;nh phản ứng h&oacute;a học trước đ&oacute;.</li>\r\n	<li>Nước thải sau khi qua bể lắng được đưa về bể sinh học.Tại đ&acirc;y sẽ thực hiện qu&aacute; tr&igrave;nh ph&acirc;n hủy c&aacute;c chất hữu cơ c&oacute; trong nước nhờ c&aacute;c vi sinh vật hiếu kh&iacute;.C&aacute;c vi sinh vật sẽ sử dụng h&agrave;m lượng oxy được cung cấp từ thiết bị sục kh&iacute; để ph&acirc;n hủy c&aacute;c chất hữu cơ (BOD,COD) c&oacute; trong nước th&agrave;nh CO2 v&agrave; nước.Việc sụt kh&iacute; nhằm duy tr&igrave; trạng th&aacute;i lơ lững của b&ugrave;n hoạt t&iacute;nh v&agrave; cung cấp oxy cho c&aacute;c vi sinh vật hiếu kh&iacute;.</li>\r\n	<li>Từ bể sinh học nước thải được dẫn qua bể lắng 2,mục đ&iacute;ch của bể n&agrave;y l&agrave; giữ lại h&agrave;m lượng b&ugrave;n từ qu&aacute; tr&igrave;nh sinh học v&