	(10, 0, 0, 0, 'QUY TRÌNH XỬ LÝ RÁC THẢI', 'quy-trinh-xu-ly-rac-thai', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/LO%20DOT%20RAC.png\\" style=\\"height:500px; width:708px\\" /></p>\r\n\r\n<p>CTRYT sau khi được ph&acirc;n loại cho v&agrave;o c&aacute;c bịch nilon chuy&ecirc;n d&ugrave;ng sẽ được đưa v&agrave;o c&aacute;c th&ugrave;ng chứa v&agrave; vận chuyển đến nơi tập trung r&aacute;c của l&ograve; đốt.</p>\r\n\r\n<ol style=\\"list-style-type:lower-roman\\">\r\n	<li><strong><em>L&ograve; đốt r&aacute;c: </em></strong></li>\r\n</ol>\r\n\r\n<p>L&ograve; đốt được thiết kế l&agrave; đốt 2 cấp bao gồm một buồng đốt sơ cấp v&agrave; một buồng đốt thứ cấp. CTRYT sẽ được đưa v&agrave;o buồng đốt sơ cấp, tại đ&acirc;y sẽ tiến h&agrave;nh bổ sung nhi&ecirc;n liệu đốt l&agrave; dầu DO từ c&aacute;c pec phun dầu v&agrave; cấp kh&iacute; để đốt ch&aacute;y chất thải. Trước ti&ecirc;n CTRYT sẽ được sấy ở nhiệt độ l&ecirc;n đến 200<sup>o</sup>C, trong khoảng nhiệt độ n&agrave;y độ ẩm vật l&yacute; v&agrave; độ ẩm h&oacute;a học của CTRYT được tho&aacute;t ra. Khi nhiệt độ của l&ograve; đốt tăng l&ecirc;n tr&ecirc;n 200<sup>o</sup>C tới nhiệt độ bắt đầu bắt ch&aacute;y sẽ xảy ra những qu&aacute; tr&igrave;nh ph&acirc;n hủy chất rắn bằng nhiệt. những chất hữu cơ c&oacute; thể bị nhiệt ph&acirc;n th&agrave;nh những hợp chất ph&acirc;n tử lượng nhỏ hơn như axit, metanol, axeton, &hellip;. V&agrave; một số khi cũng được sinh ra từ qu&aacute; tr&igrave;nh n&agrave;y như CH<sub>4</sub>, CO, CO<sub>2</sub>, &hellip; Khi đạt đến một nhiệt độ nhất định th&igrave; qu&aacute; tr&igrave;nh ch&aacute;y chất thải sẽ xảy ra. Sau khi ch&aacute;y hết c&aacute;c chất ch&aacute;y được th&igrave; những chất kh&ocirc;ng ch&aacute;y được sẽ tạo th&agrave;nh tro xỉ. Tro xỉ sau khi được đưa ra khỏi l&ograve; đốt để nguội sẽ được thu gom định kỳ v&agrave; được đưa đi ch&ocirc;n lấp ở b&atilde;i ch&ocirc;n lấp tập trung.</p>\r\n\r\n<p>Hỗn hợp kh&iacute; được tạo ra ở l&ograve; đốt sơ cấp sẽ được đưa qua buồng đốt thứ cấp. tại đ&acirc;y, hỗn hợp khi được đốt ch&aacute;y v&agrave; oxy h&oacute;a ở tầm từ 1100 &ndash; 1300<sup>o</sup>C.</p>\r\n\r\n<ol style=\\"list-style-type:lower-roman\\">\r\n	<li><strong><em>Hệ thống xử l&yacute; kh&iacute;</em></strong></li>\r\n</ol>\r\n\r\n<p>&nbsp;Hỗn hợp kh&iacute; thải sau khi ra khỏi l&ograve; (bụi, SO<sub>2</sub>, NO<sub>x</sub>, dioxin, Furan, &hellip;) sẽ được đưa v&agrave;o hệ thống xử l&yacute; kh&iacute; trước khi ph&aacute;t thải ra m&ocirc;i trường.</p>\r\n\r\n<p>Kh&iacute; thải được đưa v&agrave;o th&aacute;p phun rỗng ở đ&aacute;y th&aacute;p v&agrave; đi l&ecirc;n tr&ecirc;n, nước được phun th&agrave;nh những d&ograve;ng nhỏ ngược chiều v&agrave; vu&ocirc;ng g&oacute;c với d&ograve;ng kh&iacute; bụi, c&aacute;c hạt nước sẽ bắt&nbsp; c&aacute;c hạt bụi. tiếp đ&oacute; c&aacute;c hạt nước chứa bụi, dưới t&aacute;c dụng dưới trọng lực c&aacute;c hạt nước chứa bụi sẽ di chuyển về đ&aacute;y th&aacute;p v&agrave; được thu gom ở đ&aacute;y th&aacute;p. Ngo&agrave;i ra, th&aacute;p phun rỗng c&ograve;n c&oacute; nhiệm vụ l&agrave; th&aacute;p giải nhiệt l&agrave;m giảm nhiệt độ của kh&iacute; thải để c&aacute;c qu&aacute; tr&igrave;nh ph&iacute;a sau được sảy ra thuận lợi. ngo&agrave;i ra, th&aacute;p phun rỗng c&ograve;n c&oacute; chức năng hấp thụ xử l&yacute; kh&iacute;.</p>\r\n\r\n<p>Kh&iacute; thải sau khi qua th&aacute;p phun rỗng sẽ được đưa qua th&aacute;p hấp thụ, tại đ&acirc;y c&aacute;c kh&iacute; độc hại g&acirc;y &ocirc; nhiễm m&ocirc;i trường (bụi, SO<sub>2</sub>, NO<sub>x</sub>, dioxin, Furan, &hellip;) sẽ được xử l&yacute; bằng dung dịch hấp thụ trước khi ph&aacute;t thải ra m&ocirc;i trường. Dung dịch hấp thụ sẽ được đưa bể chứa để t&aacute;i sử dụng lại v&agrave; được thay thế bằng dung dịch mới theo định kỳ.</p>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/BAN%20VE%20LO%20DOT%20RAC.png\\" style=\\"height:450px; width:1012px\\" /></p>\r\n', '', '', 1, 1, 1404465376, 0, 'cleanenvironment13565111_1404465376.jpg', 'cleanenvironment13565111_1404465376_238.26979472141x250.jpg', 'QUY TRÌNH XỬ LÝ RÁC THẢI', 'Wastes Treatment', 'QUY TRÌNH XỬ LÝ RÁC THẢI', 'Wastes Treatment', 'QUY TRÌNH XỬ LÝ RÁC THẢI', 'Wastes Treatment', '', '', '', 'Wastes Treatment', '', '<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/LO%20DOT%20RAC.png\\" style=\\"height:500px; width:708px\\" /></p>\r\n\r\n<p>CTRYT sau khi được ph&acirc;n loại cho v&agrave;o c&aacute;c bịch nilon chuy&ecirc;n d&ugrave;ng sẽ được đưa v&agrave;o c&aacute;c th&ugrave;ng chứa v&agrave; vận chuyển đến nơi tập trung r&aacute;c của l&ograve; đốt.</p>\r\n\r\n<ol style=\\"list-style-type:lower-roman\\">\r\n	<li><strong><em>L&ograve; đốt r&aacute;c:</em></strong></li>\r\n</ol>\r\n\r\n<p>L&ograve; đốt được thiết kế l&agrave; đốt 2 cấp bao gồm một buồng đốt sơ cấp v&agrave; một buồng đốt thứ cấp. CTRYT sẽ được đưa v&agrave;o buồng đốt sơ cấp, tại đ&acirc;y sẽ tiến h&agrave;nh bổ sung nhi&ecirc;n liệu đốt l&agrave; dầu DO từ c&aacute;c pec phun dầu v&agrave; cấp kh&iacute; để đốt ch&aacute;y chất thải. Trước ti&ecirc;n CTRYT sẽ được sấy ở nhiệt độ l&ecirc;n đến 200<sup>o</sup>C, trong khoảng nhiệt độ n&agrave;y độ ẩm vật l&yacute; v&agrave; độ ẩm h&oacute;a học của CTRYT được tho&aacute;t ra. Khi nhiệt độ của l&ograve; đốt tăng l&ecirc;n tr&ecirc;n 200<sup>o</sup>C tới nhiệt độ bắt đầu bắt ch&aacute;y sẽ xảy ra những qu&aacute; tr&igrave;nh ph&acirc;n hủy chất rắn bằng nhiệt. những chất hữu cơ c&oacute; thể bị nhiệt ph&acirc;n th&agrave;nh những hợp chất ph&acirc;n tử lượng nhỏ hơn như axit, metanol, axeton, &hellip;. V&agrave; một số khi cũng được sinh ra từ qu&aacute; tr&igrave;nh n&agrave;y như CH<sub>4</sub>, CO, CO<sub>2</sub>, &hellip; Khi đạt đến một nhiệt độ nhất định th&igrave; qu&aacute; tr&igrave;nh ch&aacute;y chất thải sẽ xảy ra. Sau khi ch&aacute;y hết c&aacute;c chất ch&aacute;y được th&igrave; những chất kh&ocirc;ng ch&aacute;y được sẽ tạo th&agrave;nh tro xỉ. Tro xỉ sau khi được đưa ra khỏi l&ograve; đốt để nguội sẽ được thu gom định kỳ v&agrave; được đưa đi ch&ocirc;n lấp ở b&atilde;i ch&ocirc;n lấp tập trung.</p>\r\n\r\n<p>Hỗn hợp kh&iacute; được tạo ra ở l&ograve; đốt sơ cấp sẽ được đưa qua buồng đốt thứ cấp. tại đ&acirc;y, hỗn hợp khi được đốt ch&aacute;y v&agrave; oxy h&oacute;a ở tầm từ 1100 &ndash; 1300<sup>o</sup>C.</p>\r\n\r\n<ol style=\\"list-style-type:lower-roman\\">\r\n	<li><strong><em>Hệ thống xử l&yacute; kh&iacute;</em></strong></li>\r\n</ol>\r\n\r\n<p>&nbsp;Hỗn hợp kh&iacute; thải sau khi ra khỏi l&ograve; (bụi, SO<sub>2</sub>, NO<sub>x</sub>, dioxin, Furan, &hellip;) sẽ được đưa v&agrave;o hệ thống xử l&yacute; kh&iacute; trước khi ph&aacute;t thải ra m&ocirc;i trường.</p>\r\n\r\n<p>Kh&iacute; thải được đưa v&agrave;o th&aacute;p phun rỗng ở đ&aacute;y th&aacute;p v&agrave; đi l&ecirc;n tr&ecirc;n, nước được phun th&agrave;nh những d&ograve;ng nhỏ ngược chiều v&agrave; vu&ocirc;ng g&oacute;c với d&ograve;ng kh&iacute; bụi, c&aacute;c hạt nước sẽ bắt&nbsp; c&aacute;c hạt bụi. tiếp đ&oacute; c&aacute;c hạt nước chứa bụi, dưới t&aacute;c dụng dưới trọng lực c&aacute;c hạt nước chứa bụi sẽ di chuyển về đ&aacute;y th&aacute;p v&agrave; được thu gom ở đ&aacute;y th&aacute;p. Ngo&agrave;i ra, th&aacute;p phun rỗng c&ograve;n c&oacute; nhiệm vụ l&agrave; th&aacute;p giải nhiệt l&agrave;m giảm nhiệt độ của kh&iacute; thải để c&aacute;c qu&aacute; tr&igrave;nh ph&iacute;a sau được sảy ra thuận lợi. ngo&agrave;i ra, th&aacute;p phun rỗng c&ograve;n c&oacute; chức năng hấp thụ xử l&yacute; kh&iacute;.</p>\r\n\r\n<p>Kh&iacute; thải sau khi qua th&aacute;p phun rỗng sẽ được đưa qua th&aacute;p hấp thụ, tại đ&acirc;y c&aacute;c kh&iacute; độc hại g&acirc;y &ocirc; nhiễm m&ocirc;i trường (bụi, SO<sub>2</sub>, NO<sub>x</sub>, dioxin, Furan, &hellip;) sẽ được xử l&yacute; bằng dung dịch hấp thụ trước khi ph&aacute;t thải ra m&ocirc;i trường. Dung dịch hấp thụ sẽ được đưa bể chứa để t&aacute;i sử dụng lại v&agrave; được thay thế bằng dung dịch mới theo định kỳ.</p>\r\n\r\n<p><img alt=\\"\\" src=\\"http://ninavietnam.vn/cokhitamluc/upload/images/BAN%20VE%20LO%20DOT%20RAC.png\\" style=\\"height:450px; width:1012px\\" /></p>\r\n', '', '', '', 2);
