INSERT INTO `table_thongtin` (`id`, `id_item`, `tinnoibat`, `tinmoi`, `ten`, `tenkhongdau`, `mota`, `noidung`, `loaitin`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`) VALUES
	(1, 1, 0, 0, 'Giới thiệu công ty', 'gioi-thieu-cong-ty', '', '<p><strong>1. Lịch sử h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Thảocomputer th&agrave;nh lập cửa h&agrave;ng đầu ti&ecirc;n tại 106 Vườn Chuối, phường 4, quận 3, Tp. HCM năm 2009.</p>\r\n<p>&nbsp;</p>\r\n<p>Th&aacute;ng 10/2010 c&ocirc;ng ty đ&atilde; ch&iacute;nh thức mở th&ecirc;m chi nh&aacute;nh tại 122 B&ugrave;i Thị Xu&acirc;n, quận 1 chuy&ecirc;n b&aacute;n những thiết bị v&agrave; linh kiện m&aacute;y t&iacute;nh, sửa chữa, c&agrave;i đặt phần mềm v&agrave; chuy&ecirc;n cung cấp c&aacute;c phụ kiện về Iphone, Ipad.</p>\r\n<p>&nbsp;</p>\r\n<p>Linhkiengiatot.vn ra đời theo định hướng l&agrave; một chuỗi cửa h&agrave;ng tiện lợi chuy&ecirc;n b&aacute;n linh kiện m&aacute;y t&iacute;nh, lap top, m&aacute;y t&iacute;nh bảng, phụ kiện Apple, thiết bị văn ph&ograve;ng&hellip;.với đội ngũ nh&acirc;n vi&ecirc;n c&oacute; tr&igrave;nh độ chuy&ecirc;n m&ocirc;n cao v&agrave; phong c&aacute;ch phục vụ th&acirc;n thiện.</p>\r\n<p><strong><br />2. Tầm nh&igrave;n</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Trở th&agrave;nh biểu tượng ti&ecirc;n phong trong lĩnh vực ph&acirc;n phối linh kiện m&aacute;y t&iacute;nh, thiết bị văn ph&ograve;ng v&agrave; điện tử ti&ecirc;u d&ugrave;ng.</p>\r\n<p><br /><strong>3. Sứ mệnh</strong></p>\r\n<p><br />Linhkiengiatot.vn cam kết mang đến cho người ti&ecirc;u d&ugrave;ng sản phẩm linh kiện ch&iacute;nh h&atilde;ng với với mức gi&aacute; tốt nhất c&ugrave;ng phong c&aacute;ch phục vụ v&agrave;&nbsp; tư vấn chuy&ecirc;n nghiệp.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>4. Gi&aacute; trị cốt l&otilde;i</strong></p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://linhkiengiatot.vn/images/stories/hinh%20cot%20loi.png" alt="" /></p>\r\n<p><strong><br />5. Triết l&yacute; kinh doanh</strong></p>\r\n<p><br />Tối thiểu h&oacute;a chi ph&iacute; &amp; tối đa h&oacute;a tiện &iacute;ch sản phẩm dịch vụ nhằm mang đến sản phẩm chất lượng cao với mức gi&aacute; tốt nhất cho kh&aacute;ch h&agrave;ng.</p>\r\n<p><br />B&aacute;n lợi &iacute;ch, kh&ocirc;ng b&aacute;n đặc t&iacute;nh: Ch&uacute;ng t&ocirc;i kh&ocirc;ng b&aacute;n những đặc t&iacute;nh sản phẩm hiện c&oacute; m&agrave; chỉ b&aacute;n những sản phẩm linh kiện c&oacute; lợi &iacute;ch ph&ugrave; hợp với nhu cầu v&agrave; sở th&iacute;ch của kh&aacute;ch h&agrave;ng.</p>', '', '', '', 1, 1, 1354501430, 0),
	(2, 1, 0, 0, 'Phương châm bán hàng', 'phuong-cham-ban-hang', '', '<p><strong>H&agrave;ng ch&iacute;nh h&atilde;ng:&nbsp;</strong><strong>Linhkiengiatot.vn</strong>&nbsp;chuy&ecirc;n cung cấp những sản phẩm chất lượng từ c&aacute;c thương hiệu nổi tiếng h&agrave;ng đầu thế giới như SONY, DELL, HP, APPLE, &hellip;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Gi&aacute; tốt nhất</strong>: Với mối quan hệ c&ugrave;ng sức mạnh đ&agrave;m ph&aacute;n với nh&agrave; cung cấp gi&uacute;p ch&uacute;ng t&ocirc;i lu&ocirc;n mang lại cho kh&aacute;ch h&agrave;ng mức gi&aacute; tốt nhất khi mua c&aacute;c sản phẩm tại đ&acirc;y. Đồng thời, ch&uacute;ng t&ocirc;i cắt giảm nhiều trung gian ph&acirc;n phối để phục vụ trực tiếp đến tận tay người ti&ecirc;u d&ugrave;ng c&ugrave;ng nhiều ưu đ&atilde;i mua sắm mỗi ng&agrave;y để phục vụ cho nhu cầu mua sắm của kh&aacute;ch h&agrave;ng.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://linhkiengiatot.vn/images/stories/tintuc/tintuc/phuongchambanhang.jpg" alt="" border="0" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Chuy&ecirc;n ph&acirc;n phối mặt h&agrave;ng linh kiện:</strong>&nbsp;Với vị thế l&agrave; chuy&ecirc;n cung cấp những sản phẩm linh kiện cho m&aacute;y b&agrave;n, laptop, linh kiện cho Apple, thiết bị văn ph&ograve;ng, thiết bị số v&agrave; những phụ kiện h&agrave;ng độc d&agrave;nh ri&ecirc;ng cho d&acirc;n chơi c&ocirc;ng nghệ.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Phong c&aacute;ch phục vụ v&agrave; tư vấn chuy&ecirc;n nghiệp</strong>: Đến với cửa h&agrave;ng của ch&uacute;ng t&ocirc;i qu&yacute; kh&aacute;ch c&oacute; thể cảm nhận được phong c&aacute;ch phục vụ tận t&igrave;nh, th&acirc;n thiện gần gũi. Tại đ&acirc;y mỗi nh&acirc;n vi&ecirc;n b&aacute;n h&agrave;ng đều được đ&agrave;o tạo để trở th&agrave;nh chuy&ecirc;n vi&ecirc;n tư vấn những linh kiện ph&ugrave; hợp với chức năng của sản phẩm v&agrave; giải th&iacute;ch tận t&igrave;nh mọi thắc mắc để bạn c&oacute;&nbsp; được quyết định nhanh ch&oacute;ng v&agrave; đ&uacute;ng đắn nhất.</p>', '', '', '', 2, 1, 1354501474, 1354501484),
	(3, 1, 0, 0, 'Đối tác chiến lược', 'doi-tac-chien-luoc', '', '<p><span>Đang cập &nbsp;nhật</span></p>', '', '', '', 3, 1, 1354501501, 1354501507),
	(4, 1, 0, 0, 'Hợp tác trao đổi', 'hop-tac-trao-doi', '', '<p><img src="http://linhkiengiatot.vn/images/stories/h%20ht%20trao%20doi.png" alt="" /></p>\r\n<p>&nbsp;</p>\r\n<p><span>Kể từ khi ra đời từ 2009 đến nay, Thaocomputer đ&atilde; c&oacute; sự gắn kết với đối t&aacute;c, nh&agrave; cung cấp, kh&aacute;ch h&agrave;ng th&ocirc;ng qua những hoạt động thương mại. Trong suốt thời gian x&acirc;y dựng v&agrave; ph&aacute;t triển, ch&uacute;ng t&ocirc;i đ&atilde; nhận được hỗ trợ, quan t&acirc;m của đối t&aacute;c, nh&agrave; cung cấp dựa tr&ecirc;n tinh thần hợp t&aacute;c &ldquo;đ&ocirc;i b&ecirc;n c&ugrave;ng c&oacute; lợi&rdquo;. &nbsp;Đ&oacute; cũng ch&iacute;nh l&agrave; một nền tảng vững chắc để ch&uacute;ng t&ocirc;i ph&aacute;t triển một trang web b&aacute;n h&agrave;ng online Linhkiengiatot.vn c&ugrave;ng những cam kết&nbsp;</span><span>x&acirc;y dựng một mạng lưới đối t&aacute;c nhằm tạo điều kiện thuận lợi để kinh doanh ng&agrave;y một ph&aacute;t triển hơn. Ch&iacute;nh v&igrave; lẽ đ&oacute;,&nbsp;<strong>Linhkiengiatot.vn&nbsp;</strong>c&oacute; ch&iacute;nh s&aacute;ch về Quảng c&aacute;o - Trao đổi logo, li&ecirc;n kết tr&ecirc;n Website.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>TRAO ĐỔI LOGO:</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>H&igrave;nh thức trao đổi Logo được &aacute;p dụng cho c&aacute;c đối t&aacute;c, nh&agrave; ph&acirc;n phối, nh&agrave; cung cấp sản phẩm của Linhkiengiatot.vn như sau: Logo của đối t&aacute;c được hiển thị trong trang đối t&aacute;c chiến lược của Linhkiengiatot.vn, b&ecirc;n cạnh đ&oacute; qu&yacute; đối t&aacute;c đặt logo hoặc banner của ch&uacute;ng t&ocirc;i l&ecirc;n vị tr&iacute; th&iacute;ch hợp tr&ecirc;n website do hai b&ecirc;n thỏa thuận.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>ĐẶT BANNER:</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>H&igrave;nh thức đặt banner tr&ecirc;n Linhkiengiatot.vn được quy định như sau: Đối t&aacute;c c&oacute; thể đặt banner tại c&aacute;c vị tr&iacute; Top của c&aacute;c danh mục hoặc trang chủ. Ch&uacute;ng t&ocirc;i sẽ duyệt c&aacute;c banner trước khi đặt l&ecirc;n c&aacute;c vị tr&iacute; do đối t&aacute;c y&ecirc;u cầu.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>TRAO ĐỔI HOẶC HỖ TRỢ ĐĂNG TIN:</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Qu&yacute; kh&aacute;ch c&oacute; thể đăng tin tại Website Linhkiengiatot.vn nếu muốn. C&aacute;c th&ocirc;ng tin li&ecirc;n quan vui l&ograve;ng gởi cho ch&uacute;ng t&ocirc;i bằng tập tin đ&iacute;nh k&egrave;m qua email:&nbsp;<a href="mailto:lienhe@linhkiengiatot.vn">lienhe@linhkiengiatot.vn</a>, ch&uacute;ng t&ocirc;i sẽ kiểm duyệt th&ocirc;ng tin, nếu thấy ph&ugrave; hợp sẽ đăng tin trong v&ograve;ng 24 giờ. Tin gởi của qu&yacute; kh&aacute;ch c&oacute; thể được đăng hoặc kh&ocirc;ng đăng v&igrave; một số l&yacute; do như vi phạm nguy&ecirc;n tắc website, tin kh&ocirc;ng ph&ugrave; hợp,&hellip;v&agrave; ch&uacute;ng t&ocirc;i kh&ocirc;ng c&oacute; bất cứ tr&aacute;ch nhiệm n&agrave;o phải th&ocirc;ng b&aacute;o cho qu&yacute; kh&aacute;ch về th&ocirc;ng tin kh&ocirc;ng được đăng cũng như kh&ocirc;ng c&oacute; bất cứ cam kết n&agrave;o từ việc đăng tải th&ocirc;ng tin qu&yacute; kh&aacute;ch gởi cho ch&uacute;ng t&ocirc;i.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span><span>Điều kiện về th&ocirc;ng tin</span></span></strong><strong><span>:</span></strong></p>\r\n<p><span>Th&ocirc;ng tin giới thiệu sản phẩm mới, sản phẩm c&ocirc;ng nghệ hoặc c&aacute;c th&ocirc;ng tin li&ecirc;n quan đến thị trường c&ugrave;ng ng&agrave;nh.</span></p>\r\n<p><span>C&aacute;c th&ocirc;ng tin kh&ocirc;ng vi phạm nguy&ecirc;n tắc về ph&aacute;p luật Việt Nam, kh&ocirc;ng n&oacute;i xấu đối thủ cạnh tranh, kh&ocirc;ng c&oacute; sai phạm kh&aacute;c m&agrave; ch&uacute;ng t&ocirc;i cảm thấy ảnh hưởng đến thương hiệu hoặc kh&ocirc;ng n&ecirc;n đặt l&ecirc;n website của ch&uacute;ng t&ocirc;i.</span></p>', '', '', '', 4, 1, 1354501542, 0),
	(5, 2, 0, 0, 'Thông tin khuyến mãi', 'thong-tin-khuyen-mai', '', '<div class="leading clearfix">\r\n<div class="contentpaneopen">\r\n<div class="article-content">\r\n<p align="center"><strong><span>THỂ LỆ CHƯƠNG TR&Igrave;NH KHUYẾN MẠI</span></strong></p>\r\n<p align="center"><strong><span>&nbsp;</span></strong></p>\r\n<p align="center"><em><span>(SỐ&nbsp;</span></em><em><span>02/KM/2012</span></em><em><span>)</span></em></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><span>1.&nbsp;</span>T&ecirc;n chương tr&igrave;nh khuyến mại:&nbsp;<strong>&ldquo;H&ograve;a nhịp th&aacute;ng 9 c&ugrave;ng Linhkiengiatot.vn&rdquo;</strong></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><span>2.&nbsp;</span>H&agrave;ng ho&aacute;, dịch vụ khuyến mại: Chuột APACER M631 BLUETOOTH cung cấp bởi C&ocirc;ng TNHH MTV DV Thảo.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><span>3.&nbsp;</span>Thời gian khuyến mại: Từ ng&agrave;y 05 th&aacute;ng 09 năm 20</span><span>1</span><span>2 đến hết ng&agrave;y 05 th&aacute;ng 11 năm 2012.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><span>4.&nbsp;</span>Địa b&agrave;n (phạm vi) khuyến mại: &Aacute;p dụng cho phạm vi to&agrave;n bộ hệ thống b&aacute;n h&agrave;ng online tr&ecirc;n website linhkiengiatot.vn.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><span>5.&nbsp;</span>H&igrave;nh thức khuyến mại: Giảm gi&aacute;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>6.&nbsp;</span><span>Đối tượng của chương tr&igrave;nh khuyến mại (đối tượng được hưởng khuyến mại): &Aacute;p dụng cho người đặt h&agrave;ng online tr&ecirc;n hệ thống website linhkiengiatot.vn.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>7.&nbsp;</span><span>Cơ cấu giải thưởng:</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="120">\r\n<p align="center"><strong><span>Gi&aacute; gốc</span></strong></p>\r\n</td>\r\n<td valign="top" width="138">\r\n<p align="c