	(6, 2, 0, 0, 'Tư vấn tiêu dùng', 'tu-van-tieu-dung', '', '<div class="leading clearfix">\r\n<div class="contentpaneopen">\r\n<h2 class="contentheading"><a class="contentpagetitle" href="http://linhkiengiatot.vn/index.php?option=com_content&amp;view=article&amp;id=97:tng-tc-card-ha-cho-laptop-c-&amp;catid=39:tu-van-tieu-dung&amp;Itemid=58">Tăng tốc card đồ họa cho laptop cũ</a></h2>\r\n<div class="article-content">\r\n<p>Những card đồ họa tr&ecirc;n 3 năm tuổi thường bị nh&agrave; sản xuất gạt ra khỏi danh s&aacute;ch hỗ trợ v&agrave; kh&ocirc;ng được"tận hưởng" những tiện &iacute;ch từ tr&igrave;nh điều khiển (driver) mới. Những"cao thủ" của cộng đồng IT liền đưa ra giải ph&aacute;p của ri&ecirc;ng m&igrave;nh.</p>\r\n<p>&nbsp;</p>\r\n<p>Khi chiếc card m&agrave;n h&igrave;nh của desktop lỗi thời, bạn dễ d&agrave;ng th&aacute;o ra v&agrave; n&acirc;ng cấp bằng c&aacute;ch cắm chiếc mới hơn v&agrave;o. C&ugrave;ng một vấn đề đ&oacute; nhưng với laptop th&igrave; kh&oacute; hơn nhiều v&agrave; hầu như kh&ocirc;ng thể n&acirc;ng cấp phần cứng. Những sản phẩm của ATI, một trong 2 h&atilde;ng sảnxuất card đồ họa h&agrave;ng đầu thế giới, sau nhiều năm đ&atilde; trở n&ecirc;n phổ biến trước khi Intel nhảy v&agrave;o thị trường n&agrave;y với chip đồ họa t&iacute;ch hợp.</p>\r\n<p>&nbsp;</p>\r\n<p>Sau khi bị AMD mua lại, những sản phẩm cũ của ATI kh&ocirc;ng được hỗ trợ nhiều. Hầuhết kh&ocirc;ng c&oacute; trong danh s&aacute;ch của tr&igrave;nh điều khiển Catalyst Driver mới nhất. Chủ nh&acirc;n của những laptop c&oacute; card đồ họa rời từng c&oacute; gi&aacute; h&agrave;ng ngh&igrave;n USD đ&agrave;nh phải sử dụng tr&igrave;nh điều khiển (driver software) lỗi thời, thậm ch&iacute; kh&ocirc;ng tương th&iacute;ch với hệ điều h&agrave;nh mới như Windows Vista.</p>\r\n<p>&nbsp;</p>\r\n<p>Những laptop n&agrave;y giờ c&oacute; gi&aacute; kh&aacute; rẻ v&agrave; được người d&ugrave;ng phổ th&ocirc;ng Việt Nam ưa chuộng.Tất nhi&ecirc;n l&agrave; họ phải sử dụng tr&igrave;nh điều khiển cũ đi k&egrave;m m&aacute;y mặc định từ nh&agrave; sảnxuất laptop (OEM). Một số trường hợp bị mất đĩa c&agrave;i hoặc n&acirc;ng cấp hệ điều h&agrave;nh th&igrave; phải sử dụng driver sẵn c&oacute; của Windows hạn chế hơn rất nhiều, kh&ocirc;ng c&oacute; những t&ugrave;y biến tinh chỉnh hiệu năng của card đồ họa.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Từng bước chỉnh sửa driver cho card đồ họa ATI</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><img src="http://linhkiengiatot.vn/images/stories/tang%20toc%20card%20do%20hoa%20cho%20laptop%20cu%201.jpg" alt="" width="595" height="399" /></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Bước 1:&nbsp;&nbsp;Bạn download bản driver Catalyst mới nhất từ website của ATI tại đ&acirc;y. Ch&uacute; &yacute; chọn đ&uacute;ng hệ điều h&agrave;nh tr&ecirc;n m&aacute;y t&iacute;nh của bạn. Nếu vẫn t&igrave;m thấy card đồhọa của bạn trong danh s&aacute;ch c&oacute; nghĩa l&agrave; bạn vẫn được hỗ trợ. Nếu kh&ocirc;ng c&oacute;, bạndownload sản phẩm c&oacute; c&ugrave;ng chủng loại.</p>\r\n<p>&nbsp;</p>\r\n<p>Sau đ&oacute;, bạn download Microsoft XML Core Services 4.0 tại đ&acirc;y. Tiến h&agrave;nh c&agrave;i đặtsau khi download MSXML 4.0.</p>\r\n<p>&nbsp;</p>\r\n<p>Những chiếc laptop IBM ThinkPad T40, T41 vẫn được người d&ugrave;ng phổ th&ocirc;ng ưa th&iacute;ch v&igrave; độ bền bỉ. Cuối c&ugrave;ng l&agrave; tải về phần mềm chỉnh sửa driver DH Driver Modder [LINK=<a href="http://www.driverheaven.net/frontpage/modtool/MobilityDotNET4.zip">http://www.driverheaven.net/frontpage/modtool/MobilityDotNET4.zip</a>] tại đ&acirc;y [/LINK]. Bung n&eacute;n file ZIP v&agrave;o một thư mục ri&ecirc;ng.</p>\r\n<p>&nbsp;</p>\r\n<p>Bước 2: &nbsp;C&aacute;c bước tiến h&agrave;nh</p>\r\n<p>&nbsp;</p>\r\n<p>Với Windows Vista, bạn cần tắt t&iacute;nh năng kiểm tra người d&ugrave;ng (User Account Control- UAC) v&agrave; khởi động lại m&aacute;y. Mặc d&ugrave; đ&acirc;y l&agrave; t&iacute;nh năng bảo mật củaVista n&agrave;y bị người d&ugrave;ng ph&agrave;n n&agrave;n v&agrave; thường tắt đi. Tuynhi&ecirc;n, bạn c&oacute; thể bật trở lại sau khi qu&aacute; tr&igrave;nh chỉnh sửa driver ho&agrave;n tất.</p>\r\n<p>&nbsp;</p>\r\n<p>Sau đ&oacute; bạn chạy file chưa Catalyst Driver đ&atilde; download từ trang của ATI. Theod&otilde;i qu&aacute; tr&igrave;nh theo hướng dẫn tr&ecirc;n m&agrave;n h&igrave;nh, khi phần mềm bung đầy file v&agrave;o ổcứng, hỏi lại c&oacute; c&agrave;i đặt v&agrave;o hệ thống kh&ocirc;ng th&igrave; dừng lại kh&ocirc;ng c&agrave;i tiếp(Cancel). L&uacute;c đ&oacute;, to&agrave;n bộ g&oacute;i driver nằm trong thư mục (folder) c&oacute; dạng: C:\\ATI\\SUPPORT\\8-2_vista32_dd_ccc_wdm_enu_xxxxx\\Driver(trong đ&oacute; d&atilde;y số xxxxx l&agrave; phi&ecirc;n bản của tr&igrave;nh điều khiển).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong><img src="http://linhkiengiatot.vn/images/stories/tang%20toc%20card%20do%20hoa%20cho%20laptop%20cu%202.jpg" alt="" width="731" height="426" /></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Chạy phần mềm DH Driver Modder. Bấm n&uacute;tBrowse chọn thư mục chứa c&aacute;c file bộ Catalyst Driver mới được bung ra. Sau đ&oacute;bấm n&uacute;t Modify để tiến h&agrave;nh chỉnh sửa lại c&aacute;c file cần thiết. Khi qu&aacute; tr&igrave;nhchỉnh sửa kết th&uacute;c, tho&aacute;t khỏi phần mềm DH Driver Modder.</p>\r\n<p>&nbsp;</p>\r\n<p>Chuyển sang thư mục chứa bộ c&agrave;i Catalyst Driver (C:\\ATI\\SUPPORT\\8-2_vista32_dd_ccc_wdm_enu_xxxxx\\Driver),chọn file Setup.EXE để chạy. Khi c&agrave;i đặt, Windows sẽ cảnh b&aacute;o tr&igrave;nh điều khiển n&agrave;ykh&ocirc;ng được chứng nhận. Bạn chỉ cần chấp nhận c&agrave;i đặt.</p>\r\n<p>&nbsp;</p>\r\n<p>Qu&aacute; tr&igrave;nh c&agrave;i đặt kết th&uacute;c, bạn khởi động lại m&aacute;y t&iacute;nh v&agrave; tận hưởng những tiện&iacute;ch tinh chỉnh hiệu năng với chiếc card đồ họa của m&igrave;nh.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Theo Thegioilaptop</strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="article_row cols1 clearfix">\r\n<div class="article_column column1">\r\n<div class="contentpaneopen">\r\n<h2 class="contentheading"><a class="contentpagetitle" href="http://linhkiengiatot.vn/index.php?option=com_content&amp;view=article&amp;id=95:10-kinh-nghim-quy-bau-s-dng-pin-laptop-hiu-qu&amp;catid=39:tu-van-tieu-dung&amp;Itemid=58">10 kinh nghiệm qu&yacute; b&aacute;u sử dụng pin laptop hiệu quả</a></h2>\r\n<div class="article-content">\r\n<p>Lu&ocirc;n c&oacute; một nghịch l&yacute; đ&oacute; l&agrave; sự ph&aacute;t triển pin kh&ocirc;ng thể bắt kịp với sự ph&aacute;t triển của c&aacute;c sản phẩm c&ocirc;ng nghệ. Trong khi c&aacute;c sản phẩm phẩm như laptop hay tablet ng&agrave;y c&agrave;ng nhanh hơn, mạnh hơn v&agrave; ngốn nhiều năng lượng hơn th&igrave; những vi&ecirc;n pin của ch&uacute;ng vẫn chưa thể cung cấp được một mức năng lượng tương xứng. Với xu hướng sử dụng m&aacute;y t&iacute;nh x&aacute;ch tay v&agrave; c&aacute;c thiết bị di động ng&agrave;y c&agrave;ng nhiều như hiện nay, việc phụ thuộc v&agrave;o năng lượng từ pin l&agrave; quan trọng hơn bao giờ hết.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>1. Chống ph&acirc;n mảnh đĩa cứng thường xuy&ecirc;n</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Việc chống ph&acirc;n mảnh đĩa một c&aacute;ch thường xuy&ecirc;n sẽ l&agrave;m ổ cứng tr&ecirc;n laptop của bạn chạy nhanh hơn do đ&oacute; sẽ l&agrave;m giảm thời gian đầu từ của ổ đĩa phải quay đi quay lại v&agrave; qua đ&oacute; sẽ mất &iacute;t năng lượng hơn. V&igrave; thế đ&acirc;y l&agrave; một c&aacute;ch l&agrave;m kh&aacute; hay m&agrave; bạn n&ecirc;n &aacute;p dụng để tăng thời lượng pin cho laptop của m&igrave;nh.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>2. Giảm độ s&aacute;ng m&agrave;n h&igrave;nh</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Độ s&aacute;ng cao gi&uacute;p cho h&igrave;nh ảnh hiển thị tr&ecirc;n m&agrave;n h&igrave;nh tr&ocirc;ng được r&otilde; v&agrave; đẹp hơn. Tuy nhi&ecirc;n điều n&agrave;y c&oacute; thể kh&ocirc;ng n&ecirc;n &aacute;p dụng với laptop v&igrave; n&oacute; sẽ l&agrave;m giảm thời lượng pin của m&aacute;y. Hầu hết c&aacute;c m&aacute;y t&iacute;nh x&aacute;ch tay đều cung cấp t&iacute;nh năng giảm độ s&aacute;ng m&agrave;n h&igrave;nh. Việc giảm độ s&aacute;ng m&agrave;n h&igrave;nh một c&aacute;ch linh hoạt sẽ đem lại cho bạn th&ecirc;m được kh&aacute; nhiều thời gian sử dụng.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>3. Tắt c&aacute;c t&aacute;c vụ chạy nền</strong></p>\r\n<p>&nbsp;</p>\r\n<p>C&aacute;c t&aacute;c vụ chạy nền cũng l&agrave; một trong những nguy&ecirc;n nh&acirc;n khi&ecirc;n thời lượng pin sụt giảm bởi ch&uacute;ng khiến m&aacute;y t&iacute;nh của bạn hoạt động ở mức cao hơn v&agrave; tốn nhiều năng lượng hơn. Trong trường hợp phải mang laptop ra ngo&agrave;i m&agrave; lại kh&ocirc;ng mang theo sạc nhưng bạn vẫn vẫn muốn sử dụng m&aacute;y t&iacute;nh được l&acirc;u nhất c&oacute; thể th&igrave; bạn h&atilde;y tắt bớt c&aacute;c t&aacute;c vụ chạy nền như tr&igrave;nh diệt virut hoặc tr&igrave;nh download như Internet Download Manager. B&ecirc;n cạnh đ&oacute;, bạn cũng kh&ocirc;ng n&ecirc;n mở qu&aacute; nhiều chương tr&igrave;nh c&ugrave;ng một l&uacute;c như mở c&ugrave;ng một l&uacute;c nhiều t&agrave;i liệu hay vừa soạn thảo văn bản v&agrave; vừa nghe nhạc. Tập trung cho một t&aacute;c vụ duy nhất l&agrave; một c&aacute;ch kh&ocirc;ng những l&agrave;m n&acirc;ng cao hiệu quả c&ocirc;ng m&agrave; c&ograve;n tăng thời lượng sử dụng m&aacute;y.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>4. Hạn chế sử dụng c&aacute;c thiết bị gắn ngo&agrave;i</strong></p>\r\n<p>&nbsp;</p>\r\n<p>R&otilde; r&agrave;ng l&agrave; touchpad kh&ocirc;ng thể hiệu quả bằng một con chuột thực sự v&igrave; thế rất nhiều người d&ugrave;ng c&oacute; th&oacute;i quen sử dụng chuột gắn ngo&agrave;i với laptop. Tuy nhi&ecirc;n khi sử dụng với chuột th&igrave; m&aacute;y t&iacute;nh của bạn sẽ phải cung cấp một phần năng lượng của m&igrave;nh để con chuột c&oacute; thể hoạt động v&agrave; điều n&agrave;y v&ocirc; t&igrave;nh l&agrave;m ảnh hưởng tới thời lượng pin của m&aacute;y. Do đ&oacute; nếu laptop của bạn đang trong t&iacute;nh trạng hết pin m&agrave; bạn lại cần phải sử dụng n&oacute; trong thời gian d&agrave;i th&igrave; bạn h&atilde;y tạm thời kh&ocirc;ng sử dụng chuột gắn ngo&agrave;i, thay v&agrave;o đ&oacute; l&agrave; sử dụng touchpad của m&aacute;y. Thao t&aacute;c n&agrave;y c&oacute; thể gi&uacute;p bạn sử dụng m&aacute;y t&iacute;nh th&ecirc;m được từ 15 đến 20 ph&uacute;t. Ngo&agrave;i ra bạn cũng n&ecirc;n tắt Wi-Fi v&agrave; Bluetooth tr&ecirc;n m&aacute;y đi nếu kh&ocirc;ng c&oacute; nhu cầu sử dụng. Ổ DVD v&agrave; USB cũng n&ecirc;n được hạn chế sử dụng để tăng th&ecirc;m thời lượng pin.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>5. N&acirc;ng cấp th&ecirc;m RAM</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Bạn sẽ phải mất một khoản chi ph&iacute; để tăng th&ecirc;m dung lượng RAM tr&ecirc;n m&aacute;y t&iacute;nh. Đổi lại m&aacute;y t&iacute;nh của bạn sẽ chạy nhanh hơn một ch&uacute;t v&agrave; &iacute;t phụ thuộc hơn v&agrave;o bộ nhớ ảo. Tr&ecirc;n l&yacute; thuyết th&igrave; điều n&agrave;y c&oacute; thể l&agrave;m giảm điện năng ti&ecirc;u thụ của m&aacute;y v&igrave; ổ cứng sẽ &iacute;t phải hoạt động hơn để đảm nhận chức năng bộ nhớ ảo. Tuy nhi&ecirc;n th&igrave; một số &yacute; kiến lại cho rằng, nhiều bộ nhớ RAM hơn sẽ khiến m&aacute;y t&iacute;nh phải cung cấp nhiều năng lượng hơn cho phần RAM được th&ecirc;m v&agrave;o v&agrave; qua đ&oacute; l&agrave;m giảm thời lượng pin. N&ecirc;n thiết nghĩ việc tăng RAM để giảm c&ocirc;ng suất cho ổ cứng chỉ mang t&iacute;nh l&yacute; thuyết.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>6. Vệ sinh pin</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Nếu c&oacute; thể bạn h&atilde;y vệ sinh c&aacute;c ch&acirc;n tiếp x&uacute;c kim loại của pin v&agrave;i th&aacute;ng một lần. Bạn c&oacute; thể thực hiện việc n&agrave;y với một chiếc khăn thấm cồn. Việc vệ sinh pin của m&aacute;y sẽ l&agrave;m giảm năng lượng thất tho&aacute;t khi sử dụng laptop v&agrave; bạn sẽ c&oacute; nhiều thời gian sử dụng m&aacute;y hơn.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>7. Sử dụng pin hiệu quả</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Tuổi thọ v&agrave; thời lượng pin phụ thuộc rất nhiều v&agrave;o c&aacute;ch sử dụng do vậy bạn cần phải sử dụng pin một c&aacute;ch đ&uacute;ng đắn để tr&aacute;nh hiện tượng pin bị chai v&agrave; giảm dung lượng pin. Để pin bền, bạn n&ecirc;n ch&uacute; trọng đến c&aacute;ch sạc pin mới: "Bạn cần sạc rồi xả pin từ 3 đến 4 lần trước khi sử dụng để bảo đảm sử dụng tối đa c&ocirc;ng suất của pin.Trong khi sạc nếu pin đ&atilde; b&aacute;o đầy, bạn h&atilde;y r&uacute;t sạc ra, rồi cắm lại v&agrave; bắt đầu sạc tiếp trong 3 đến 4 lần, như thế pin sẽ được nạp đầy nhất c&oacute; thể".</p>\r\n<p>&nbsp;</p>\r\n<p>Khi kh&ocirc;ng sử dụng, bạn h&atilde;y th&aacute;o pin v&agrave; cất ở nơi kh&ocirc;, m&aacute;t v&igrave; nếu để pin gần nguồn nhiệt sẽ l&agrave;m ảnh hưởng đến tuổi thọ v&agrave; dung lượng pin. Nếu kh&ocirc;ng sử dụng một thời gian d&agrave;i, khi d&ugrave;ng lại, bạn cũng phải sạc v&agrave; xả thật sạch rồi mới sử dụng. Một điều cần lưu &yacute; rằng, tuy kh&ocirc;ng d&ugrave;ng pin nhưng bạn cũng cần phải nạp v&agrave; xả pin theo định kỳ 2-3 th&aacute;ng v&igrave; nếu kh&ocirc;ng hoạt động v&agrave; kh&ocirc;ng được sạc, pin sẽ mất khả năng t&iacute;ch tụ v&agrave; xả năng lượng.</p>\r\n<p>&nbsp;</p>\r\n<p>Bạn c&oacute; thể l&agrave;m giảm hiệu ứng nhớ (hiệu ứng l&agrave;m giảm thời lượng pin do pin "lưu" lại trạng th&aacute;i dung lượng gần nhất) tr&ecirc;n một số laptop sử dụng pin đời cũ bằng c&aacute;ch sạc đầy pin v&agrave; xả to&agrave;n bộ &iacute;t nhất một lần trong v&ograve;ng 2-3 tuần. Với những laptop sử dụng pin Li-ion hiện ứng nhớ đ&atilde; được khắc phục đ&aacute;ng kể do đ&oacute; bạn sẽ kh&ocirc;ng cần phải thực hiện việc n&agrave;y.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>8. Sử dụng Hibernate thay v&igrave; Standby</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Hibernate v&agrave; Standby l&agrave; hai t&iacute;nh năng gi&uacute;p cho m&aacute;y t&iacute;nh c&oacute; thể khởi động nhanh hơn. Nhưng thay v&igrave; sử dụng Standby th&igrave; bạn h&atilde;y sử dụng Hibernate v&igrave; Hibernate c&oacute; thể tắt m&aacute;y t&iacute;nh ho&agrave;n to&agrave;n trong khi vẫn lưu lại trạng th&aacute;i đang l&agrave;m việc của n&oacute;. V&igrave; thế bạn c&oacute; thể bảo to&agrave;n được thời lượng pin của m&aacute;y.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>9. Giữ cho laptop "m&aacute;t" nhất c&oacute; thể</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Như đ&atilde; đề cập ở tr&ecirc;n nhiệt độ l&agrave;m ảnh hưởng rất xấu tới pin, do vậy bạn n&ecirc;n tiến h&agrave;nh vệ sinh c&aacute;c lỗ th&ocirc;ng hơi v&agrave; khe cắm của laptop nhằm tr&aacute;nh hạn chế được t&igrave;nh trạng laptop qu&aacute; n&oacute;ng khi sử dụng v&agrave; l&agrave;m giảm thời lượng pin.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>10. Một số lưu &yacute; kh&aacute;c</strong></p>\r\n<p>&nbsp;</p>\r\n<p>- Khi sử dụng c&aacute;c c&ocirc;ng cụ Office bạn c&oacute; thể tắt đi t&iacute;nh năng Autosave để tăng th&ecirc;m một ch&uacute;t thời gian d&ugrave;ng m&aacute;y.</p>\r\n<p>- Những laptop đời mới c&oacute; sử dụng c&ocirc;ng nghệ chuyển đổi giữa card đồ họa rời v&agrave; card đồ họa onboard th&igrave; bạn n&ecirc;n chuyển sang chế độ sử dụng card đồ họa onboard khi sử dụng pin để tiết kiệm tối đa điện năng.</p>\r\n<p>- Bạn c&oacute; thể c&agrave;i đặt v&agrave; tối ưu h&oacute;a c&aacute;c t&ugrave;y chọn điện năng cho m&aacute;y trong mục Power Options của Control Panel v&agrave; c&agrave;i đặt chế độ tối ưu bằng c&aacute;ch chọn Max Battery.</p>\r\n<p>- Bạn ho&agrave;n to&agrave;n kh&ocirc;ng n&ecirc;n sử dụng cục sạc chất lượng thấp, tuổi thọ của pin phụ thuộc rất lớn v&agrave;o hiệu điện thế khi sạc, c&aacute;c cục sạc chất lượng thấp thường tạo ra d&ograve;ng 1 chiều vẫn c&ograve;n gợn s&oacute;ng n&ecirc;n độ ổn định của d&ograve;ng sạc rất thấp.</p>\r\n<p>- Bạn n&ecirc;n tr&aacute;nh sử dụng c&aacute;c chế độ hay phần mềm gi&uacute;p sạc nhanh v&agrave; &ldquo;si&ecirc;u nhanh&rdquo; (như một số thiết bị gần đ&acirc;y c&oacute; chức năng n&agrave;y) v&igrave; để tăng tốc độ sạc, người ta sẽ phải k&iacute;ch cho bộ sạc sạc với điện thế cao hơn mức b&igrave;nh thườn. Do đ&oacute; tốc độ sạc sẽ được đ&aacute;nh đổi bằng tuổi thọ pin, nếu thiết bị của bạn c&oacute; chức năng sạc nhanh, tốt nhất l&agrave; bạn h&atilde;y v&ocirc; hiệu h&oacute;a chế độ n&agrave;y</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="article_row cols1 clearfix">\r\n<div class="article_column column1">\r\n<div class="contentpaneopen">\r\n<h2 class="contentheading"><a class="contentpagetitle" href="http://linhkiengiatot.vn/index.php?option=com_content&amp;view=article&amp;id=92:hng-dn-lam-sch-ban-phim-may-tinh-xach-tay&amp;catid=39:tu-van-tieu-dung&amp;Itemid=58">Hướng dẫn l&agrave;m sạch b&agrave;n ph&iacute;m m&aacute;y t&iacute;nh x&aacute;ch tay</a></h2>\r\n<div class="article-content">\r\n<p><span>Bạn c&oacute; nhận ra rằng b&agrave;n ph&iacute;m m&aacute;y t&iacute;nh x&aacute;ch tay của bạn rất dễ bị b&aacute;m bụi kh&ocirc;ng? Với việc li&ecirc;n tục sử dụng laptop ở b&ecirc;n ngo&agrave;i th&igrave; dĩ nhi&ecirc;n l&agrave; b&agrave;n ph&iacute;m sẽ &ldquo;t&iacute;ch lũy&rdquo; được nhiều chất bẩn. B&agrave;n ph&iacute;m t&iacute;ch bụi bẩn nh&igrave;n tr&ocirc;ng rất mất thẩm mĩ, kh&ocirc;ng những thế sẽ khiến người ngo&agrave;i nh&igrave;n v&agrave;o v&agrave; nghĩ rằng bạn&hellip;lười. Vậy tại sao kh&ocirc;ng tạo th&oacute;i quen vệ sinh b&agrave;n ph&iacute;m laptop? ch&uacute;ng t&ocirc;i sẽ hướng dẫn 5 c&aacute;ch tốt nhất để dọn dẹp đống bụi bẩn tr&ecirc;n laptop. C&oacute; 1 đi&ecirc;̀u quan trọng bạn n&ecirc;n bi&ecirc;́t đ&oacute; l&agrave; trước khi v&ecirc;̣ sinh b&agrave;n ph&iacute;m bạn phải th&aacute;o pin, d&acirc;y ngu&ocirc;̀n, chu&ocirc;̣t, USB, đĩa trong &ocirc;̉ cứng hay b&acirc;́t cứ v&acirc;̣t g&igrave; th&ograve; ra ngo&agrave;i laptop bởi n&ecirc;́u kh&ocirc;ng sẽ r&acirc;́t d&ecirc;̃ g&acirc;y tai nạn.</span></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>1. D&ugrave;ng m&aacute;y h&uacute;t bụi cho laptop</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Bạn đừng nghĩ rằng bỏ tiền mua 1 c&aacute;i m&aacute;y h&uacute;t bụi cho laptop l&agrave; l&atilde;ng ph&iacute; bởi v&igrave; ch&uacute;ng l&agrave; thiết bị cực k&igrave; hữu dụng. Bạn c&oacute; thể d&ugrave;ng dẻ lau để lau bụi tr&ecirc;n b&agrave;n ph&iacute;m nhưng kh&ocirc;ng thể lau được hết, kh&ocirc;ng những thế bạn kh&ocirc;ng thể lau dưới b&agrave;n ph&iacute;m v&agrave; v&igrave; thế bạn mới cần tới chiếc m&aacute;y h&uacute;t bụi. Bạn c&oacute; thể d&ugrave;ng m&aacute;y h&uacute;t bụi lắp pin hoặc nguồn từ cổng USB với gi&aacute; khoảng 50,000 VND tr&ecirc;n thị trường.</span></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>2. Th&aacute;o b&agrave;n ph&iacute;m hoặc ph&iacute;m của laptop</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>C&ocirc;ng việc n&agrave;y th&igrave; đ&ograve;i hỏi bạn phải biết một ch&uacute;t kiến thức laptop bởi nếu kh&ocirc;ng cẩn thận bạn sẽ c&oacute; thể tự l&agrave;m hỏng b&agrave;n ph&iacute;m laptop của m&igrave;nh. Do c&aacute;c h&atilde;ng l&agrave;m laptop c&oacute; c&aacute;ch lắp r&aacute;p ri&ecirc;ng của họ n&ecirc;n kh&ocirc;ng phải c&aacute;ch th&aacute;o rỡ b&agrave;n ph&iacute;m n&agrave;o cũng giống nhau. Khi bạn chọn phương &aacute;n th&aacute;o ph&iacute;m th&igrave; h&atilde;y nhớ ghi lại vị tr&iacute; m&ocirc;̃i ph&iacute;m đ&ecirc;̉ đ&ecirc;̀ ph&ograve;ng bạn qu&ecirc;n m&acirc;́t. Sau khi th&aacute;o được b&agrave;n ph&iacute;m th&igrave; việc vệ sinh sẽ linh hoạt hơn nếu được kết hợp với m&aacute;y h&uacute;t bụi, mi&ecirc;́ng vải m&ecirc;̀m v&agrave; nước. N&ecirc;́u bạn cảm th&acirc;́y kh&ocirc;ng tự tin khi th&aacute;o b&agrave;n ph&iacute;m th&igrave; t&ocirc;́t nh&acirc;́t bạn đừng n&ecirc;n th&aacute;o.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>3. D&ugrave;ng tăm, b&ocirc;ng ngo&aacute;y tai, ch&ocirc;̉i nhỏ</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Một mẹo nữa cũng kh&aacute; đỡ tốn k&eacute;m v&agrave; &iacute;t rủi ro đ&oacute; l&agrave; d&ugrave;ng tăm để khều dưới b&agrave;n ph&iacute;m. V&igrave; đầu tăm nhỏ n&ecirc;n rất th&iacute;ch hợp để m&oacute;c những thứ như cặn bẩn, t&oacute;c, vụn b&aacute;nh&hellip;ra khỏi b&agrave;n ph&iacute;m. Th&ecirc;m nữa, nếu khoảng c&aacute;ch giữa c&aacute;c ph&iacute;m bấm lớn th&igrave; c&oacute; thể d&ugrave;ng b&ocirc;ng ngo&aacute;y tai để lau bụi bẩn. Ngo&agrave;i ra, trong c&aacute;c bộ vệ sinh m&agrave;n h&igrave;nh thường c&oacute; một c&aacute;i chổi nhỏ đ&ecirc;̉ phủi bụi, bạn h&atilde;y d&ugrave;ng n&oacute; đ&ecirc;̉ v&ecirc;̣ sinh b&agrave;n ph&iacute;m n&ecirc;́u kh&ocirc;ng mu&ocirc;́n ph&iacute; tăm hoặc b&ocirc;ng ngo&aacute;y tai.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>4. L&acirc;̣t ngược laptop</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>C&aacute;ch n&agrave;y c&oacute; lẽ kh&ocirc;ng phải l&agrave; bi&ecirc;̣n ph&aacute;p t&acirc;n ti&ecirc;́n nhưng n&oacute; lại r&acirc;́t nhanh v&agrave; đơn giản. T&acirc;́t cả những g&igrave; bạn c&acirc;̀n l&agrave;m l&agrave; c&acirc;̀m ngửa laptop, lắc mạnh th&ecirc;́ l&agrave; những bụi b&acirc;̉n lớn sẽ rơi ra h&ecirc;́t.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>5. D&ugrave;ng b&oacute;ng th&ocirc;̉i</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Trong b&ocirc;̣ v&ecirc;̣ sinh m&agrave;n h&igrave;nh LCD thường c&oacute; m&ocirc;̣t c&aacute;i b&oacute;ng th&ocirc;̉i đ&ecirc;̉ th&ocirc;̉i bụi, bạn h&atilde;y t&acirc;̣n dụng n&oacute; đ&ecirc;̉ th&ocirc;̉i bụi b&acirc;̉n d&iacute;nh dưới b&agrave;n ph&iacute;m. V&acirc;̣y l&agrave; b&ocirc;̣ c&ocirc;ng cụ kh&ocirc;ng chỉ lau m&agrave;n h&igrave;nh m&agrave; c&ograve;n v&ecirc;̣ sinh được cả b&agrave;n ph&iacute;m, th&acirc;̣t ti&ecirc;̣n lợi phải kh&ocirc;ng? B&ocirc;̣ c&ocirc;ng cụ thường c&oacute; gi&aacute; từ 15,000 VND trở l&ecirc;n, rẻ hơn nhi&ecirc;̀u so với vi&ecirc;̣c mua m&aacute;y h&uacute;t bụi.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Sau khi v&ecirc;̣ sinh xong th&igrave; bạn h&atilde;y c&ocirc;́ gắng giữ g&igrave;n chi&ecirc;́c b&agrave;n ph&iacute;m qu&iacute; gi&aacute; của m&igrave;nh bằng c&aacute;ch c&oacute; th&ecirc;̉ mua m&ocirc;̣t mi&ecirc;́ng bảo v&ecirc;̣ b&agrave;n ph&iacute;m đ&ecirc;̉ tr&aacute;nh bụi d&iacute;nh v&agrave;o. Hoặc c&ocirc;́ gắng hạn ch&ecirc;́ sử dụng laptop ở những nơi đ&ocirc;ng đ&uacute;c ngo&agrave;i trời.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="article_row cols1 clearfix">\r\n<div class="article_column column1">\r\n<div class="contentpaneopen">\r\n<h2 class="contentheading"><a class="contentpagetitle" href="http://linhkiengiatot.vn/index.php?option=com_content&amp;view=article&amp;id=91:4-lu-y-khi-s-dng-laptop&amp;catid=39:tu-van-tieu-dung&amp;Itemid=58">4 lưu &yacute; khi sử dụng laptop</a></h2>\r\n<div class="article-content">\r\n<p><span>Bất kỳ sản phẩm n&agrave;o cũng c&oacute; những nguy&ecirc;n tắc rất ri&ecirc;ng của n&oacute; v&agrave; c&aacute;c m&aacute;y t&iacute;nh x&aacute;ch tay cũng vậy. Sử dụng ch&uacute;ng sai quy tr&igrave;nh c&oacute; thể khiến m&aacute;y gặp một số lỗi g&acirc;y tốn k&eacute;m trong kh&acirc;u sửa chữa, chưa kể đến sức khoẻ con người cũng chịu ảnh hưởng.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Những tham khảo để sử dụng laptop cho đ&uacute;ng dưới d&acirc;y kh&ocirc;ng hẳn đ&atilde; l&agrave; tất cả nhưng c&oacute; thể gi&uacute;p bạn bảo vệ được sức khoẻ,đảm bảo tuổi thọ m&aacute;y v&agrave; dĩ nhi&ecirc;n l&agrave; cho c&ocirc;ng việc của bạn lu&ocirc;n tr&ocirc;i chảy v&agrave; tr&aacute;nh phải tốn tiền cho những sự cố kh&ocirc;ng đ&aacute;ng c&oacute;.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>1.</span></strong><strong><span>Tuyệt đối kh&ocirc;ng để m&aacute;y tr&ecirc;n đ&ugrave;i</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Quả l&agrave; tin đ&aacute;ng ch&uacute; &yacute; cho những kh&aacute;ch h&agrave;ng ruột của laptop c&oacute; th&oacute;i quen để m&aacute;y l&ecirc;n đ&ugrave;i l&agrave;m việc trong c&aacute;c chuyến c&ocirc;ng t&aacute;c hoặc ở ngo&agrave;i trời hay tr&ecirc;n giường. Do tất cả c&aacute;c bộ phận điều khiển, pin&hellip; đều nằm ở mặt dưới n&ecirc;n trong qu&aacute; tr&igrave;nh hoạt động m&aacute;y sẽ toả ra một lượng nhiệt rất lớn xuống ph&iacute;a dưới. Theo c&aacute;c nh&agrave; khoa học, khi người d&ugrave;ng thường xuy&ecirc;n đặt m&aacute;y tr&ecirc;n đ&ugrave;i th&igrave; lượng nhiệt n&agrave;y sẽ t&aacute;c động xấu v&agrave;o cơ thể. Nhất l&agrave; đối với nam giới, khả năng v&ocirc; sinh l&agrave; rất c&oacute; thể xảy ra. Bởi vậy, bạn l&agrave; người c&oacute; sở th&iacute;ch l&agrave;m việc với laptop tr&ecirc;n đ&ugrave;i th&igrave; ngay từ b&acirc;y giờ h&atilde;y bỏ ngay th&oacute;i quen ấy, nếu kh&ocirc;ng muốn sức khỏe của bạn gặp rắc rối.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Cũng kh&ocirc;ng n&ecirc;n đặt m&aacute;y trực tiếp l&ecirc;n b&agrave;n: Nghe qua thật v&ocirc; l&yacute; v&igrave; nếu kh&ocirc;ng đặt m&aacute;y l&ecirc;n b&agrave;n th&igrave; c&ograve;n biết để ở đ&acirc;u nữa? Nhưng nếu một ng&agrave;y n&agrave;o đ&oacute; bạn bắt gặp hiện tượng m&aacute;y bị treo li&ecirc;n tục th&igrave; khuyến c&aacute;o n&agrave;y phần n&agrave;o đ&oacute; gi&uacute;p bạn khắc phục được sự cố tr&ecirc;n. Nguy&ecirc;n nh&acirc;n của hiện tượng treo m&aacute;y li&ecirc;n tục th&igrave; c&oacute; người: bộ nhớ chứa qu&aacute; nhiều dữ liệu, bị lỗi phần mềm, nhiễm virus&hellip; Nhưng c&ograve;n một nguy&ecirc;n nh&acirc;n kh&aacute;c &iacute;t được biết đến l&agrave; do m&aacute;y qu&aacute; n&oacute;ng kh&ocirc;ng toả nhiệt được. C&aacute;nh quạt giải nhiệt của laptop nằm hơi chếch về b&ecirc;n h&ocirc;ng gần dưới đ&aacute;y gần dưới đ&aacute;y m&aacute;y. Khi đặt m&aacute;y trực tiếp tr&ecirc;n b&agrave;n, m&aacute;y sẽ rất kh&oacute; toả nhiệt v&igrave; kh&ocirc;ng c&oacute; khoảng kh&ocirc;ng gian trống. Hơn nữa, nhiệt độ ở Việt Nam l&agrave; rất cao so với c&aacute;c nước sản xuất laptop n&ecirc;n m&aacute;y c&agrave;ng cần phải được giải nhiệt thường xuy&ecirc;n. V&igrave; thế, nếu kh&ocirc;ng tho&aacute;t nhiệt được, mọi hoạt động của m&aacute;y c&oacute; thể bị ngưng trệ.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Khắc phục lỗi n&agrave;y kh&ocirc;ng kh&oacute;, bạn n&ecirc;n tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t giữa m&aacute;y v&agrave; mặt b&agrave;n. C&aacute;ch đơn giản nhất, vừa hiệu quả lại &iacute;t tốn k&eacute;m l&agrave; k&ecirc; m&aacute;y tr&ecirc;n hai cuốn s&aacute;ch chắc chắn ở hai đầu nhằm tạo một khoảng trống ở giữa. C&aacute;ch kh&aacute;c, tốn k&eacute;m, c&ocirc;ng phu hơn một ch&uacute;t l&agrave; bạn c&oacute; thể d&ugrave;ng kỹ thuật th&aacute;o quạt v&agrave; đưa ra ph&iacute;a ngo&agrave;i cho quạt chạy li&ecirc;n tục.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>2.</span></strong><strong><span>Đặt m&aacute;y trong t&uacute;i đựng đ&uacute;ng quy c&aacute;ch</span></strong></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><span>Tiện &iacute;ch của laptop l&agrave; khả năng di động. Nếu để &yacute; bạn sẽ thấy những chiếc t&uacute;i đựng laptop lu&ocirc;n được thiết kế theo đ&uacute;ng ti&ecirc;u chuẩn: phải c&oacute; khả năng giữ m&aacute;y ở một vị tr&iacute; rất chặt, kh&ocirc;ng c&oacute; bất kỳ sự x&ecirc; dịch n&agrave;o trong qu&aacute; tr&igrave;nh di chuyển. Một số kh&aacute;ch h&agrave;ng đ&ocirc;i khi xem nhẹ vấn đề n&agrave;y. Đặt m&aacute;y trong một chiếc t&uacute;i mỏng, kh&ocirc;ng cố định m&aacute;y chắc chắn n&ecirc;n trong qu&aacute; tr&igrave;nh di chuyển, m&aacute;y bị dịch chuyển nhiều thậm ch&iacute; c&ograve;n c&oacute; thể bị &eacute;p mạnh bởi một số vật dụng kh&aacute;c trong v&agrave; ngo&agrave;i t&uacute;i đựng. Khi bị ch&egrave;n &eacute;p, m&agrave;n h&igrave;nh tinh thể lỏng (LCD) của laptop rất nhạy cảm n&ecirc;n sẽ chịu ảnh hưởng đầu ti&ecirc;n. C&oacute; rất nhiều trường hợp m&aacute;y bị hỏng (xuất hiện những đốm m&agrave;u, c&ograve;n gọi l&agrave; nổ m&agrave;n h&igrave;nh) hoặc vỡ cả m&agrave;n h&igrave;nh do nguy&ecirc;n nh&acirc;n n&agrave;y.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Mở đ&oacute;ng laptop nhẹ nh&agrave;ng: Với kiến tr&uacute;c vỏ s&ograve;, laptop c&oacute; những đ&ograve;i hỏi ri&ecirc;ng khi đ&oacute;ng mở m&aacute;y. Đầu ti&ecirc;n l&agrave; c&aacute;p nối bộ phận m&aacute;y chủ với m&agrave;n h&igrave;nh. Theo c&aacute;c kỹ sư C&ocirc;ng ty Cổ phần Viễn Th&ocirc;ng-Tin học-Điện tử Kasati, trong nhiều trường hợp kh&aacute;ch h&agrave;ng đưa m&aacute;y đến sửa, số m&aacute;y bị rạn c&aacute;p nối do đ&oacute;ng mở li&ecirc;n tục v&agrave; lực đ&oacute;ng mở qu&aacute; mạnh chiếm một lượng đ&aacute;ng kể. Ngo&agrave;i ra, bản lề để điều chỉnh m&agrave;n h&igrave;nh ngửa ra theo từng g&oacute;c độ ph&ugrave; hợp cũng cần được quan t&acirc;m kỹ. Chỉ n&ecirc;n mở m&agrave;n h&igrave;nh ở g&oacute;c độ từ 90-1200. Vượt qu&aacute; g&oacute;c độ n&agrave;y sẽ dẫn đến t&igrave;nh trạng g&atilde;y m&agrave;n h&igrave;nh. Đ&aacute;ng n&oacute;i l&agrave; cả hai sự cố n&agrave;y lại rất kh&oacute; khắc phục do linh kiện c&aacute;p nối v&agrave; bản lề laptop rất đắt v&agrave; cực kỳ hiếm. Nhiều trường hợp sau khi đ&atilde; h&agrave;n lại bản lề, m&aacute;y vẫn kh&ocirc;ng hoạt động được v&agrave; chủ nh&acirc;n đ&agrave;nh n&oacute;i lời tạm biệt do kh&ocirc;ng t&igrave;m được bản lề th&iacute;ch hợp.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>3.</span></strong><strong><span>Vệ sinh m&agrave;n h&igrave;nh</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Bạn cần chăm ch&uacute;t nhiều hơn đến m&agrave;n h&igrave;nh tinh thể lỏng (LCD) v&igrave; m&agrave;n h&igrave;nh n&agrave;y rất đắt gi&aacute;, kh&oacute; sửa chữa v&agrave; t&igrave;m mua. Một đặc điểm của m&agrave;n h&igrave;nh loại n&agrave;y l&agrave; dễ h&uacute;t bụi v&agrave; độ b&aacute;m bụi rất chặt. Nếu chỉ lau bằng giấy mềm th&igrave; khi lau xong, vết bẩn vẫn kh&ocirc;ng đi hết. Để l&agrave;m sạch, nhiều người d&ugrave;ng những dung dịch như nước lau k&iacute;nh để lau m&agrave;n h&igrave;nh. Đừng bao giờ bạn l&agrave;m điều ấy v&igrave; đồng nghĩa với việc bạn tự tay giết chết m&agrave;n h&igrave;nh của m&igrave;nh. C&aacute;ch tốt nhất l&agrave; d&ugrave;ng vải mềm thấm một &iacute;t nước sạch v&agrave; lai theo chiều từ tr&ecirc;n hướng xuống dưới, kh&ocirc;ng lau theo đường v&ograve;ng tr&ograve;n hay từ tr&aacute;i sang phải hay ngược lại. Hết sức cẩn thận, cần tr&aacute;nh kh&ocirc;ng cho nước chảy v&agrave;o c&aacute;c v&agrave;nh của m&agrave;n h&igrave;nh, sau dso d&ugrave;ng khăn kh&ocirc; mềm để l&agrave;m sạch lần cuối. Tất nhi&ecirc;n, trước khi lau bạn n&ecirc;n tắt m&aacute;y.</span></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>4.</span></strong><strong><span>Bảo đảm tuổi thọ m&aacute;y</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Nếu bạn muốn chiếc m&aacute;y t&iacute;nh x&aacute;ch tay của m&igrave;nh nhiều năm vẫn chạy tốt th&igrave; kh&ocirc;ng n&ecirc;n cho m&aacute;y đọc những chiếc đĩa CD đ&atilde; cũ v&agrave; trầy xước nhiều. Khi cho những chiếc đĩa n&agrave;y v&agrave;o, mỗi khi bị vấp đĩa, m&aacute;y sẽ phải tăng c&ocirc;ng suất v&agrave; c&aacute;c mắt đọc cũng phải vận h&agrave;nh tối đa, rất dễ bị ngắt giữa chừng trong khi truy xuất v&ugrave;ng dữ liệu. Đ&oacute; ch&iacute;nh l&agrave; l&yacute; do khiến tuổi thọ của n&oacute; ch&oacute;ng thu ngắn lại. Sau c&ugrave;ng, bạn cũng lưu &yacute; hơn cho bộ phận b&agrave;n ph&iacute;m. Được cấu tạo bởi ma trận h&agrave;ng v&agrave; cột, n&ecirc;n chỉ cần một n&uacute;t b&agrave;n ph&iacute;m hỏng th&igrave; dễ k&eacute;o theo một tổ hợp ph&iacute;m cũng &ldquo;đi đời&rdquo;. Theo khuyến c&aacute;o của c&aacute;c nh&agrave; sản xuất, trong điều kiện l&agrave;m việc tại chỗ, kh&aacute;ch h&agrave;ng n&ecirc;n sử dụng th&ecirc;m b&agrave;n ph&iacute;m v&agrave; chuột ngo&agrave;i. Mỗi đời m&aacute;y đều c&oacute; một bộ b&agrave;n ph&iacute;m v&agrave; chuột ri&ecirc;ng n&ecirc;n kh&ocirc;ng dễ d&agrave;ng thay thế mỗi khi ch&uacute;ng &ldquo;hắt hơi, sổ mũi&rdquo;.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="article_row cols1 clearfix">\r\n<div class="article_column column1">\r\n<div class="contentpaneopen">\r\n<h2 class="contentheading"><a class="contentpagetitle" href="http://linhkiengiatot.vn/index.php?option=com_content&amp;view=article&amp;id=90:cach-s-dng-cng-sieu-bn&amp;catid=39:tu-van-tieu-dung&amp;Itemid=58">C&aacute;ch sử dụng ổ cứng &ldquo;si&ecirc;u&rdquo; bền</a></h2>\r\n<div class="article-content">\r\n<p><strong><span>C&aacute;ch sử dụng ổ cứng &ldquo;si&ecirc;u&rdquo; bền</span></strong></p>\r\n<p><span>Ổ cứng l&agrave; thiết bị lưu trữ c&oacute; thể đọc ghi dữ liệu nhanh ch&oacute;ng bằng một tập hợp c&aacute;c ph&acirc;n tử từ ho&aacute;<strong>&nbsp;</strong>tr&ecirc;n c&aacute;c đĩa quay. Nhưng mỗi khi hoạt động,ch&uacute;ng ph&aacute;t ra tiếng k&ecirc;u r&otilde; r&agrave;ng v&agrave; mỗi l&uacute;c một lớn hơn cũng ch&iacute;nh l&agrave; l&uacute;c ổ cứng của bạn c&oacute; vấn đề.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- Mỗi khi khởi động, m&aacute;y t&iacute;nh đều y&ecirc;u cầu qu&eacute;t (scan) ổ đĩa.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- Sau mỗi lần scan, m&aacute;y thường b&aacute;o c&oacute; lỗi ổ cứng nhưng kh&ocirc;ng khắc phục được.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- M&aacute;y t&iacute;nh thường xuy&ecirc;n b&aacute;o lỗi khi truy cập v&agrave;o file hay thư mục.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- Tốc độ truy xuất file trong ổ cứng chậm hơn nhiều so với b&igrave;nh thường.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- Ổ cứng đ&ocirc;i khi&hellip; biến mất trong BIOS.</span></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>L&agrave;m g&igrave; khi ổ cứng c&oacute; c&aacute;c dấu hiệu tr&ecirc;n?</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- Nhanh ch&oacute;ng sao lưu dữ liệu ra (một v&agrave;i) nơi an to&agrave;n.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- D&ugrave;ng c&aacute;c chương tr&igrave;nh sửa chữa đĩa cứng để khắc phục lỗi (c&oacute; trong c&aacute;c đĩa Hiren&rsquo;BootCD).</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- D&ugrave; c&aacute;c chương tr&igrave;nh sửa lỗi ổ cứng c&oacute; khắc phục ho&agrave;n to&agrave;n c&aacute;c lỗi th&igrave; bạn vẫn cần c&oacute; kế hoạch sao lưu dữ liệu quan trọng v&agrave; thay ổ cứng ngay khi c&oacute; thể.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Lưu &yacute;: Qu&aacute; tr&igrave;nh sửa chữa ổ cứng thường l&agrave;m mất ho&agrave;n to&agrave;n c&aacute;c dữ liệu b&ecirc;n trong ổ cứng. Trường hợp ổ cứng &ldquo;k&ecirc;u&rdquo;, kh&ocirc;ng thể d&ugrave;ng chương tr&igrave;nh để khắc phục m&agrave; phải thay mới ổ cứng kh&aacute;c.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>L&agrave;m g&igrave; khi ổ cứng bị hư, hay mất dữ liệu?</span></strong></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- Trong trường hợp ổ cứng bị hư ho&agrave;n to&agrave;n (kh&ocirc;ng quay, hay kh&ocirc;ng đọc được dữ liệu), bạn thường kh&ocirc;ng l&agrave;m được g&igrave; nhiều ngo&agrave;i việc nhẹ nh&agrave;ng gỡ ổ cứng ra khỏi m&aacute;y rồi mang đến trung t&acirc;m chuy&ecirc;n sửa chữa ổ cứng. V&igrave; d&ugrave; kh&ocirc;ng quay nhưng dữ liệu vẫn c&ograve;n lưu b&ecirc;n trong ổ cứng v&agrave; vẫn c&oacute; khả năng lấy lại bằng c&aacute;c c&ocirc;ng cụ chuy&ecirc;n dụng, n&ecirc;n bạn cần cố gắng nhẹ tay với ổ cứng do c&oacute; khả năng đầu đọc b&ecirc;n trong kh&ocirc;ng được cố định, sẽ l&agrave;m trầy mặt đĩa.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>- Khi ổ cứng chỉ bị mất dữ liệu, bạn kh&ocirc;ng được tiếp tục ghi hay x&oacute;a tr&ecirc;n ổ cứng ấy để tr&aacute;nh hiện tượng dữ liệu mới ch&eacute;p chồng l&ecirc;n dữ liệu bị mất.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Bạn cần d&ugrave;ng c&aacute;c chương tr&igrave;nh kh&ocirc;i phục dữ liệu bị x&oacute;a để lấy lại dữ liệu đ&atilde; mất. Tốt nhất bạn cần c&oacute; kinh nghiệm kh&ocirc;i phục dữ liệu, nếu kh&ocirc;ng th&igrave; n&ecirc;n nhờ người c&oacute; kinh nghiệm hỗ trợ v&igrave; phải d&ugrave;ng đ&uacute;ng chương tr&igrave;nh cho loại dữ liệu cần phục hồi (v&iacute; dụ: c&oacute; những chương tr&igrave;nh chuy&ecirc;n kh&ocirc;i phục file .doc, .bmp, .exe&hellip;, trong khi những chương tr&igrave;nh đa năng c&oacute; hiệu quả phục hồi kh&ocirc;ng cao).</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', '', '', 6, 1, 1354501729, 1354501736),
	(7, 2, 0, 0, 'Ưu đãi doanh nghiệp', 'uu-dai-doanh-nghiep', '', '<p><span>Qu&yacute; doanh nghiệp c&oacute; nhu cầu trang bị cho văn ph&ograve;ng của m&igrave;nh những thiết bị văn ph&ograve;ng v&agrave; c&aacute;c sản phẩm kỹ thuật số phục vụ cho c&ocirc;ng việc như&nbsp;<strong><em>(M&aacute;y in, m&aacute;y qu&eacute;t, m&aacute;y in bill, m&aacute;y chiếu, mực in, m&aacute;y hủy giấy, m&aacute;y đếm tiền, USB, mạch chủ, ổ cứng, ổ đĩa, th&ugrave;ng m&aacute;y, nguồn m&aacute;y t&iacute;nh, m&agrave;n h&igrave;nh, bộ lưu điện, &hellip;)</em></strong></span><span>&nbsp;h&atilde;y</span><span>&nbsp;để Linhkiengiatot.vn chăm s&oacute;c Qu&yacute; c&ocirc;ng ty thật đặc biệt với những ưu đ&atilde;i như sau:</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<ul>\r\n<li><span>Sản phẩm ch&iacute;nh h&atilde;ng</span></li>\r\n<li><span>Gi&aacute; tốt nhất</span></li>\r\n<li><span>Chuy&ecirc;n ph&acirc;n phối mặt h&agrave;ng linh kiện</span></li>\r\n<li><span>Phong c&aacute;ch phục vụ, tư vấn chuy&ecirc;n nghiệp</span></li>\r\n<li><span>C&aacute;c điều khoản thanh to&aacute;n linh hoạt</span></li>\r\n</ul>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Hơn nữa, ch&uacute;ng t&ocirc;i c&ograve;n mở rộng k&ecirc;nh ph&acirc;n phối b&aacute;n sỉ đến c&aacute;c cửa h&agrave;ng, điểm b&aacute;n lẻ,... c&aacute;c mặt h&agrave;ng linh kiện m&aacute;y t&iacute;nh tr&ecirc;n to&agrave;n quốc.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>H&atilde;y li&ecirc;n hệ với ch&uacute;ng t&ocirc;i để được mức gi&aacute; ưu đ&atilde;i nhất!</span></strong></p>', '', '', '', 7, 1, 1354501753, 1354501760),
	(8, 3, 0, 0, 'Chính sách bảo hành', 'chinh-sach-bao-hanh', '', '<p><span><em><span>Xin qu&yacute; kh&aacute;ch kiểm tra h&agrave;ng kỹ khi nhận h&agrave;ng. H&agrave;ng được giao ho&agrave;n to&agrave;n mới 100% v&agrave; c&oacute; d&aacute;n tem bảo h&agrave;nh của Thảo Computer. Tr&ecirc;n tem c&oacute; ghi r&otilde; ng&agrave;y th&aacute;ng năm v&agrave; thời hạn bảo h&agrave;nh theo đ&uacute;ng quy định bảo h&agrave;nh của nh&agrave; sản xuất.</span></em></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><em><span>ĐIỀU KIỆN BẢO H&Agrave;NH:</span></em></strong></p>\r\n<ul>\r\n<li><span><span>Tất cả c&aacute;c linh kiện, thiết bị phải c&oacute; tem bảo h&agrave;nh của Thảo Computer v&agrave; tem phải c&ograve;n trong thời hạn bảo h&agrave;nh.&nbsp;</span></span></li>\r\n<li><span><span>Tem bảo h&agrave;nh, m&atilde; vạch seri number phải c&ograve;n nguy&ecirc;n vẹn, kh&ocirc;ng c&oacute; dấu hiệu cạo sửa, tẩy x&oacute;a hay bị r&aacute;ch mờ.</span></span></li>\r\n<li><span><span>Những hư hỏng của thiết bị được x&aacute;c định do lỗi kỹ thuật hoặc lỗi của nh&agrave; sản xuất.</span></span></li>\r\n<li><span><span>Đối với c&aacute;c linh kiện, thiết bị được cấp phiếu bảo h&agrave;nh ch&iacute;nh h&atilde;ng như : m&aacute;y bộ, Laptop, m&aacute;y in, m&aacute;y scanner, sản phẩm của intel .v.v.v : Khi mua c&aacute;c thiết bị, linh kiện n&agrave;y qu&yacute; kh&aacute;ch sẽ nhận được phiếu bảo h&agrave;nh, tr&ecirc;n phiếu c&oacute; ghi r&otilde; c&aacute;c điều kiện bảo h&agrave;nh, địa chỉ bảo h&agrave;nh, quyền lợi của kh&aacute;ch h&agrave;ng&hellip;. Kh&aacute;ch h&agrave;ng phải xuất tr&igrave;nh phiếu bảo h&agrave;nh khi bảo h&agrave;nh sản phẩm trực tiếp tại trung t&acirc;m bảo h&agrave;nh ghi tr&ecirc;n phiếu hoặc tại cửa h&agrave;ng Thảo Computer.</span></span></li>\r\n<li><span><span>M&agrave;n h&igrave;nh LCD của m&aacute;y bị điểm chấm, c&oacute; số điểm chấm từ 05 điểm trở l&ecirc;n.</span></span></li>\r\n</ul>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><em><span>ĐIỀU KIỆN KH&Ocirc;NG BẢO H&Agrave;NH:</span></em></strong></p>\r\n<ul>\r\n<li><span><span>M&aacute;y hoặc thiết bị c&oacute; dấu hiệu dung dịch lạ hoặc c&oacute; nước v&agrave;o.</span></span></li>\r\n<li><span><span>M&aacute;y hoặc thiết bị do va chạm hoặc đ&atilde; bị rơi rớt, bể mẻ, m&oacute;p m&eacute;o, biến dạng, trầy xước, vết ẩm ướt, gỉ s&eacute;t, ph&ugrave; tụ.</span></span></li>\r\n<li><span><span>Thiết bị c&oacute; dấu hiệu ch&aacute;y nổ, chuột bọ, c&ocirc;n tr&ugrave;ng x&acirc;m nhập hoặc được sử dụng trong m&ocirc;i trường ẩm ướt.</span></span></li>\r\n<li><span><span>Thiết bị hư hỏng do thi&ecirc;n tai hỏa hoạn, sử dụng nguồn điện kh&ocirc;ng ổn định hoặc do lắp đặt, vận chuyển kh&ocirc;ng đ&uacute;ng quy c&aacute;ch, thiết bị bị đứt mạch, ch&aacute;y ph&ugrave;, n&aacute;m .v.v.</span></span></li>\r\n<li><span><span>C&aacute;c trường hợp b&agrave;n ph&iacute;m của m&aacute;y bị bong ph&iacute;m, g&atilde;y chấu, bể, vỡ .v.v.</span></span></li>\r\n<li><span><span>C&aacute;c thiết bị mainboard bị cong ch&acirc;n socket, CPU bị cong hoặc g&atilde;y ch&acirc;n.</span></span></li>\r\n<li><span><span>Kh&ocirc;ng bảo h&agrave;nh c&aacute;c thiết bị phụ kiện như: bộ sạc, tai nghe, cable nối, vỏ m&aacute;y, n&uacute;t c&ocirc;ng tắc, d&acirc;y điện, remote điều khiển, quạt giải nhiệt, sản phẩm tặng k&egrave;m theo chương tr&igrave;nh khuyến m&atilde;i.</span></span></li>\r\n<li><span><span>Đối với m&aacute;y in, ch&uacute;ng t&ocirc;i kh&ocirc;ng bảo h&agrave;nh bao lụa, đầu phun mực.</span></span></li>\r\n</ul>\r\n<p><span><span>&nbsp;</span></span></p>\r\n<p><strong><em><span>CH&Uacute; &Yacute;:</span></em></strong></p>\r\n<ul>\r\n<li><span><span>Kh&ocirc;ng chịu tr&aacute;ch nhiệm bảo h&agrave;nh dữ liệu c&oacute; chứa trong thiết bị lưu trữ của kh&aacute;ch h&agrave;ng khi bảo h&agrave;nh thiết bị.</span></span></li>\r\n</ul>\r\n<p><span><span>&nbsp;</span></span></p>\r\n<p><strong><em><span>PHƯƠNG THỨC BẢO H&Agrave;NH:</span></em></strong></p>\r\n<ul>\r\n<li><span><span>Tất cả c&aacute;c thiết bị được bảo h&agrave;nh miễn ph&iacute; trong suốt thời hạn bảo h&agrave;nh.</span></span></li>\r\n<li><span><span>H&agrave;ng mới mua trong v&ograve;ng 05 ng&agrave;y sẽ được đổi ngay h&agrave;ng mới nếu việc kiểm tra h&agrave;ng đ&oacute; hư hỏng do lỗi của nh&agrave; sản xuất.</span></span></li>\r\n<li><span><span>Trong trường hợp kh&ocirc;ng c&oacute; h&agrave;ng mới để đổi th&igrave; sẽ thỏa thuận đổi sang h&agrave;ng mới kh&aacute;c c&oacute; gi&aacute; trị tương đương hoặc sẽ ho&agrave;n trả lại đ&uacute;ng số tiền m&agrave; qu&yacute; kh&aacute;ch đ&atilde; mua. Ch&uacute; &yacute; : kh&ocirc;ng &aacute;p dụng đối với c&aacute;c thiết bị như : m&aacute;y in, mực in, c&aacute;c thiết bị c&oacute; t&iacute;nh chất hao m&ograve;n, c&aacute;c thiết bị bị cắt rời, bẻ g&atilde;y, l&agrave;m mất bao b&igrave; hoặc bị trầy xước, do bẩn.</span></span></li>\r\n<li><span><span>Trường hợp h&agrave;ng đ&atilde; mua qu&aacute; thời hạn 05 ng&agrave;y th&igrave; sẽ được nhận lại để bảo h&agrave;nh (sửa chữa). Nếu kh&ocirc;ng thể sửa chữa được th&igrave; cửa h&agrave;ng sẽ thay thế một sản phẩm kh&aacute;c tương đương v&agrave; sản phẩm n&agrave;y kh&ocirc;ng nhất thiết mới 100%.</span></span></li>\r\n<li><span><span>Thời gian giải quyết bảo h&agrave;nh từ 3 --&gt; 7 ng&agrave;y kể từ ng&agrave;y nhận (trừ ng&agrave;y Thứ Bảy, Chủ Nhật v&agrave; c&aacute;c ng&agrave;y lễ) v&agrave; t&ugrave;y từng trường hợp c&oacute; thể giải quyết sớm hơn hoặc chậm hơn.</span></span></li>\r\n<li><span><span>Đối với c&aacute;c sản phẩm của Apple, v&igrave; thiết bị phải gởi ra nước ngo&agrave;i&nbsp;để bảo h&agrave;nh n&ecirc;n thời gian giải quyết bảo h&agrave;nh từ 02 đến 04 tuần&nbsp;&nbsp;</span></span></li>\r\n<li><span><span>Đối với c&aacute;c thiết bị kh&ocirc;ng thể sửa chữa được m&agrave; thiết bị n&agrave;y hết h&agrave;ng do kh&ocirc;ng c&ograve;n sản xuất nữa hoặc kh&ocirc;ng c&ograve;n lưu h&agrave;nh tr&ecirc;n thị trường, qu&yacute; kh&aacute;ch phải đợi nh&agrave; ph&acirc;n phối đổi h&agrave;ng kh&aacute;c c&oacute; gi&aacute; trị tương đương hoặc cao hơn v&agrave; b&ugrave; tiền theo thỏa thuận của gi&aacute; cả hiện h&agrave;nh tr&ecirc;n thị trường. Thời hạn bảo h&agrave;nh đối với sản phẩm được thay thế sẽ được t&iacute;nh tiếp tục m&agrave; kh&ocirc;ng bảo h&agrave;nh lại từ đầu.</span></span></li>\r\n<li><span><span>Đối với c&aacute;c thiết bị kh&ocirc;ng sửa chữa được trong nước phải gởi sang nh&agrave; sản xuất ở nước ngo&agrave;i th&igrave; thời hạn c&oacute; thể k&eacute;o d&agrave;i từ 4 đến 6 tuần. Trong trường hợp n&agrave;y cửa h&agrave;ng sẽ thay thế một sản phẩm c&oacute; t&iacute;nh năng tương đương để qu&yacute; kh&aacute;ch tạm sử dụng.</span></span></li>\r\n</ul>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><strong><span>&nbsp;</span></strong></span></p>\r\n<p align="right"><span><strong><em><span>RẤT H&Acirc;N HẠNH ĐƯỢC PHỤC VỤ QU&Yacute; KH&Aacute;CH!</span></em></strong></span></p>', '', '', '', 8, 1, 1354501789, 0),
	(9, 3, 0, 0, 'Chính sách giao nhận', 'chinh-sach-giao-nhan', '', '<p>Phương thức Giao h&agrave;ng - Trả tiền mặt chỉ &aacute;p dụng đối với những khu vực ch&uacute;ng t&ocirc;i hỗ trợ giao nhận miễn ph&iacute; (tham khảo th&ecirc;m ch&iacute;nh s&aacute;ch giao nhận) hoặc trả tiền mua h&agrave;ng trực tiếp tại cửa h&agrave;ng linhkiengiatot.vn.</p>\r\n<p>&nbsp;</p>\r\n<p>Với phương thức thanh to&aacute;n trực tiếp qu&yacute; kh&aacute;ch c&oacute; thể đặt h&agrave;ng tr&ecirc;n Website hoặc đặt h&agrave;ng qua điện thoại. Nh&acirc;n vi&ecirc;n ch&uacute;ng t&ocirc;i sẽ tiến h&agrave;nh xuất h&agrave;ng cho qu&yacute; kh&aacute;ch v&agrave; x&aacute;c nhận ng&agrave;y giờ giao h&agrave;ng với qu&yacute; kh&aacute;ch sau khi xuất h&agrave;ng.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://linhkiengiatot.vn/images/stories/tintuc/tintuc/tien_mat.jpg" alt="" border="0" /></p>\r\n<p>&nbsp;</p>\r\n<p>Qu&yacute; kh&aacute;ch c&oacute; tr&aacute;ch nhiệm thanh to&aacute;n đầy đủ to&agrave;n bộ gi&aacute; trị đơn h&agrave;ng cho Nh&acirc;n vi&ecirc;n giao nhận hoặc Nh&acirc;n vi&ecirc;n b&aacute;n h&agrave;ng v&agrave; chăm s&oacute;c kh&aacute;ch h&agrave;ng của ch&uacute;ng t&ocirc;i ngay khi ho&agrave;n tất kiểm tra h&agrave;ng h&oacute;a v&agrave; nhận h&oacute;a đơn thanh to&aacute;n. Qu&yacute; kh&aacute;ch thanh to&aacute;n đ&uacute;ng số tiền tr&ecirc;n h&oacute;a đơn đ&atilde; ghi, nếu c&oacute; bất cứ thắc mắc n&agrave;o qu&yacute; kh&aacute;ch gọi lại cho ch&uacute;ng t&ocirc;i để được th&ocirc;ng tin cụ thể hơn.</p>', '', '', '', 9, 1, 1354501813, 1355734761),
	(10, 4, 0, 0, 'Hướng dẫn mua hàng online', 'huong-dan-mua-hang-online', '', '<p><span>Bạn c&oacute; thể lựa chọn một trong những c&aacute;ch mua h&agrave;ng sau :</span></p>\r\n<p><span><br /><span>1. Gọi điện đến số điện thoại&nbsp;<strong><span>08 22 18 83 14</span></strong>&nbsp;hoặc số điện thoại&nbsp;<strong>Hotlin<span>e</span><span>&nbsp;0919.245.243</span></strong>, 7g30 - 22g nh&acirc;n vi&ecirc;n ch&uacute;ng t&ocirc;i lu&ocirc;n sẵn s&agrave;ng phục vụ.</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span><span>2.&nbsp;Đặt mua h&agrave;ng tr&ecirc;n website: theo c&aacute;c hướng dẫn sau:</span></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>Bước 1: T&igrave;m mua sản phẩm</span></strong><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Qu&yacute; kh&aacute;ch c&oacute; thể t&igrave;m kiếm th&ocirc;ng tin về sản phẩm theo nhiều c&aacute;ch (t&igrave;m theo nh&oacute;m linh kiện,&nbsp;chức năng t&igrave;m kiếm theo gi&aacute;, theo t&ecirc;n sản phẩm,&hellip;).&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><img src="http://linhkiengiatot.vn/images/stories/untitled.png" alt="" /></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><span>Sau khi chọn được sản phẩm cần mua, vui l&ograve;ng bấm v&agrave;o n&uacute;t &ldquo;</span><strong><span>Bỏ v&agrave;o giỏ</span></strong><span>&rdquo;&nbsp;</span><img src="http://linhkiengiatot.vn/images/stories/hi.png" alt="" /><br /></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><img src="http://linhkiengiatot.vn/images/stories/h2.png" alt="" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span>&nbsp;</span><span>Nếu qu&yacute; kh&aacute;ch muốn&nbsp;</span><strong><span>mua th&ecirc;m sản phẩm kh&aacute;c</span></strong><span>&nbsp;h&atilde;y tiếp tục thực hiện c&aacute;c bước t&igrave;m kiếm sản phẩm v&agrave;&nbsp;</span><strong><span>"Bỏ v&agrave;o giỏ".</span></strong></p>\r\n<p>&nbsp;<span>Sau khi kết th&uacute;c việc chọn sản phẩm, qu&yacute; kh&aacute;ch h&atilde;y click v&agrave;o&nbsp;"<strong><span>Giỏ h&agrave;ng"&nbsp;<img src="http://linhkiengiatot.vn/images/stories/hi.png" alt="" />&nbsp;</span></strong></span><span>&nbsp;để thực hiện thanh to&aacute;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://linhkiengiatot.vn/images/stories/h3.png" alt="" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span>Tại đ&acirc;y</span></strong><span>, qu&yacute; kh&aacute;ch c&oacute; thể tuỳ chọn (mua th&ecirc;m sản phẩm, thay đổi số lượng sản phẩm&hellip;)</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><img src="http://linhkiengiatot.vn/images/stories/h7zz.png" alt="" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span>&nbsp;</span></strong><span>Qu&yacute; kh&aacute;ch vui l&ograve;ng điền đầy đủ th&ocirc;ng tin như h&igrave;nh tr&ecirc;n.</span></p>\r\n<p><strong><span><span>&nbsp;</span></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span>Bước 2: Chọn phương thức vận chuyển v&agrave; thanh to&aacute;n</span></strong><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><img src="http://linhkiengiatot.vn/images/stories/h8.png" alt="" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span>&nbsp;</span><strong><span>Tại đ&acirc;y</span></strong><span>, qu&yacute; kh&aacute;ch c&oacute; thể tuỳ chọn h&igrave;nh thức thanh to&aacute;n</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><strong><span>Thanh to&aacute;n tiền mặt</span></strong></p>\r\n<p><span>Qu&yacute; kh&aacute;ch c&oacute; thể thanh to&aacute;n tiền mặt cho nh&acirc;n vi&ecirc;n&nbsp;giao h&agrave;ng tận nơi hoặc đến trực tiếp cửa h&agrave;ng để thanh to&aacute;n tiền v&agrave; nhận h&agrave;ng .</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span>Chuyển khoản qua ng&acirc;n h&agrave;ng hay qua bưu điện</span></strong></p>\r\n<p><span>Qu&yacute; kh&aacute;ch thanh to&aacute;n bằng&nbsp;<strong><span>h&igrave;nh thức chuyển khoản</span></strong>, xin vui l&ograve;ng chuyển tiền đến c&ocirc;ng ty ch&uacute;ng t&ocirc;i theo t&agrave;i khoản dưới đ&acirc;y:&nbsp;<br /><br /></span></p>\r\n<p><span>T&ecirc;n chủ t&agrave;i khoản:&nbsp;</span><span>CTY TNHH MTV TM DV THẢO</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>Số t&agrave;i khoản: 0331003957258</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>Ng&acirc;n h&agrave;ng:&nbsp;&nbsp;</span><span>TMCP Ngoại Thương VN (TECHCOMBANK) &ndash; Chi Nh&aacute;nh Bến Th&agrave;nh</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>T&ecirc;n chủ t&agrave;i khoản: CTY TNHH MTV TM DV THẢO</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>T&agrave;i khoản số: 060010663061</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>Ng&acirc;n h&agrave;ng: TMCP SACOMBANK &ndash; Chi Nh&aacute;nh CMT8</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>Nội dung: Mua online &lt; T&ecirc;n sản phẩm&gt; - &lt;T&ecirc;n kh&aacute;ch h&agrave;ng&gt; - &lt;Ng&agrave;y mua&gt;<br /><br /><strong><span>Th&ocirc;ng tin k&egrave;m theo:</span></strong>&nbsp;Mua online&lt;T&ecirc;n sản phẩm&gt; - &lt;T&ecirc;n kh&aacute;ch h&agrave;ng&gt; - &lt;Địa chỉ&gt; - &lt;Số ĐT&gt; -&nbsp; &lt;Ng&agrave;y mua&gt;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>Ngay khi nhận được giấy b&aacute;o nhận tiền từ ng&acirc;n h&agrave;ng hay qua đường bưu điện, ch&uacute;ng t&ocirc;i sẽ tiến h&agrave;nh giao h&agrave;ng ngay cho kh&aacute;ch h&agrave;ng. Linhkiengiatot.vn sẽ chịu tr&aacute;ch nhiệm ho&agrave;n to&agrave;n về việc h&agrave;ng ho&aacute; đảm bảo chất lượng v&agrave; đủ số lượng trong qu&aacute; tr&igrave;nh vận chuyển h&agrave;ng ho&aacute; tới địa điểm nhận h&agrave;ng của Qu&yacute; kh&aacute;ch.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span>&nbsp;</span></p>\r\n<p>&nbsp;<strong><span>Bước 3: X&aacute;c nhận mua h&agrave;ng</span></strong><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><img src="http://linhkiengiatot.vn/images/stories/h9.png" alt="" /></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><img src="http://linhkiengiatot.vn/images/stories/h%20at%20hang.png" alt="" /></p>\r\n<p><span>Sau khi qu&yacute; kh&aacute;ch ho&agrave;n tất bước gửi x&aacute;c nhận mua h&agrave;ng hệ thống&nbsp;<strong><em><span>Linhkiengiatot.vn&nbsp;</span></em></strong>đ&atilde; b&aacute;o&nbsp;<strong>Đặt h&agrave;ng th&agrave;nh c&ocirc;ng</strong>&nbsp;th&igrave; nh&acirc;n vi&ecirc;n ch&uacute;ng t&ocirc;i sẽ gọi điện lại để x&aacute;c nhận đơn h&agrave;ng. Hoặc bạn c&oacute; thể li&ecirc;n hệ số điện thoại&nbsp;<strong><span>08 22 18 83 14</span></strong>&nbsp;hoặc số Hotline&nbsp;<strong><span>0919 245 243</span></strong>&nbsp;(từ 7:30 đến 22:00 cả ng&agrave;y lễ v&agrave; CN) để x&aacute;c nhận th&ocirc;ng tin đặt h&agrave;ng.&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span><strong><span>Lưu &yacute;:</span></strong></span><span>&nbsp;&nbsp;<br />1. Ch&uacute;ng t&ocirc;i chỉ chấp nhận những đơn đặt h&agrave;ng khi cung cấp đủ th&ocirc;ng tin ch&iacute;nh x&aacute;c về địa chỉ, số điện thoại. Sau khi bạn đặt h&agrave;ng, ch&uacute;ng t&ocirc;i sẽ li&ecirc;n lạc lại để kiểm tra th&ocirc;ng tin v&agrave; thỏa thuận th&ecirc;m những điều c&oacute; li&ecirc;n quan.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>2. Một số trường hợp nhạy cảm: gi&aacute; trị đơn h&agrave;ng qu&aacute; lớn &amp; thời gian giao h&agrave;ng v&agrave;o buổi tối địa chỉ giao h&agrave;ng trong ng&otilde; hoặc c&oacute; thể dẫn đến nguy hiểm. Ch&uacute;ng t&ocirc;i sẽ chủ động li&ecirc;n lạc với qu&yacute; kh&aacute;ch để thống nhất lại thời gian giao h&agrave;ng cụ thể.<br /><br />3. Trong trường hợp giao h&agrave;ng chậm trễ m&agrave; kh&ocirc;ng b&aacute;o trước, qu&yacute; kh&aacute;ch c&oacute; thể kh&ocirc;ng nhận h&agrave;ng v&agrave; ch&uacute;ng t&ocirc;i sẽ ho&agrave;n trả to&agrave;n bộ số tiền m&agrave; qu&yacute; kh&aacute;ch trả trước (nếu c&oacute;) trong v&ograve;ng 7 ng&agrave;y.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>4.&nbsp;C&ocirc;ng ty&nbsp;cam kết tất cả h&agrave;ng h&oacute;a gởi đến qu&yacute; kh&aacute;ch đều l&agrave; h&agrave;ng ch&iacute;nh h&atilde;ng mới 100% (c&oacute; đầy đủ h&oacute;a đơn, được bảo h&agrave;nh ch&iacute;nh thức). Những rủi ro ph&aacute;t sinh trong qu&aacute; tr&igrave;nh vận chuyển (va đập, ẩm ướt, tai nạn..) c&oacute; thể ảnh hưởng đến h&agrave;ng h&oacute;a, v&igrave; thế xin Qu&yacute; Kh&aacute;ch vui l&ograve;ng kiểm tra h&agrave;ng h&oacute;a thật kỹ trước khi k&yacute; nhận.&nbsp;<strong><em><span>Linhkiengiatot.vn&nbsp;</span></em></strong>sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm với những sai lệch h&igrave;nh thức của h&agrave;ng ho&aacute; sau khi Qu&yacute; kh&aacute;ch đ&atilde; k&yacute; nhận h&agrave;ng</span></p>\r\n<p><span>&nbsp;</span></p>', '', '', '', 10, 1, 1354501868, 1354501884),
	(11, 4, 0, 0, 'Hướng dẫn đổi trả sản phẩm', 'huong-dan-doi-tra-san-pham', '', '<p><strong>Linhkiengiatot.vn thực hiện đổi h&agrave;ng/trả lại tiền cho qu&yacute; kh&aacute;ch, nhưng kh&ocirc;ng ho&agrave;n lại ph&iacute; vận chuyển hoặc lệ ph&iacute; giao h&agrave;ng, trừ những trường hợp sau:</strong><br /><br />&bull;&nbsp;&nbsp; &nbsp;Kh&ocirc;ng đ&uacute;ng chủng loại, mẫu m&atilde; như qu&yacute; kh&aacute;ch đặt h&agrave;ng.<br />&bull;&nbsp;&nbsp; &nbsp;Kh&ocirc;ng đủ số lượng, kh&ocirc;ng đủ bộ như trong đơn h&agrave;ng.<br />&bull;&nbsp;&nbsp; &nbsp;T&igrave;nh trạng b&ecirc;n ngo&agrave;i bị ảnh hưởng như bong tr&oacute;c, bể vỡ xảy ra trong qu&aacute; tr&igrave;nh vận chuyển,&hellip;<br />&bull;&nbsp;&nbsp; &nbsp;Kh&ocirc;ng đạt chất lượng như: qu&aacute; hạn sử dụng, hết bảo h&agrave;nh, kh&ocirc;ng vận h&agrave;nh được, &hellip;.<br />&bull;&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch vui l&ograve;ng kiểm tra h&agrave;ng h&oacute;a v&agrave; k&yacute; nhận t&igrave;nh trạng với Nh&acirc;n vi&ecirc;n giao h&agrave;ng ngay khi nhận được h&agrave;ng. Khi ph&aacute;t hiện một trong c&aacute;c trường hợp tr&ecirc;n, qu&yacute; kh&aacute;ch c&oacute; thể trao đổi trực tiếp với Nh&acirc;n vi&ecirc;n giao h&agrave;ng hoặc phản hồi cho ch&uacute;ng t&ocirc;i trong v&ograve;ng 24h theo đường d&acirc;y n&oacute;ng</p>\r\n<p><br /><strong>Linhkiengiatot.vn sẽ kh&ocirc;ng chấp nhận đổi/trả h&agrave;ng khi:</strong><br /><br />&bull;&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch muốn thay đổi chủng loại, mẫu m&atilde; nhưng kh&ocirc;ng th&ocirc;ng b&aacute;o trước.<br />&bull;&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch tự l&agrave;m ảnh hưởng t&igrave;nh trạng b&ecirc;n ngo&agrave;i như r&aacute;ch bao b&igrave;, bong tr&oacute;c, bể vỡ,&hellip;<br />&bull;&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch vận h&agrave;nh kh&ocirc;ng đ&uacute;ng chỉ dẫn g&acirc;y hỏng h&oacute;c h&agrave;ng h&oacute;a.<br />&bull;&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch kh&ocirc;ng thực hiện c&aacute;c quy định theo y&ecirc;u cầu để được hưởng chế độ bảo h&agrave;nh (v&iacute; dụ kh&ocirc;ng gửi phiếu bảo h&agrave;nh về đ&uacute;ng nơi quy định trong thời gian quy định).<br />&bull;&nbsp;&nbsp; &nbsp;Qu&yacute; kh&aacute;ch đ&atilde; kiểm tra v&agrave; k&yacute; nhận t&igrave;nh trạng h&agrave;ng h&oacute;a nhưng kh&ocirc;ng c&oacute; phản hồi trong v&ograve;ng 24h kể từ l&uacute;c k&yacute; nhận h&agrave;ng.</p>\r\n<p><strong><span>Ch&uacute; &yacute;:</span></strong></p>\r\n<p>- &nbsp; &nbsp;Quy tr&igrave;nh xử l&yacute; thủ tục đổi hoặc trả h&agrave;ng được thực hiện trong v&ograve;ng hai (02) tuần t&iacute;nh từ ng&agrave;y nhận đủ th&ocirc;ng tin v&agrave; chứng từ từ kh&aacute;ch h&agrave;ng</p>\r\n<p>- &nbsp; &nbsp;Việc đổi h&agrave;ng, sửa chữa sẽ được thực hiện theo đ&uacute;ng quy định của nh&agrave; cung cấp, nh&agrave; sản xuất, hoặc nh&agrave; bảo h&agrave;nh được ủy quyền của nh&agrave; cung cấp, nh&agrave; sản xuất đ&oacute;.</p>', '', '', '', 1, 1, 1354501896, 0),
