	(14, 1, 0, 0, 'Quy định bảo hành', 'quy-dinh-bao-hanh', '', '<p align="center"><strong><span style="text-decoration: underline;">Thao Computer</span></strong></p>\r\n<p align="center"><strong><span style="text-decoration: underline;">Linhkiengiatot.vn</span></strong></p>\r\n<p><strong><span style="text-decoration: underline;">&nbsp;</span></strong></p>\r\n<p><span style="text-decoration: underline;">Quy định bảo h&agrave;nh</span></p>\r\n<p><em>Xin qu&yacute; kh&aacute;ch kiểm tra h&agrave;ng kỹ khi nhận h&agrave;ng.H&agrave;ng được giao ho&agrave;n to&agrave;n mới 100% v&agrave; c&oacute; d&aacute;n tem bảo h&agrave;nh của Thảo Computer. Tr&ecirc;n tem c&oacute; ghi r&otilde; ng&agrave;y th&aacute;ng năm v&agrave; thời hạn bảo h&agrave;nh theo đ&uacute;ng quy định bảo h&agrave;nh của nh&agrave; sản xuất.</em></p>\r\n<p>&nbsp;</p>\r\n<p>v <strong><em>ĐIỀU KIỆN BẢO H&Agrave;NH:</em></strong></p>\r\n<ul>\r\n<li>&Oslash; Tất cả c&aacute;c linh kiện, thiết bị phải c&oacute; tem bảo h&agrave;nh của Thảo Computer v&agrave; tem phải c&ograve;n trong thời hạn bảo h&agrave;nh.&nbsp;</li>\r\n<li>&Oslash; Tem bảo h&agrave;nh, m&atilde; vạch seri number phải c&ograve;n nguy&ecirc;n vẹn, kh&ocirc;ng c&oacute; dấu hiệu cạo sửa, tẩy x&oacute;a hay bị r&aacute;ch mờ.</li>\r\n<li>&Oslash; Những hư hỏng của thiết bị được x&aacute;c định do lỗi kỹ thuật hoặc lỗi của nh&agrave; sản xuất.</li>\r\n<li>C&aacute;c sản phẩm mainboard hoặc CPU khi bảo h&agrave;nh cần phải c&oacute; nắp đậy của CPU, hoặc socket.</li>\r\n<li>&Oslash; Đối với c&aacute;c linh kiện, thiết bị được cấp phiếu bảo h&agrave;nh ch&iacute;nh h&atilde;ng như : m&aacute;y bộ, Laptop, m&aacute;y in, m&aacute;y scanner, sản phẩm của intel .v.v.v :Khi mua c&aacute;c thiết bị, linh kiện n&agrave;y qu&yacute; kh&aacute;ch sẽ nhận được phiếu bảo h&agrave;nh, tr&ecirc;n phiếu c&oacute; ghi r&otilde; c&aacute;c điều kiện bảo h&agrave;nh, địa chỉ bảo h&agrave;nh, quyền lợi của kh&aacute;ch h&agrave;ng&hellip;. Kh&aacute;ch h&agrave;ng phải xuất tr&igrave;nh phiếu bảo h&agrave;nh khi bảo h&agrave;nh sản phẩm trực tiếp tại trung t&acirc;m bảo h&agrave;nh ghi tr&ecirc;n phiếu hoặc tại cửa h&agrave;ng Thảo Computer.</li>\r\n<li>&Oslash; M&agrave;n h&igrave;nh LCD của m&aacute;y bị điểm chấm, c&oacute; số điểm chấm từ 05 điểm trở l&ecirc;n.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>v <strong><em>ĐIỀU KIỆN KH&Ocirc;NG BẢO H&Agrave;NH:</em></strong></p>\r\n<ul>\r\n<li>&Oslash; M&aacute;y hoặc thiết bị c&oacute; dấu hiệu dung dịch lạ hoặc c&oacute; nước v&agrave;o.</li>\r\n<li>&Oslash; M&aacute;y hoặc thiết bị do va chạm hoặc đ&atilde; bị rơi rớt, bể mẻ, m&oacute;p m&eacute;o, biến dạng, trầy xước, vết ẩm ướt, gỉ s&eacute;t, ph&ugrave; tụ.</li>\r\n<li>&Oslash; Thiết bị c&oacute; dấu hiệu ch&aacute;y nổ, chuột bọ, c&ocirc;n tr&ugrave;ng x&acirc;m nhập hoặc được sử dụng trong m&ocirc;i trường ẩm ướt.</li>\r\n<li>&Oslash; Thiết bị hư hỏng do thi&ecirc;n tai hỏa hoạn, sử dụng nguồn điện kh&ocirc;ng ổn định hoặc do lắp đặt, vận chuyển kh&ocirc;ng đ&uacute;ng quy c&aacute;ch, thiết bị bị đứt mạch, ch&aacute;y ph&ugrave;, n&aacute;m .v.v.</li>\r\n<li>&Oslash; C&aacute;c trường hợp b&agrave;n ph&iacute;m của m&aacute;y bị bong ph&iacute;m, g&atilde;y chấu, bể, vỡ .v.v.</li>\r\n<li>&Oslash; C&aacute;c thiết bị mainboard bị cong ch&acirc;n socket, CPU bị cong hoặc g&atilde;y ch&acirc;n.</li>\r\n<li>&Oslash; Kh&ocirc;ng bảo h&agrave;nh c&aacute;c thiết bị phụ kiện như: bộ sạc, tai nghe, cable nối, vỏ m&aacute;y, n&uacute;t c&ocirc;ng tắc, d&acirc;y điện, remote điều khiển, quạt giải nhiệt, sản phẩm tặng k&egrave;m theo chương tr&igrave;nh khuyến m&atilde;i.</li>\r\n<li>&Oslash; Đối với m&aacute;y in, ch&uacute;ng t&ocirc;i kh&ocirc;ng bảo h&agrave;nh bao lụa, đầu phun mực.</li>\r\n</ul>\r\n<p>v <strong><em>CH&Uacute; &Yacute;:</em></strong></p>\r\n<ul>\r\n<li>&Oslash; Kh&ocirc;ng chịu tr&aacute;ch nhiệm bảo h&agrave;nh dữ liệu c&oacute; chứa trong thiết bị lưu trữ của kh&aacute;ch h&agrave;ng khi bảo h&agrave;nh thiết bị.</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>v <strong><em>PHƯƠNG THỨC BẢO H&Agrave;NH:</em></strong></p>\r\n<ul>\r\n<li>&Oslash; Tất cả c&aacute;c thiết bị được bảo h&agrave;nh miễn ph&iacute; trong suốt thời hạn bảo h&agrave;nh.</li>\r\n<li>&Oslash; H&agrave;ng mới mua trong v&ograve;ng 05 ng&agrave;y sẽ được đổi ngay h&agrave;ng mới nếu việc kiểm tra h&agrave;ng đ&oacute; hư hỏng do lỗi của nh&agrave; sản xuất.</li>\r\n<li>&Oslash; Trong trường hợp kh&ocirc;ng c&oacute; h&agrave;ng mới để đổi th&igrave; sẽ thỏa thuận đổi sang h&agrave;ng mới kh&aacute;c c&oacute; gi&aacute; trị tương đương hoặc sẽ ho&agrave;n trả lại đ&uacute;ng số tiền m&agrave; qu&yacute; kh&aacute;ch đ&atilde; mua. Ch&uacute; &yacute; : kh&ocirc;ng &aacute;p dụng đối với c&aacute;c thiết bị như : m&aacute;y in, mực in, c&aacute;c thiết bị c&oacute; t&iacute;nh chất hao m&ograve;n, c&aacute;c thiết bị bị cắt rời, bẻ g&atilde;y, l&agrave;m mất bao b&igrave; hoặc bị trầy xước, do bẩn.</li>\r\n<li>&Oslash; Trường hợp h&agrave;ng đ&atilde; mua qu&aacute; thời hạn 05 ng&agrave;y th&igrave; sẽ được nhận lại để bảo h&agrave;nh (sửa chữa). Nếu kh&ocirc;ng thể sửa chữa được th&igrave; cửa h&agrave;ng sẽ thay thế một sản phẩm kh&aacute;c tương đương v&agrave; sản phẩm n&agrave;y kh&ocirc;ng nhất thiết mới 100%.</li>\r\n<li>&Oslash; Thời gian giải quyết bảo h&agrave;nh từ 3 --&gt; 7 ng&agrave;y kể từ ng&agrave;y nhận (trừ ng&agrave;y Thứ Bảy, Chủ Nhật v&agrave; c&aacute;c ng&agrave;y lễ) v&agrave; t&ugrave;y từng trường hợp c&oacute; thể giải quyết sớm hơn hoặc chậm hơn.</li>\r\n<li>&Oslash; Đối với c&aacute;c sản phẩm của Apple, v&igrave; thiết bị phải gởi ra nước ngo&agrave;i&nbsp;để bảo h&agrave;nh n&ecirc;n thời gian giải quyết bảo h&agrave;nh từ 02 đến 04 tuần&nbsp;&nbsp;</li>\r\n<li>&Oslash; Đối với c&aacute;c thiết bị kh&ocirc;ng thể sửa chữa được m&agrave; thiết bị n&agrave;y hết h&agrave;ng do kh&ocirc;ng c&ograve;n sản xuất nữa hoặc kh&ocirc;ng c&ograve;n lưu h&agrave;nh tr&ecirc;n thị trường, qu&yacute; kh&aacute;ch phải đợi nh&agrave; ph&acirc;n phối đổi h&agrave;ng kh&aacute;c c&oacute; gi&aacute; trị tương đương hoặc cao hơn v&agrave; b&ugrave; tiền theo thỏa thuận của gi&aacute; cả hiện h&agrave;nh tr&ecirc;n thị trường. Thời hạn bảo h&agrave;nh đối với sản phẩm được thay thế sẽ được t&iacute;nh tiếp tục m&agrave; kh&ocirc;ng bảo h&agrave;nh lại từ đầu.</li>\r\n<li>&Oslash; Đối với c&aacute;c thiết bị kh&ocirc;ng sửa chữa được trong nước phải gởi sang nh&agrave; sản xuất ở nước ngo&agrave;i th&igrave; thời hạn c&oacute; thể k&eacute;o d&agrave;i từ 4 đến 6 tuần. Trong trường hợp n&agrave;y cửa h&agrave;ng sẽ thay thế một sản phẩm c&oacute; t&iacute;nh năng tương đương để qu&yacute; kh&aacute;ch tạm sử dụng.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p align="right"><strong><em>RẤT H&Acirc;N HẠNH ĐƯỢC PHỤC VỤ QU&Yacute; KH&Aacute;CH!</em></strong></p>\r\n<p><strong><em><span style="text-decoration: underline;">&nbsp;</span></em></strong></p>\r\n<p>&nbsp;</p>\r\n<p>v <strong><em><span style="text-decoration: underline;">Bổ sung ch&iacute;nh s&aacute;ch giao nhận:</span></em></strong></p>\r\n<p>+ N&ecirc;u r&otilde; từng địa điểm, khu vực hổ trợ giao h&agrave;ng miễn ph&iacute;, thanh&nbsp; to&aacute;n bằng tiền mặt.</p>\r\n<p>+ Nếu c&aacute;c địa điểm t&iacute;nh ph&iacute;, phải n&ecirc;u r&otilde; ph&iacute; l&agrave; bao nhi&ecirc;u.</p>\r\n<p>+ Thời gian giao h&agrave;ng: n&ecirc;u r&otilde; cụ thể trong khoản thời gian bao l&acirc;u&nbsp; c&oacute; thể giao h&agrave;ng tận nơi cho kh&aacute;ch, nếu kh&aacute;ch h&agrave;ng muốn xem h&agrave;ng trước, n&ecirc;u r&otilde; thời gian kh&aacute;ch h&agrave;ng c&oacute; thể đến cửa h&agrave;ng để xem h&agrave;ng.</p>\r\n<p>v <strong><em><span style="text-decoration: underline;">Chỉnh sửa:</span></em></strong></p>\r\n<p>+ Sửa mouse 350 &egrave; 305</p>\r\n<p>+ Kh&aacute;ch h&agrave;ng dể d&agrave;ng đăng k&iacute; th&agrave;nh vi&ecirc;n qua mail của kh&aacute;ch h&agrave;ng, để c&oacute; thể gửi tin tức của cửa h&agrave;ng cho kh&aacute;ch thường xuy&ecirc;n theo d&otilde;i.</p>\r\n<p>+ Tạo một diển đ&agrave;n cho web để c&aacute;c th&agrave;nh vi&ecirc;n c&oacute; thể trao đổi v&agrave; b&igrave;nh luận với sự kiểm so&aacute;t của admin.</p>\r\n<p>+ Giỏ mua h&agrave;ng phải to l&ecirc;n, nh&igrave;n v&agrave;o c&oacute; thể thấy ngay.</p>\r\n<p>+ Thanh to&aacute;n tiền, mua th&ecirc;m h&agrave;ng nhỏ lại,&hellip;.( Khung vừa với chữ, l&agrave;m nổi bật khung l&ecirc;n..)</p>\r\n<p>+ Kh&ocirc;ng search được sản phẩm..</p>\r\n<p>+ Kh&ocirc;ng cập nhật được tiền khi đặt mua nhiều sản phẩm</p>\r\n<p>+ Trang thanh to&aacute;n tiền bị lổi, kh&ocirc;ng cập nhật được..</p>\r\n<p>+ T&ecirc;n sản phẩm nhỏ d&agrave;i, nh&igrave;n rất rối mắt&hellip;</p>\r\n<p>+ Gi&aacute; để dưới sản phẩm kh&ocirc;ng ngay h&agrave;ng thẳng lối.</p>\r\n<p>+ Trang chủ thiết kế độ lớn nhỏ sản phẩm kh&ocirc;ng ph&ugrave; hợp l&agrave;m trang chủ nh&igrave;n kh&ocirc;ng đẹp mắt.</p>\r\n<p>+ M&agrave;u sắc gi&aacute; v&agrave; t&ecirc;n sản phẩm m&ugrave; mờ, khiến trang web tối, kh&ocirc;ng nổi bật..</p>\r\n<p><strong>+ Linh kiện latop kh&ocirc;ng c&oacute;&hellip;.</strong></p>\r\n<p>+ Click ph&oacute;ng to h&igrave;nh ảnh nếu c&oacute; nhiều h&igrave;nh cho người xem thấy được nhiều g&oacute;c sản phẩm th&igrave; hay hơn.</p>\r\n<p><strong>+ Chi tiết kh&ocirc;ng đầy đủ về giới thiệu sản phẩm, chi tiết sản phẩm&hellip;..</strong></p>\r\n<p>&nbsp;</p>', '', '', '', 1, 1, 1355812967, 0);
