INSERT INTO `table_thugian` (`id`, `id_item`, `tinnoibat`, `tinmoi`, `ten`, `tenkhongdau`, `mota`, `noidung`, `loaitin`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`) VALUES
	(1, 0, 0, 0, 'Thơ tình IT', 'tho-tinh-it', '<p><span>T&igrave;nh y&ecirc;u modem cũng đẹp như thơ<span class="apple-converted-space">&nbsp;</span></span><span><br /><span>Kh&aacute;c chi chuyện Romeo thời hiện đại</span><br /><span>Cuối th&aacute;ng cầm tờ h&oacute;a đơn điện thoại<span class="apple-converted-space">&nbsp;</span></span><br /><span>Ch&agrave;ng Romeo bỗng cảm thấy... hơi buồn.</span><br /><br /><span>Ch&agrave;ng kh&ocirc;ng thể nh&igrave;n n&agrave;ng qua modem</span><br /><span>Ch&agrave;ng kh&ocirc;ng thể h&ocirc;n n&agrave;ng qua b&agrave;n ph&iacute;m</span><br /><span>Ch&agrave;ng kh&ocirc;ng thể cầm tay n&agrave;ng &acirc;u yếm</span><br /><span>Ch&agrave;ng chỉ n&oacute;i "y&ecirc;u em" v&agrave; cứ thế Enter.</span><br /><br /><span>V&agrave; hai người cứ y&ecirc;u vậy trong mơ<span class="apple-converted-space">&nbsp;</span></span><br /><span>Trong chiếc khung con mỗi lần hội thoại.<span class="apple-converted-space">&nbsp;</span></span><br /><span>Đ&ecirc;m c&agrave;ng khuya, họ c&agrave;ng m&ecirc; mải<span class="apple-converted-space">&nbsp;</span></span><br /><span>N&oacute;i chuyện trăng sao, mật ngọt thi&ecirc;n đường.<span class="apple-converted-space">&nbsp;</span></span><br /><br /><span>N&agrave;ng hỏi ch&agrave;ng: "Anh cứ n&oacute;i y&ecirc;u thương..."<span class="apple-converted-space">&nbsp;</span></span><br /><span>Thế m&agrave; bỗng nhi&ecirc;n anh biến đi đ&acirc;u mất"<span class="apple-converted-space">&nbsp;</span></span><br /><span>Ch&agrave;ng vội v&atilde;: "Ơ k&igrave;a, anh n&oacute;i thật...</span><br /><span>Anh bị out, vừa lập tức chui v&agrave;o".</span><br /><br /><span>Họ cứ y&ecirc;u nhau như mận y&ecirc;u đ&agrave;o</span><br /><span>&Ocirc;m computer mỗi ng&agrave;y mấy tiếng</span><br /><span>Chat m&atilde;i chat ho&agrave;i kh&ocirc;ng hết chuyện</span><br /><span>T&igrave;nh y&ecirc;u cứ theo năm th&aacute;ng vơi đầy.</span><br /><br /><span>V&agrave; b&ecirc;n ngo&agrave;i kia tr&aacute;i đất vẫn quay<span class="apple-converted-space">&nbsp;</span></span><br /><span>Qua chiếc modem những mối t&igrave;nh vẫn nở<span class="apple-converted-space">&nbsp;</span></span><br /><span>Cũng lắm gian tru&acirc;n, cũng nhiều trắc trở<span class="apple-converted-space">&nbsp;</span></span><br /><span>Cũng "I love you", rồi cũng lại Enter.</span><br /><br /><span>C&oacute; nhiều l&uacute;c gục đầu tr&ecirc;n Keyboard<span class="apple-converted-space">&nbsp;</span></span><br /><span>Anh v&ocirc; t&igrave;nh nhấn Shift viết t&ecirc;n em</span><br /><br /><span>Anh y&ecirc;u em m&agrave; em chẳng Open<span class="apple-converted-space">&nbsp;</span></span><br /><span>Mở cửa tr&aacute;i tim v&agrave; Save anh v&agrave;o đ&oacute;</span><br /><br /><span>Cửa nh&agrave; em mẹ đ&atilde; g&agrave;i Password<span class="apple-converted-space">&nbsp;</span></span><br /><span>Su&yacute;t nữa anh r&aacute;ch quần v&igrave; cố vượt Firewall.</span><br /><br /><br /><span>Tr&aacute;i tim anh, em Select bằng Mouse</span><br /><span>Chốn hẹn h&ograve;: Forum - Internet</span><br /><span>Lời y&ecirc;u thương truyền bằng phương thức Get</span><br /><span>Nhận d&aacute;ng h&igrave;nh qua địa chỉ IP</span><br /><br /><span>Nếu một mai em vĩnh viễn ra đi</span><br /><span>Anh sẽ chết giữa mu&ocirc;n ng&agrave;n biển Search</span><br /><span>Lời tỏ t&igrave;nh kh&ocirc;ng dễ g&igrave; Convert</span><br /><span>Lưu ng&agrave;n đời v&agrave;o biến Constant</span><br /><br /><span>Anh ngh&egrave;o kh&oacute; mang d&ograve;ng m&aacute;u Sun</span><br /><span>Em quyền qu&yacute; với họ Microsoft</span><br /><span>Hai d&ograve;ng Code kh&ocirc;ng thể n&agrave;o ho&agrave; hợp</span><br /><span>Dẫu ng&agrave;n lần Debug em ơi</span><br /><br /><span>Sao kh&ocirc;ng c&oacute; một thế giới xa x&ocirc;i</span><br /><span>Linux cũng thế m&agrave; Windows cũng thế</span><br /><span>Hai ch&uacute;ng ta chẳng thể n&agrave;o chia rẽ</span><br /><span>Run suốt đời tr&ecirc;n mọi Platform.</span><br /><br /><span>Em vội bước ra đi qu&ecirc;n Logoff</span><br /><span>Chẳng một lời d&ugrave; chỉ tiếng Standby</span><br /><span>Em qu&ecirc;n hết kỷ niệm xưa đ&atilde; Add</span><br /><span>Quẳng t&igrave;nh anh v&agrave;o khoảng trống Recycle Bin.</span><br /><br /><span>Anh vẫn đợi tr&ecirc;n nền xanh Desktop</span><br /><span>B&oacute;ng em vừa Refresh hồn anh</span><br /><span>Từng c&uacute; Click em đi v&agrave;o nỗi nhớ</span><br /><span>Trong tim anh... Harddisk .. dần đầy.</span><br /><br /><span>Anh gh&eacute;t qu&aacute;, muốn Clean đi tất cả</span><br /><span>Nhưng phải l&agrave;m sao khi .. chẳng biết Username</span><br /><span>Hay m&igrave;nh sẽ một lần Full Format</span><br /><span>Em đ&atilde; change .. Password cũ c&ograve;n đ&acirc;u!</span><br /><br /><span>Anh sẽ cố một lần anh sẽ cố<span class="apple-converted-space">&nbsp;</span></span><br /><span>Sẽ Retry cho đến l&uacute;c Error.</span><br /><span>Nhưng em hỡi l&agrave;m sao anh c&oacute; thể ..</span><br /><span>Khi Soft anh d&ugrave;ng... đ&atilde; hết Free Trial!!!</span><br /><span>H&igrave;nh b&oacute;ng em vẫn m&atilde;i Default...</span></span></p>', '<p><span>T&igrave;nh y&ecirc;u modem cũng đẹp như thơ<span class="apple-converted-space">&nbsp;</span></span><span><br /><span>Kh&aacute;c chi chuyện Romeo thời hiện đại</span><br /><span>Cuối th&aacute;ng cầm tờ h&oacute;a đơn điện thoại<span class="apple-converted-space">&nbsp;</span></span><br /><span>Ch&agrave;ng Romeo bỗng cảm thấy... hơi buồn.</span><br /><br /><span>Ch&agrave;ng kh&ocirc;ng thể nh&igrave;n n&agrave;ng qua modem</span><br /><span>Ch&agrave;ng kh&ocirc;ng thể h&ocirc;n n&agrave;ng qua b&agrave;n ph&iacute;m</span><br /><span>Ch&agrave;ng kh&ocirc;ng thể cầm tay n&agrave;ng &acirc;u yếm</span><br /><span>Ch&agrave;ng chỉ n&oacute;i "y&ecirc;u em" v&agrave; cứ thế Enter.</span><br /><br /><span>V&agrave; hai người cứ y&ecirc;u vậy trong mơ<span class="apple-converted-space">&nbsp;</span></span><br /><span>Trong chiếc khung con mỗi