pan><br /><span>Nhưng em hỡi l&agrave;m sao anh c&oacute; thể ..</span><br /><span>Khi Soft anh d&ugrave;ng... đ&atilde; hết Free Trial!!!</span><br /><span>H&igrave;nh b&oacute;ng em vẫn m&atilde;i Default...</span></span></p>', '', '', '', 1, 1, 1354267096, 0),
	(2, 0, 0, 0, 'CTRL+Z', 'ctrlz', '<p><span>Gi&aacute; như anh c&oacute; thể ấn Ctrl+Z</span><span><br /><span>Để Undo những g&igrave; đ&atilde; xảy ra</span><br /><span>Ngay cả những lập tr&igrave;nh vi&ecirc;n quốc tế</span><br /><span>C&ograve;n c&oacute; thể mắc lỗi nữa l&agrave;....</span><br /><br /><span>Gi&aacute; như anh c&oacute; thể ấn Ctrl+Z</span><br /><span>Một lần, chỉ đ&uacute;ng một lần th&ocirc;i.</span><br /><span>Anh sẽ Debug những lỗi lầm đ&aacute;ng gh&eacute;t</span><br /><span>Em sẽ hiểu anh đ&acirc;u phải thằng tồi.</span><br /><br /><span>Nhưng anh kh&ocirc;ng thể ấn Ctrl+Z</span><br /><span>Trong phần mềm c&oacute; t&ecirc;n gọi l&agrave; t&igrave;nh y&ecirc;u</span><br /><span>Chỉ c&oacute; thể chọn Continue hay Exit</span><br /><span>V&agrave; tất nhi&ecirc;n anh chưa muốn xa em.</span><br /><br /><span>H&atilde;y hiểu cho l&ograve;ng anh em nh&eacute;</span><br /><span>V&agrave; xin em, h&atilde;y rộng mở l&ograve;ng em</span><br /><span>Khi m&atilde; nguồn tr&aacute;i tim kh&ocirc;ng c&ograve;n đ&oacute;ng</span><br /><span>Anh sẽ viết l&ecirc;n đ&oacute; d&ograve;ng t&ecirc;n em.</span></span></p>', '', '', '', '', 1, 1, 1354497402, 0);
