INSERT INTO `table_tuyendung` (`id`, `noidung_vi`, `noidung_en`) VALUES
	(1, '<p align="center"><strong>Quy định bảo h&agrave;nh</strong></p>\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n<h4>ĐIỀU KIỆN BẢO H&Agrave;NH</h4>\r\n<p><strong>*Thời gian nhận m&aacute;y bảo h&agrave;nh</strong></p>\r\n<p>-&nbsp; Từ 12h00 đến 19h00 tất cả c&aacute;c ng&agrave;y trừ ng&agrave;y lễ v&agrave; chủ nhật</p>\r\n<p>-&nbsp; Trong thời gian bảo h&agrave;nh,nếu c&oacute; hư hỏng qu&yacute; kh&aacute;ch vui l&ograve;ng gửi lại cho trung t&acirc;m từ 3- 7 ng&agrave;y</p>\r\n<p>-&nbsp; M&aacute;y phải mang trực tiếp đến trung t&acirc;m c&ugrave;ng với phiếu bảo h&agrave;nh. M&aacute;y chỉ bảo h&agrave;nh khi c&oacute; phiếu bảo h&agrave;nh.</p>\r\n<p>v&agrave; ghi đầy đủ c&aacute;c dữ liệu cần thiết tr&ugrave;ng khớp với số IMEI hiện l&ecirc;n tr&ecirc;n m&agrave;n h&igrave;nh m&aacute;y, kh&ocirc;ng được tẩy x&oacute;a, sửa chữa.</p>\r\n<p>&nbsp;</p>\r\n<p>* Đối với m&aacute;y trong chế độ bảo h&agrave;nh. ( Phiếu c&ograve;n trong thời gian hiệu lực v&agrave; tem d&aacute;n bảo h&agrave;nh c&ograve;n nguy&ecirc;n )</p>\r\n<p>-Trong 3 ng&agrave;y đầu sử dụng qu&yacute; kh&aacute;ch sẽ được đổi m&aacute;y mới trong trường hợp m&aacute;y đ&atilde; mua bị lỗi phần cứng(điều kiện th&acirc;n m&aacute;y kh&ocirc;ng bị xướt)</p>\r\n<p>- Trung t&acirc;m sẽ sửa chữa v&agrave; thay thế miễn ph&iacute; c&aacute;c lỗi hư hỏng do nh&agrave; sản xuất.</p>\r\n<p><strong>*Trong những trường hợp sau, trung t&acirc;m sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm bảo h&agrave;nh.</strong></p>\r\n<p>- M&aacute;y kh&ocirc;ng được sử dụng đ&uacute;ng theo những chỉ dẫn trong sổ tay hướng dẫn.</p>\r\n<p>- M&agrave;n h&igrave;nh LCD bị mất n&eacute;t, đen trắng, lệch cảm ứng v&agrave; sọc m&agrave;n h&igrave;nh sau khi đ&atilde; sử dụng. Kh&ocirc;ng bảo h&agrave;nh camera, thẻ nhớ theo m&aacute;y, tai nghe kh&ocirc;ng nghe được. KH&Ocirc;NG BẢO H&Agrave;NH M&Agrave;N H&Igrave;NH, CẢM ỨNG, D&Acirc;Y NGUỒN</p>\r\n<p>- Vỏ th&acirc;n m&aacute;y bị trầy xướt, c&oacute; vết mốc, gỉ, ăn m&ograve;n, bị nứt vỡ, biến dạng, ch&aacute;y nổ, c&oacute; chất lỏng, d&acirc;y nguồn do đ&oacute;ng mở.</p>\r\n<p>- M&aacute;y để trong m&ocirc;i trường ẩm ướt, nhiệt độ cao, ngo&agrave;i nắng, gần lửa, c&aacute;c nguồn nhiệt vượt qu&aacute; nhiệt độ cho ph&eacute;p ( tr&ecirc;n 15C v&agrave; dưới 40C)</p>\r\n<p>- M&aacute;y c&oacute; m&ugrave;i kh&eacute;t, m&ugrave;i lạ tại một phần của m&aacute;y hoặc to&agrave;n bộ m&aacute;y. M&aacute;y bị cấn dẫn đến cong mainboard.</p>\r\n<p>- M&aacute;y bị ướt mưa, rơi v&agrave;o nước, rơi xuống đất hoặc va chạm v&agrave;o những vật cứng&nbsp;<br /> <br /> - Kh&aacute;ch h&agrave;ng tự &yacute; can thiệp v&agrave;o b&ecirc;n trong m&aacute;y hoặc tự &yacute; nạp phần mềm, Up Rom Pocket, BlackBerry ( kh&ocirc;ng phải của trung t&acirc;m ).</p>\r\n<p>- M&aacute;y trong t&igrave;nh trạng Security Code, Lock Sim Card, Contact Service. M&agrave;n h&igrave;nh trắng kh&ocirc;ng đọc được số IMEI.</p>\r\n<p>- Thay đổi, l&agrave;m g&atilde;y Antenna hoặc d&aacute;n keo l&agrave;m m&aacute;y kh&ocirc;ng tỏa nhiệt được ( dễ bị cứng b&agrave;n ph&iacute;m bấm kh&ocirc;ng được).</p>\r\n<p>- Phiếu bảo h&agrave;nh bị mất, sửa chữa hoặc kh&ocirc;ng ch&iacute;nh x&aacute;c với cuốn phiếu của trung t&acirc;m.</p>\r\n<p>- M&aacute;y đem đến trung t&acirc;m bảo h&agrave;nh sau ng&agrave;y hết hạn bảo h&agrave;nh.</p>\r\n<p>- Trung t&acirc;m bảo h&agrave;nh kh&ocirc;ng giải quyết mọi l&yacute; do đổi hoặc trả lại m&aacute;y.</p>\r\n<p><strong><br /> </strong><strong>** Xin qu&yacute; kh&aacute;ch lưu &yacute; c&aacute;c quy định tr&ecirc;n để việc sử dụng v&agrave; bảo h&agrave;nh m&aacute;y được thuận tiện.</strong></p>\r\n<p>---------------------------------------------------------------------------------------------------------------------------------</p>\r\n<p><strong><strong>Trung T&acirc;m Thiết Bị Viễn Th&ocirc;ng Huy Ho&agrave;ng Mobile</strong><br /> </strong>353 L&ecirc; Quang Định, P. 5, Q.B&igrave;nh Thạnh, TP.HCM</p>', '');
